e rent av i ett annat land? Du får snabbt stort eget ansvar och får chansen att visa vad du går för. Samtidigt som vi gör vad vi kan för att hjälpa dig hålla balansen mellan arbete och fritid. För du vill ju inte bara ha ett bra jobb, du vill väl skapa dig ett bra liv?'),(81,1,'catalogue_students_dont_know','Vid en utgrävning i Australien 1984 upptäcktes en ny dinosaurieart, den fick namnet Atlascopcosuarus Loadsi som tack för att vi bistod med utrustning och expertis.\r\n'),(82,1,'catalogue_why_visit','Vill du ta reda på hur du kan skaffa dig ett riktigt jobb från första arbetsdagen och själv påverka din egen karriär både i Sverige och utomlands - då skall du besöka vår monter. '),(83,1,'catalogue_question_freetext',''),(84,1,'catalogue_answer','Kundfokuserade \r\nVåra kunder kommer alltid först. Vi vill ha anställda som är lyhörda för kundernas behov och som kan skapa innovativa lösningar för att lösa deras problem. \r\n\r\nRedo att ta ansvar \r\nAtlas Copco-anställda tilldelas ett ansvarsområde redan första dagen på det nya arbetet. Vi söker folk som har viljan och möjligheten att lyckas. \r\n\r\nMedarbetare \r\nVi söker anställda som kan arbeta mellan olika funktioner och affärsområden för att uppnå goda resultat. Vi tror på att dela och lära av goda lösningar. Det finns alltid en bättre lösning. \r\n\r\nInitiativrika \r\nVåra anställda tycker om personliga utmaningar och hanterar sin egen karriärutveckling. De tar initiativ och är självmotiverade. \r\n\r\nÖppna för nya idéer \r\nPå Atlas Copco kommer du ofta att arbeta tillsammans med andra i multikulturella team. Vi behöver folk som är öppna för nya kulturer, utmaningar och idéer.  \r\n\r\n'),(85,1,'catalogue_question','Dessa egenskaper söker vi främst hos dig som medarbetare hos oss:, We are looking for someone with, mainly, the following qualities:'),(86,1,'catalogue_contact_same','Ja, yes'),(87,1,'catalogue_contact_firstname','Carl-Magnus'),(88,1,'catalogue_contact_lastname','Jonsson'),(89,1,'catalogue_contact_email','carl-magnus.jonsson@se.atlascopco.com'),(90,1,'catalogue_contact_cell','+46 708 3082 42'),(91,1,'catalogue_contact_position','HR Professional Employer Branding'),(92,1,'catalogue_ad_description','De blå barerna måste gå ända ut i kanten, som i pdf:en. Går inte detta att lösa krävs en svart tunn ram runt annonsen.\r\n\r\nDet måste finnas ett free space runt loggan som är lika stort som avståndet mellan loggans blå barer (mellanrummet där det står Atlas Copco)\r\n\r\nVid frågor kontakta Linnea Blomqvist \r\nPhone: +46 (0)19 768 25 96 - Mobile: +46 (0)70 313 71 82\r\nlinnea.blomqvist@se.atlascopco.com'),(93,1,'catalogue_link_website','http://www.atlascopco.com'),(94,1,'catalogue_link_website_student','http://www.atlascopco.se/sesv/careers/whatwelookfor/stdentsandgradautes/'),(95,1,'catalogue_last_day_xjob',''),(96,1,'catalogue_link_internship',''),(97,1,'catalogue_last_day_internship',''),(98,1,'catalogue_link_summerjob',''),(99,1,'catalogue_last_day_summerjob',''),(100,1,'catalogue_link_trainee',''),(101,1,'catalogue_last_day_trainee',''),(102,1,'catalogue_link_positions','http://www.atlascopco.se/sesv/careers/openjobs/'),(103,1,'catalogue_link_facebook','http://www.facebook.com/lifeatatlascopco'),(104,1,'catalogue_link_twitter','http://twitter.com/AtlasCopcoGroup'),(105,1,'catalogue_link_youtube','http://www.youtube.com/user/AtlasCopcoGroup'),(106,2,'company_username','Accenture AB'),(107,2,'billing_reference','Nina Meincke'),(108,2,'billing_phone','08-4513079'),(109,2,'billing_address','Box 1331'),(110,2,'billing_zipcode','11183'),(111,2,'billing_city','Stockholm'),(112,2,'billing_country','Sverige'),(113,2,'billing_extra_information',''),(114,2,'contact_firstname','Nina'),(115,2,'contact_lastname','Meincke'),(116,2,'contact_email','nina.meincke@accenture.com'),(117,2,'contact_alt_email','hanna.lindahl@accenture.com'),(118,2,'contact_cell','0730-513079'),(119,2,'contact_phone','08-4513079'),(120,2,'org_name','Accenture AB'),(121,2,'org_number','556608066