panien, andra dagen balansera ett löphjul i en vattenkraftstation och sedan sitta på kontoret och konstruera exempelvis en navkropp. Du ritar saker som tillverkas en trappa ned. Produkterna är extremt tunga och har höga krav med toleranser på upp till hundradels mm. Du är nära produktionen. Ibland tillverkas det du konstruerade för flera år sedan (vi har långa projekt) och ibland tillverkas dina konstruktioner samma eftermiddag du lämnar ifrån dig ritningen för att sedan skickas till site för montage dagen efter. Om vi får säga det själva så är det ett väldigt varierande och mycket utmanande jobb!'),(505,5,'catalogue_question','Så här ser en arbetsdag för en naturvetare/ingenjör/arkitekt ut:, This is a typical day at work for a scientist/engineer/architect:'),(506,5,'catalogue_contact_same','Ja, yes'),(507,5,'catalogue_contact_firstname',''),(508,5,'catalogue_contact_lastname',''),(509,5,'catalogue_contact_email',''),(510,5,'catalogue_contact_cell',''),(511,5,'catalogue_contact_position','HR'),(512,5,'catalogue_ad_description','Kort beksrivning av vår verksamhet. Liggande A5 (hoppas jag) och håller tummarna för att det går bra.'),(513,5,'catalogue_link_website','http://www.andritz.com'),(514,5,'catalogue_link_website_student','http://'),(515,5,'catalogue_last_day_xjob',''),(516,5,'catalogue_link_internship',''),(517,5,'catalogue_last_day_internship',''),(518,5,'catalogue_link_summerjob',''),(519,5,'catalogue_last_day_summerjob',''),(520,5,'catalogue_link_trainee',''),(521,5,'catalogue_last_day_trainee',''),(522,5,'catalogue_link_positions','http://'),(523,5,'catalogue_link_facebook','http://'),(524,5,'catalogue_link_twitter','http://'),(525,5,'catalogue_link_youtube','http://'),(526,6,'company_username','Academic Work Umeå'),(527,6,'billing_reference','Jonas Tåden'),(528,6,'billing_phone','073-6444138'),(529,6,'billing_address','Drottninggatan 23'),(530,6,'billing_zipcode','582 25 '),(531,6,'billing_city','Linköping'),(532,6,'billing_country','Sverige'),(533,6,'bill