jänster vi har lediga just nu och vad som kan passa olika studenter beroende på studieinriktning. Vår monterpersonal finns på plats för att svara på frågor och kan dessutom hjälpa till med lättare CV-granskning. Vår monter är studenternas väg ut i arbetslivet!'),(608,6,'catalogue_question_freetext',''),(609,6,'catalogue_answer','Vi på Academic Work samarbetar med kunder inom de flesta områden och branscher, därför riktar vi oss till ett brett urval av studenter med olika inriktningar. Genom oss kan studenter få studierelaterade arbeten oavsett om man vill jobba extra, om man vill ha ett konsultuppdrag eller bli rekryterad. Dessutom har vi icke-studierelaterade extrajobb som kan vara bra att ha vid sidan av sina studier, dels för att tjäna extra pengar men också för att få viktig arbetslivserfarenhet!'),(610,6,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(611,6,'catalogue_contact_same','Ja, yes'),(612,6,'catalogue_contact_firstname','Gabriella'),(613,6,'catalogue_contact_lastname','Israelsson'),(614,6,'catalogue_contact_email','gabriella.israelsson@academicwork.se'),(615,6,'catalogue_contact_cell','073-8448273'),(616,6,'catalogue_contact_position','Event koordinator'),(617,6,'catalogue_ad_description',''),(618,6,'catalogue_link_website','www.academicwork.se'),(619,6,'catalogue_link_website_student','www.academicwork.se'),(620,6,'catalogue_last_day_xjob',''),(621,6,'catalogue_link_internship',''),(622,6,'catalogue_last_day_internship',''),(623,6,'catalogue_link_summerjob',''),(624,6,'catalogue_last_day_summerjob',''),(625,6,'catalogue_link_trainee',''),(626,6,'catalogue_last_day_trainee',''),(627,6,'catalogue_link_positions','http://'),(628,6,'catalogue_link_facebook','http://www.facebook.com/AcademicWork'),(629,6,'catalogue_link_twitter','http://'),(630,6,'catalogue_link_youtube','http://www.youtube.com/watch?v=e9uBp8OI72A'),(631,7,'company_username','BAE SYSTEMS'),(632,7,'billing_reference','v52094 Barbro Wik