r idag även en civil gren som arbetar med utveckling av elhybriddrift för t ex gruvdrift.'),(712,7,'catalogue_why_visit','BAE Systems ger dig chansen att arbeta inom ett världsomspännande företag där vi hela tiden utmanar oss själva och förbättrar våra arbetsmetoder. Vårt mål ar att vara bäst - genom att vara pålitliga, innovativa och djärva.\r\nSom anställd hos oss får du all tänkbar hjälp för att kunna möta dina utmaningar på bästa sätt. Du kan lita på att din omgivning fångar upp önskemål om utveckling och erbjuder lösningar utifrån dina egna förutsättningar. Förutom nya utmaningar lokalt, ger vår stora organisation möjlighet till jobbrotation inom Sverige eller internationellt.'),(713,7,'catalogue_question_freetext',''),(714,7,'catalogue_answer','Hos oss får du arbeta i projektverksamhet där lagarbete och delat ansvar är viktigt. Du får vara med när produkten skapas från idé till att den rullar ut till kund.'),(715,7,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(716,7,'catalogue_contact_same','Ja, yes'),(717,7,'catalogue_contact_firstname',''),(718,7,'catalogue_contact_lastname',''),(719,7,'catalogue_contact_email',''),(720,7,'catalogue_contact_cell',''),(721,7,'catalogue_contact_position','Personalrådgivare'),(722,7,'catalogue_ad_description',''),(723,7,'catalogue_link_website','http://www.baesystems.com/sweden'),(724,7,'catalogue_link_website_student','http://www.baesystems.com/careerssweden'),(725,7,'catalogue_last_day_xjob',''),(726,7,'catalogue_link_internship',''),(727,7,'catalogue_last_day_internship',''),(728,7,'catalogue_link_summerjob',''),(729,7,'catalogue_last_day_summerjob',''),(730,7,'catalogue_link_trainee',''),(731,7,'catalogue_last_day_trainee',''),(732,7,'catalogue_link_positions','http://www.baesystems.com/careerssweden'),(733,7,'catalogue_link_facebook','http://'),(734,7,'catalogue_link_twitter','http://'),(735,7,'catalogue_link_youtube','http://'),(736,8,'company_username','Bombardier