ducera framtidens tåg? Är du intresserad av att arbeta i en internationell miljö med möjlighet att arbeta utomlands?\r\nDå är Bombardier en arbetsgivare för dig!'),(816,8,'catalogue_students_dont_know','90% av materialet i Bombardier tåg är återvinningsbart\r\nÖver 100 000 lok och motorvagnar tillverkade av Bombardier är i tjänst världen över'),(817,8,'catalogue_why_visit','För att Bombardier är ett spännande företag som ligger i framkant av teknikutvecklingen inom vårt område. Om man vill vara med på den resan eller bara veta mer om oss skall man komma till vår monter.'),(818,8,'catalogue_question_freetext',''),(819,8,'catalogue_answer','Varje dag börjar med att prioritera dagens arbete. Dels finns planerat arbete som är kvar att göra, dels brukar det komma till arbete från mailtrafik från andra tidszoner under natten. När dagens mål är satt påbörjas arbetet. Det kan bestå i av att delta i möten med interna och/eller externa samarbetsparter, labbtester, skriva/utvärdera teknisk dokumentation, designa lösningar för system, resor utomlands mm. Beroende på vilket projekt som man arbetar i för tillfället tar arbetsuppgifterna olika karaktär, men ofta är det problem att lösa och då jag är en del i organisationen är det också många andra som är beroende av min input, för att deras arbete kan fortskrida. Arbetsdagarna är ofta mycket dynamiska och därmed stimulerande, intressanta och framför allt roliga. I och med den höga graden av samarbete i våra stora projekt är kommunikationen med andra människor både globalt och lokalt en integral och rolig del i en normal arbetsdag.'),(820,8,'catalogue_question','Så här ser en arbetsdag för en naturvetare/ingenjör/arkitekt ut:, This is a typical day at work for a scientist/engineer/architect:'),(821,8,'catalogue_contact_same','Ja, yes'),(822,8,'catalogue_contact_firstname','\''),(823,8,'catalogue_contact_lastname','\''),(824,8,'catalogue_contact_email','\''),(825,8,'catalogue_contact_cell','\''),(826,8,'catalogue_contact_position','