den anställde.'),(1027,10,'catalogue_why_visit','Prata med oss om framtidens kompetensbehov'),(1028,10,'catalogue_question_freetext',''),(1029,10,'catalogue_answer','Härlig atmosfär med bra personalpolitik. Bra och utmanande arbetsuppgifter. Mångfald av olika karriärvägar. Vi söker dig som är nyfiken, engagerad och problemlösare.\r\n\r\n\r\n\r\n'),(1030,10,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(1031,10,'catalogue_contact_same','Ja, yes'),(1032,10,'catalogue_contact_firstname',''),(1033,10,'catalogue_contact_lastname',''),(1034,10,'catalogue_contact_email',''),(1035,10,'catalogue_contact_cell',''),(1036,10,'catalogue_contact_position','Personalutvecklare'),(1037,10,'catalogue_ad_description',''),(1038,10,'catalogue_link_website','http://boliden.com'),(1039,10,'catalogue_link_website_student','http://'),(1040,10,'catalogue_last_day_xjob',''),(1041,10,'catalogue_link_internship',''),(1042,10,'catalogue_last_day_internship',''),(1043,10,'catalogue_link_summerjob',''),(1044,10,'catalogue_last_day_summerjob',''),(1045,10,'catalogue_link_trainee',''),(1046,10,'catalogue_last_day_trainee',''),(1047,10,'catalogue_link_positions','http://'),(1048,10,'catalogue_link_facebook','http://'),(1049,10,'catalogue_link_twitter','http://'),(1050,10,'catalogue_link_youtube','http://'),(1051,11,'company_username','maria.rygaard@combitech.se'),(1052,11,'billing_reference','Maria Rygaard'),(1053,11,'billing_phone','013-18 9536'),(1054,11,'billing_address','Ljungadalsv 3'),(1055,11,'billing_zipcode','351 80 '),(1056,11,'billing_city','Växjö'),(1057,11,'billing_country','Sverige'),(1058,11,'billing_extra_information',''),(1059,11,'contact_firstname','Maria'),(1060,11,'contact_lastname','Rygaard'),(1061,11,'contact_email','maria.rygaard@combitech.se'),(1062,11,'contact_alt_email','herman.viklund@combitech.se'),(1063,11,'contact_cell','0708-895136'),(1064,11,'contact_phone','013-189536'),(1065,11,'org_name','Combitech AB'),(1066,