eva kraftfull personlig utveckling under hela resan.   \r\nKort sagt kan man säga att du som nybakad ingenjör får en rivstart på karriären. \r\n'),(1133,11,'catalogue_question_freetext',''),(1134,11,'catalogue_answer','Faddrar, mentorskap, duo-coachning, nätverk, erfarenhetsutveckling, kompetensutvecklingsbonus, teknikkurser, årliga kursveckor mm'),(1135,11,'catalogue_question','Dessa utvecklingsmöjligheter genom kompetensutveckling/internutbildningar/mentorskap mm erbjuds för våra nyanställda:,  These development opportunities through training / in-house training / mentoring, etc. are offered our new employees:'),(1136,11,'catalogue_contact_same','Nej, no'),(1137,11,'catalogue_contact_firstname','Herman'),(1138,11,'catalogue_contact_lastname','Viklund'),(1139,11,'catalogue_contact_email','herman.viklund'),(1140,11,'catalogue_contact_cell','0734189755'),(1141,11,'catalogue_contact_position','studentkontakt'),(1142,11,'catalogue_ad_description','Hur ser din profil ut?\r\nOm vi vill byta denna annons, när kan vi senast göra det?'),(1143,11,'catalogue_link_website','http://www.combitech.se'),(1144,11,'catalogue_link_website_student','http://www.combitech.se/student'),(1145,11,'catalogue_last_day_xjob',''),(1146,11,'catalogue_link_internship',''),(1147,11,'catalogue_last_day_internship',''),(1148,11,'catalogue_link_summerjob',''),(1149,11,'catalogue_last_day_summerjob',''),(1150,11,'catalogue_link_trainee',''),(1151,11,'catalogue_last_day_trainee',''),(1152,11,'catalogue_link_positions','http://www.combitech.se/sv/Om-Combitech/Jobb-och-karriar/Lediga-jobb/'),(1153,11,'catalogue_link_facebook','http://www.facebook.com/Combitech'),(1154,11,'catalogue_link_twitter','http://www.twitter.com/combitech'),(1155,11,'catalogue_link_youtube','http://'),(1156,12,'company_username','Combine AB'),(1157,12,'billing_reference','Jan Lundberg'),(1158,12,'billing_phone','031-421060'),(1159,12,'billing_address','Järntorget 4'),(1160,12,'billing_zipcode','413 04'),(1161,12,'billing_city','G