ggda system och telecom management. Bolaget grundades 1995 och är sedan 1999 noterat på Nasdaq OMX Nordic.'),(1341,13,'catalogue_students_dont_know','Cybercom strävar efter att verksamheten ska ge minimal negativ miljöpåverkan. Vi utser årligen CSR-ambassadörer bland våra anställda som utöver sin konsultroll arbetar med CSR.'),(1342,13,'catalogue_why_visit','Vi vill knyta värdefulla kontakter med framtidens ingenjörer. Vill du påverka framtidens teknik i ett av IT-branschens mest innovativa företag kom till oss!'),(1343,13,'catalogue_question_freetext',''),(1344,13,'catalogue_answer','Cybercom strävar efter att uppträda ansvarsfullt i alla länder och i alla sammanhang där koncernen verkar. Cybercoms arbete med socialt ansvarstagande, människosyn, arbetsförhållanden och miljöarbete tar sin utgångspunkt i företagets värdegrund samt i FN:s Global Compact. Sedan 2004 stödjer Cybercom detta arbete och genom att engagera sig i dessa frågor och stödja FN:s arbete har Cybercom förbundit sig att skydda och stödja mänskliga rättigheter och motverka korruption, diskriminering och alla former av tvångsarbete.\r\n\r\nCybercom har tecknat ett långsiktigt partneravtal med SOS Barnbyar och kommer att finansiera en betydande del av verksamheten för en grundskola med 200 barn i Gikongoro, Rwanda. Cybercom är ett kunskapsföretag i internationell tillväxt och genom att stödja SOS Barnbyar bidrar till kunskapsutveckling i ett land där vi har pågående projekt. \r\n\r\nCybercoms partnerskap med SOS Barnbyar är ett långsiktigt samarbete med återkommande aktiviteter.  Samtliga dotterbolag är engagerade i barnbyn i Gikongoro och tillsammans bidrar de till att åtagandet får större genomslag. Cybercoms engagemang i SOS Barnbyar skapar stolthet bland medarbetarna. '),(1345,13,'catalogue_question','Annat: (Välj egen rubrik),  Other: (choose your own title)'),(1346,13,'catalogue_contact_same','Nej, no'),(1347,13,'catalogue_contact_firstname','Cathrine'),(1348,13,'catalogue_contact_lastname','Nygr