öteborg'),(1547,15,'catalogue_employees_sweden','37'),(1548,15,'catalogue_countries','Sverige'),(1549,15,'catalogue_employees_global','37 '),(1550,15,'catalogue_company_description','Civilekonomerna är ett fackförbund och en intresseorganisation som är exklusiv för civilekonomerna och ekonomer. Förbundet har ca 38 000 medlemmar varav ca 11 000 är studenter. Gemensamt för våra medlemmar är att de har, eller planerar att inom en snar framtid ha en ekonomexamen. Civilekonomerna arbetar med frågor som rör medlemmarnas arbetsvillkor, utbildning och yrkesutövning. Genom att vara ett förbund exklusivt för civilekonomer har vi till exempel den bästa lönestatistiken för civilekonomer liksom nätverk och kunskap om utbildningen.\r\n\r\nCivilekonomerna erbjuder dig som studerar ekonomi två olika medlemskap, ett kostnadsfritt och ett som kostar 100 kr/år. Oavsett vilket medlemskap som du väljer att teckna kommer du att ha en mängd nyttiga fördelar som du kan nyttja både under studietiden och i ditt framtida arbetsliv. \r\n\r\n'),(1551,15,'catalogue_students_dont_know','30% av våra medlemmar är chefer.'),(1552,15,'catalogue_why_visit','Civilekonomerna vill komma i kontakt med ekonomstudenter och förklara varför vi är en självklar partner under deras studietid och framtida arbetsliv. Vår förhoppning är även att räta ut en del frågetecken kring allt som har med ekonomers utbildning och arbetsliv att göra. Vem får exempelvis kalla sig civilekonom och vad är en rimlig ingångslön för en ekonom?\r\n\r\neller\r\n\r\nVarför inte ta med dig ditt CV och få det granskat? Eller kom till oss och fråga vad som är en rimlig lön när du söker ditt första \"\"riktiga\"\" jobb. Du kan alltid luta dig mot Civilekonomerna när det gäller din karriär, så ta chansen och peppra oss med frågor.\r\n'),(1553,15,'catalogue_question_freetext',''),(1554,15,'catalogue_answer','Vi vill berätta mer om våra olika medlemskap och vad det innebär att vara medlem i ett fackförbund. Vi vill också förklara på vilket sätt vi kan hjälpa en student som är på väg ut i arbetslivet. Vi pratar gärna om hur man skriver ett attraktivt CV samt hur man klarar anställningsintervjun.'),(1555,15,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(1556,15,'catalogue_contact_same','Ja, yes'),(1557,15,'catalogue_contact_firstname',''),(1558,15,'catalogue_contact_lastname',''),(1559,15,'catalogue_contact_email',''),(1560,15,'catalogue_contact_cell',''),(1561,15,'catalogue_contact_position',''),(1562,15,'catalogue_ad_description',''),(1563,15,'catalogue_link_website','http://www.civilekonomerna.se'),(1564,15,'catalogue_link_website_student','http://www.civilekonomerna.se/student'),(1565,15,'catalogue_last_day_xjob',''),(1566,15,'catalogue_link_internship',''),(1567,15,'catalogue_last_day_internship',''),(1568,15,'catalogue_link_summerjob',''),(1569,15,'catalogue_last_day_summerjob',''),(1570,15,'catalogue_link_trainee',''),(1571,15,'catalogue_last_day_trainee',''),(1572,15,'catalogue_link_positions',''),(1573,15,'catalogue_link_facebook','http://www.facebook.com/civilekonomernastudent'),(1574,15,'catalogue_link_twitter','http://'),(1575,15,'catalogue_link_youtube','http://'),(1576,16,'company_username','dellner'),(1577,16,'billing_reference','Barbro Wincent'),(1578,16,'billing_phone','023-77 42 59'),(1579,16,'billing_address','Vikavägen 144'),(1580,16,'billing_zipcode','791 95'),(1581,16,'billing_city','Falun'),(1582,16,'billing_country','Sverige'),(1583,16,'billing_extra_information',''),(1584,16,'contact_firstname','Maria'),(1585,16,'contact_lastname','Lindström'),(1586,16,'contact_email','maria.lindstrom@dellner.com'),(1587,16,'contact_alt_email','christoffer.eklund@dellner.com'),(1588,16,'contact_cell','070-3284243'),(1589,16,'contact_phone','023-765400'),(1590,16,'org_name','Dellner Couplers AB'),(1591,16,'org_number','556389-9763'),(1592,16,'org_type','Företag, Company'),(1593,16,'org_address','Vikavägen 144'),(1594,16,'org_zi