ullt ut i Sverige. Idag är 5 miljarder enheter uppkopplade mot det mobila nätet, med 4G tekniken tar vi nästa steg mot vår vision om att 50 miljarder enheter ska vara uppkopplade mot det mobila nätet.\r\nEricsson är världsledande inom tillhandahållandet av telekommunikationsutrustning och tjänster inom mobila och fasta nätverk. 40% av världens mobiltelefonsamtal går genom våra nät och över 1000 nätverk fördelade på mer än 175 länder nyttjar vår teknik. \r\n\r\n'),(1866,18,'catalogue_students_dont_know','Vi har en ideel organisation som heter Ericsson Response. De åker till katastrofområden som vid 9/11 för att möjliggöra kommunikationen för nödställda och hjälparbetare'),(1867,18,'catalogue_why_visit','Våra innovationer förändrar livsvilkoren för människor världen över. Härigenom ges nya möjligheter för individer, företag och samhällen att utvecklas. I vår monter finner du medarbetare av olika bakgrunder som gärna berättar om hur just DU kan passa in.'),(1868,18,'catalogue_question_freetext',''),(1869,18,'catalogue_answer','Vi finns verksamma i 180 länder världen över. Våra medarbetare arbetar i en internationell kontext på daglig basis oavsett om du är stationerad i Sverige eller något annat land. '),(1870,18,'catalogue_question','Dessa möjligheter för en internationell karriär erbjuder vårat företag:, Our company provides the following opportunities of an international career:'),(1871,18,'catalogue_contact_same','Ja, yes'),(1872,18,'catalogue_contact_firstname','Kristoffer'),(1873,18,'catalogue_contact_lastname','Jaworska Persson'),(1874,18,'catalogue_contact_email','kristoffer.jaworska.persson@ericsson.com'),(1875,18,'catalogue_contact_cell','072 724 25 76'),(1876,18,'catalogue_contact_position','HR'),(1877,18,'catalogue_ad_description','It\'s a big small world'),(1878,18,'catalogue_link_website','http://www.ericsson.com/careers/student'),(1879,18,'catalogue_link_website_student','www.ericsson.com/careers/student'),(1880,18,'catalogue_last_day_xjob',''),(1881,18,