re'),(2806,27,'catalogue_cities','Uppsala, Umeå, Stockholm, Göteborg.'),(2807,27,'catalogue_employees_sweden','2000'),(2808,27,'catalogue_countries','GE Healthcare finns i mer än 100 länder världen över.'),(2809,27,'catalogue_employees_global','53 000'),(2810,27,'catalogue_company_description','GE Healthcare är ett bolag inom den globala GE-koncernen. Med innovativa lösningar skapar vi förutsättningar att bättre förutsäga, förebygga,\r\ndiagnostisera, behandla och bota sjukdomar i ett tidigt skede och ge effektiva och individanpassade behandlingsmetoder. Vår vision är att möjliggöra\r\nen ny era i sjukvården, där behandling i ett sent sjukdomsskede ersätts av tidig diagnos och förebyggande åtgärder. För att uppnå detta utvecklar och\r\ntillverkar vi allt från världsledande system för forskning om celler, gener och proteiner, produkter för utveckling och framställning av biotekniska\r\nläkemedel, till avancerad bildgivande teknologi för diagnostik. På GE Healthcare är vi alltid intresserade av att komma i kontakt med talanger som i\r\nlikhet med våra värderingar präglas av en stark drivkraft, stort engagemang och hög integritet. Kännetecknar detta dig och lockas du av ett arbete i en\r\nglobal koncern där dina prestationer belönas och din utveckling sätts i centrum? Kom och prata med oss under LARV!'),(2811,27,'catalogue_students_dont_know','GE Healthcare har ett systematiskt arbetsmiljöarbete i världsklass med globala och lokala utmärkelser. '),(2812,27,'catalogue_why_visit',''),(2813,27,'catalogue_question_freetext',''),(2814,27,'catalogue_answer','GE Healthcare har verksamhet i mer än 100 länder världen över där våra anställda har möjlighet att söka jobb. I Sverige erbjuder vi traineeprogram för dig som student inom en rad olika verksamhetsområden med möjlighet till utlandsrotationer.  '),(2815,27,'catalogue_question','Dessa möjligheter för en internationell karriär erbjuder vårat företag:, Our company provides the following opportunities of an international caree