tores to have the opportunity to sell to even more people, and we want to offer more fun payment solutions to our consumers.\r\n\r\nKlarna makes the world buyable.'),(3441,33,'catalogue_students_dont_know','We have 33 different nationalities represented at Klarna.'),(3442,33,'catalogue_why_visit','We re always interested in meeting talented students that can become our future colleagues. Take the chance to talk to us to learn more about Klarna, the people, career opportunities and to show us why you re the one we re looking for!'),(3443,33,'catalogue_question_freetext',''),(3444,33,'catalogue_answer','Klarna is growing, both in Sweden and internationally . To continue our expansion we need people ready for a journey out of the ordinary! As an employee at Klarna you will get the responsibility to work on challenging tasks, right from day one. You will be working together with talented colleagues who love to share their enthusiasm and experience with you. Klarna gives people every reason and opportunity to stay motivated!'),(3445,33,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(3446,33,'catalogue_contact_same','Ja, yes'),(3447,33,'catalogue_contact_firstname','Sara'),(3448,33,'catalogue_contact_lastname','Björklund'),(3449,33,'catalogue_contact_email','sara.bjorklund@klarna.com'),(3450,33,'catalogue_contact_cell','0700012706'),(3451,33,'catalogue_contact_position','Employer Branding'),(3452,33,'catalogue_ad_description','Annons Klarna 2012'),(3453,33,'catalogue_link_website','http://klarna.com'),(3454,33,'catalogue_link_website_student','https://klarna.com/en/about-us/work-at-klarna/student'),(3455,33,'catalogue_last_day_xjob',''),(3456,33,'catalogue_link_internship',''),(3457,33,'catalogue_last_day_internship',''),(3458,33,'catalogue_link_summerjob',''),(3459,33,'catalogue_last_day_summerjob',''),(3460,33,'catalogue_link_trainee',''),(3461,33,'catalogue_last_day_trainee',''),(3462,33,'catalogue_link_positio