rbete. Roligast är det när förutsättningarna är riktigt knepiga. Förutom projektering utför vi även inspektioner och utredningar samt projekt- och byggledning.\r\n\r\nVår ambition är inte att vara störst - utan bäst på det vi gör.\r\n\r\nKFS, som under 2011 firat 20 år, är ett personalägt och oberoende ingenjörsföretag. Vi är idag 27 anställda, varav 9 kvinnor, och vår medianålder är 34 år.'),(3546,34,'catalogue_students_dont_know','Hälften av våra medarbetare har flyttat in till Stockholm från norr och söder.'),(3547,34,'catalogue_why_visit','För att upptäcka en intressant arbetsplats för nyfikna ingenjörer som vill fortsätta lära sig saker.'),(3548,34,'catalogue_question_freetext',''),(3549,34,'catalogue_answer','Rolig teknik: vallgravar, vattenkraftsdammar, spagettipålar, ledverk och dykdalber.'),(3550,34,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(3551,34,'catalogue_contact_same','Ja, yes'),(3552,34,'catalogue_contact_firstname',''),(3553,34,'catalogue_contact_lastname',''),(3554,34,'catalogue_contact_email',''),(3555,34,'catalogue_contact_cell',''),(3556,34,'catalogue_contact_position','Rekryteringsansvarig'),(3557,34,'catalogue_ad_description','KFS LARV\r\nBild på pålkran med 711-påle.'),(3558,34,'catalogue_link_website','http://www.kfs.se'),(3559,34,'catalogue_link_website_student','http://'),(3560,34,'catalogue_last_day_xjob',''),(3561,34,'catalogue_link_internship',''),(3562,34,'catalogue_last_day_internship',''),(3563,34,'catalogue_link_summerjob',''),(3564,34,'catalogue_last_day_summerjob',''),(3565,34,'catalogue_link_trainee',''),(3566,34,'catalogue_last_day_trainee',''),(3567,34,'catalogue_link_positions','http://'),(3568,34,'catalogue_link_facebook','http://'),(3569,34,'catalogue_link_twitter','http://'),(3570,34,'catalogue_link_youtube','http://'),(3571,35,'company_username','Knightec'),(3572,35,'billing_reference','Mats Lindblad'),(3573,35,'billing_phone','0660-85478'),(3574,