ngårdsskolan i syfte att lära oss mer om mångfald och inspirera eleverna att välja studier med teknisk inriktning. En gång om året träffas hela företaget för att diskutera framtida utmaningar och ha roligt, senast var vi i Reykjavik. Mellan dessa tillfällen förekommer ett flertal olika aktiviteter.'),(3652,35,'catalogue_why_visit','Kom till oss och prata drivkraft, passion och värderingar eller varför inte affärsmannaskap och utveckling.'),(3653,35,'catalogue_question_freetext',''),(3654,35,'catalogue_answer','På Knightec har vi roligt, tillsammans på företaget, med våra kunder, leverantörer, samarbetspartners och respektive. På Knightec driver du själv din egen utveckling och får även vara med att utveckla företaget och våra kunder. Vi lär oss hela tiden nya saker som vi delar med varandra. Hos oss får hjärtat och individen ta stor plats. Fokus ligger på kunder och medarbetare, mål och utveckling.\r\n\r\n'),(3655,35,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(3656,35,'catalogue_contact_same','Nej, no'),(3657,35,'catalogue_contact_firstname','Mats'),(3658,35,'catalogue_contact_lastname','Lindblad'),(3659,35,'catalogue_contact_email','mats.lindblad@knightec.se'),(3660,35,'catalogue_contact_cell','070-6024014'),(3661,35,'catalogue_contact_position','Platschef'),(3662,35,'catalogue_ad_description',''),(3663,35,'catalogue_link_website','http://www.knightec.se'),(3664,35,'catalogue_link_website_student','http://www.jobylon.se/company/knightec-2046#/?pdiv=en-riktig-ingenjor'),(3665,35,'catalogue_last_day_xjob',''),(3666,35,'catalogue_link_internship',''),(3667,35,'catalogue_last_day_internship',''),(3668,35,'catalogue_link_summerjob',''),(3669,35,'catalogue_last_day_summerjob',''),(3670,35,'catalogue_link_trainee',''),(3671,35,'catalogue_last_day_trainee',''),(3672,35,'catalogue_link_positions','http://www.knightec.se'),(3673,35,'catalogue_link_facebook','http://www.facebook.com/pages/Knightec/100490963328658'),(