n omsätter ca 19 miljarder/år varav 30% av omsättningen är internationell verksamhet.\r\nLemminkäinen är ett nyetablerat tillväxtföretag inom infrastruktur- och anläggningsbyggande i Sverige.\r\nLemminkäinen har som mål att bli en av de ledande aktörerna inom infrastruktur- och anläggningsbyggande i Sverige. Resan har börjat...!'),(3757,36,'catalogue_why_visit','Vad finns det för framtidsutsikter inom Lemminkäinen?\r\nHur är det att arbeta i ett tillväxtföretag?\r\nVilka möjligheter finns inom företaget?\r\nFå information av vad just du är intresserad av.\r\nVisa upp er för Lemminkäinen.'),(3758,36,'catalogue_question_freetext',''),(3759,36,'catalogue_answer','Lemminkäinen är ett tillväxtföretag inom infrastruktur- och anläggningsbyggande i Sverige.\r\nDet är en utmaning att etablera ett företag på en redan konkurrensutsatt marknad.\r\nGillar du utmaningar och vill vara med och bygga upp en organisation och etablera ett starkt varumärke i Sverige?\r\nLemminkäinen kan konsten att lyckas, vill du vara med?'),(3760,36,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(3761,36,'catalogue_contact_same','Nej, no'),(3762,36,'catalogue_contact_firstname','Johanna'),(3763,36,'catalogue_contact_lastname','Tuomisto'),(3764,36,'catalogue_contact_email','johanna.tuomisto@lemminkainen.fi'),(3765,36,'catalogue_contact_cell','0706655279'),(3766,36,'catalogue_contact_position','HR'),(3767,36,'catalogue_ad_description',''),(3768,36,'catalogue_link_website','http://www.lemminkainen.se'),(3769,36,'catalogue_link_website_student','http://www.lemminkainen.se'),(3770,36,'catalogue_last_day_xjob',''),(3771,36,'catalogue_link_internship',''),(3772,36,'catalogue_last_day_internship',''),(3773,36,'catalogue_link_summerjob',''),(3774,36,'catalogue_last_day_summerjob',''),(3775,36,'catalogue_link_trainee',''),(3776,36,'catalogue_last_day_trainee',''),(3777,36,'catalogue_link_positions','http://www.lemminkainen.se'),(3778,36,'catalogue_link_fa