t gäller utveckling. Välutbildad personal är en förutsättning för att kommunens alla verksamheter ska kunna utvecklas och därigenom trygga välfärden för sina medborgare. Luleå kommun vill - för att klara välfärd och utveckling - nu och i framtiden kunna rekrytera kompetent personal inom samtliga av kommunens verksamheter.\r\n\r\nKommunen behöver människor med olika bakgrund. Vi verkar för jämställdhet, jämlikhet och mångfald på våra arbetsplatser.\r\n\r\n'),(3968,38,'catalogue_question_freetext',''),(3969,38,'catalogue_answer','Vårt rekryterings behov nu och framöver'),(3970,38,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(3971,38,'catalogue_contact_same','Ja, yes'),(3972,38,'catalogue_contact_firstname',''),(3973,38,'catalogue_contact_lastname',''),(3974,38,'catalogue_contact_email',''),(3975,38,'catalogue_contact_cell',''),(3976,38,'catalogue_contact_position','Handläggare '),(3977,38,'catalogue_ad_description',''),(3978,38,'catalogue_link_website','http://www.lulea.se'),(3979,38,'catalogue_link_website_student','http://http://www.lulea.se/forinvanare/student.4.cafb35109cec643ab80003624.html'),(3980,38,'catalogue_last_day_xjob',''),(3981,38,'catalogue_link_internship',''),(3982,38,'catalogue_last_day_internship',''),(3983,38,'catalogue_link_summerjob',''),(3984,38,'catalogue_last_day_summerjob',''),(3985,38,'catalogue_link_trainee',''),(3986,38,'catalogue_last_day_trainee',''),(3987,38,'catalogue_link_positions','http://'),(3988,38,'catalogue_link_facebook','http://http://www.facebook.com/Luleakommun'),(3989,38,'catalogue_link_twitter','http://'),(3990,38,'catalogue_link_youtube','http://'),(3991,39,'company_username','LKAB-2012'),(3992,39,'billing_reference','Mikael Pudas'),(3993,39,'billing_phone','0980-68501'),(3994,39,'billing_address','LKAB Box 919'),(3995,39,'billing_zipcode','83327'),(3996,39,'billing_city','Strömsund'),(3997,39,'billing_country','Sverige'),(3998,39,'billing_extra_inf