h berörda myndigheter. \r\n\r\nNIRAS Environment är en del av NIRAS, ett av nordens främsta oberoende konsultföretag inom fastighetsutveckling, byggprojektledning, fastighetsinvestering, \"\"Handel, centrum och städer,\"\", byggnadsantikvariska tjänster, hyresgästrådgivning samt miljö och klimatområdet. NIRAS har sitt huvudkontor i Danmark men har även kontor i Finland och Estland.\r\n'),(4701,45,'catalogue_students_dont_know','Av våra medarbetare i Sverige har över 25% doktorsexamen!'),(4702,45,'catalogue_why_visit','NIRAS Environmen är en miljökonsultverksamhet som satsar i Sverige och planerar att expandera ytterligare de kommande åren. Vi eftersträvar en stor kunskapsbredd hos våra medarbetare för att kunna erbjuda stöd till kunder inom många olika miljöområden. \r\n\r\nNIRAS vill vara en av Sveriges mest attraktiva arbetsgivare inom fastighetsbranschen och miljöteknikområdet. Vår unika bredd och ledande position gör att vi kan erbjuda en mångfald karriärmöjligheter inom en rad olika tjänsteområden. Vi söker dig som är engagerad, eftersträvar kvalitet i allt du gör och tar ansvar för din egen och vår gemensamma utveckling. För oss är det också viktigt att våra medarbetare mår bra och finner balans mellan arbete och fritid samt har möjlighet att kombinera föräldraskap och arbete! \r\n'),(4703,45,'catalogue_question_freetext',''),(4704,45,'catalogue_answer','Exjobbsmöjligheter och olika arbetsuppgifter som miljökonsult.'),(4705,45,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(4706,45,'catalogue_contact_same','Nej, no'),(4707,45,'catalogue_contact_firstname','Johan'),(4708,45,'catalogue_contact_lastname','Helldén'),(4709,45,'catalogue_contact_email','johan.hellden@niras.se'),(4710,45,'catalogue_contact_cell','013-210294'),(4711,45,'catalogue_contact_position','Affärsområdeschef NIRAS Environment Sverige'),(4712,45,'catalogue_ad_description',''),(4713,45,'catalogue_link_website','http://www.ni