rconsult är en medarbetarägd samhällsbyggare med helhetssyn. \r\n\r\nVi är en av Nordens största flerfackliga rådgivare inom samhällsplanering och projektering\r\nmed kontor och uppdrag världen över.Tillsammans i koncernen är vi 2100 medarbetare varav 350 arbetar på kontor runtom i Sverige.\r\n\r\nEtt aktivt samarbete mellan näringsliv och utbildning ser vi som en självklarhet. Vi vet att Ex-jobbet och praktiken är en viktig del av din utbildning och under åren har vi träffat många engagerade studenter. Många av dem jobbar hos oss idag. Vi erbjuder varje år flera praktikplatser och vi försöker fånga upp de uppslag till ex-jobb som föds i vår dagliga verksamhet. \r\nLäs mer på www.norconsult.se'),(4911,47,'catalogue_students_dont_know','Förra året bestämde vi oss för att satsa på konsulter inom vattenkraft. Nu är vi störst på området i Nordetn och ca 90 fler medarbetare.'),(4912,47,'catalogue_why_visit','Låt våra trevliga medarbetare berätta mer om vår verksamhet och dina möjligheter hos oss.'),(4913,47,'catalogue_question_freetext',''),(4914,47,'catalogue_answer','Hos oss samverkar arkitekter, fysiska planerare med konstruktörer, ingenjörer, biologer, lantmätare - och många fler. Med våra samlade kompetenser kan vi erbjuda våra kunder de allra flesta tjänster i samhällsbyggnadskedjan. Från vision till verklighet.\r\n\r\nHos oss kan du arbeta i spännande uppdrag i Sverige, Norge och världen över på något av våra många internationella kontor. Med våra spännande och varierande uppdrag har du i kombination med frihet och ansvar möjlighet att utveckla din egen kompetens och karriär.\r\n\r\nVi arbetar aktivt med att vara en attraktiv arbetsgivare - med allt från kompetensutveckling till friskvård och andra personalförmåner som får oss att trivas och må bra.\r\n\r\nVi söker kontinuerligt efter engagerade konsulter till våra kontor runtom i Sverige.\r\n\r\n'),(4915,47,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(491