,'15550'),(5115,49,'catalogue_company_name','Outotec Sweden AB'),(5116,49,'catalogue_cities','Skellefteå, Kiruna, Kil, Smedjebacken'),(5117,49,'catalogue_employees_sweden','240'),(5118,49,'catalogue_countries','Tyskland, Finland, Ryssland, Kina, Indien, Sydafrika, Australien, USA, Kanada, Mexiko, Chile, Brasilien'),(5119,49,'catalogue_employees_global','3600'),(5120,49,'catalogue_company_description','Outotec är ett idéföretag som lever efter sina värderingar. Vi menar att kraften ligger i människorna som arbetar hos oss. Idéer uppkommer inte av sig själva   de skapas av människor. Vår framgång bygger på investeringar i ständigt lärande och gott \r\nteamarbete. Vi verkar inom en mycket specialiserad och teknisk bransch, så därför omger vi oss av världens bästa experter. Vi främjar ständigt lärande och arbetshälsa för att uppmuntra medarbetarna till att dela information samt för att skapa en miljö där nya \r\nidéer kan blomstra. Hos oss är samarbetskulturen en nödvändighet. \r\n'),(5121,49,'catalogue_students_dont_know','De flesta av våra anställda i Outotec har besökt både möjliga och omöjliga platser, upplevt intressanta platser världen över, mött olika kulturer som har berikat deras liv. '),(5122,49,'catalogue_why_visit','Kraften ligger i människorna \r\nDen viktigaste faktor, som möjliggjort vår tillväxt från ett anspråkslöst \r\nutgångsläge till en global marknadsledare, är du. Idéer uppkommer inte av \r\nsig själva   de skapas av människor. Vi är ett idéföretag och vi förstår att \r\nvår framgång centralt bygger på investeringar i ständigt lärande och gott \r\nteamarbete. Därför har vi utvecklat en grupp initiativ. \r\n'),(5123,49,'catalogue_question_freetext',''),(5124,49,'catalogue_answer','Viktigast är din personlighet! Som person vill du använda din tekniska kunskap och goda samarbetsförmåga för att tillsammans med andra kreativa medarbetare leverera bästa möjliga lösning till våra kunder. Du är självgående och en duktig problemlösare. '),(5125,49,'catalo