ange consulting. With a strong growth, we will show you how an attractive employer we are. Welcome to meet us on site! \r\n'),(5228,50,'catalogue_question_freetext',''),(5229,50,'catalogue_answer','Combining Skills and Attitude, Young Professionals, and how we would like to change consulting. '),(5230,50,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(5231,50,'catalogue_contact_same','Nej, no'),(5232,50,'catalogue_contact_firstname','Tomas '),(5233,50,'catalogue_contact_lastname','Lyåsen'),(5234,50,'catalogue_contact_email','tomas.lyasen@orbionconsulting.se'),(5235,50,'catalogue_contact_cell',''),(5236,50,'catalogue_contact_position','Konsultchef'),(5237,50,'catalogue_ad_description',''),(5238,50,'catalogue_link_website','http://www.orbionconsulting.se/'),(5239,50,'catalogue_link_website_student','http://'),(5240,50,'catalogue_last_day_xjob',''),(5241,50,'catalogue_link_internship',''),(5242,50,'catalogue_last_day_internship',''),(5243,50,'catalogue_link_summerjob',''),(5244,50,'catalogue_last_day_summerjob',''),(5245,50,'catalogue_link_trainee',''),(5246,50,'catalogue_last_day_trainee',''),(5247,50,'catalogue_link_positions','http://www.orbionconsulting.se/?cat=2981848&id=3039851'),(5248,50,'catalogue_link_facebook','http://www.facebook.com/orbionconsulting?ref=ts'),(5249,50,'catalogue_link_twitter','http://'),(5250,50,'catalogue_link_youtube','http://'),(5251,51,'company_username','Johanna Åhman'),(5252,51,'billing_reference','Johanna Åhman 1400005'),(5253,51,'billing_phone','073-3371497'),(5254,51,'billing_address','Box 808'),(5255,51,'billing_zipcode','169 28'),(5256,51,'billing_city','Solna'),(5257,51,'billing_country','Sverige'),(5258,51,'billing_extra_information',''),(5259,51,'contact_firstname','Johanna '),(5260,51,'contact_lastname','Åhman'),(5261,51,'contact_email','johanna.ahman@peab.se'),(5262,51,'contact_alt_email',''),(5263,51,'contact_cell','073-337 14 97'),(5264,51,'contact_phon