hy_visit','Vi vill kunna sätta våra kunder i främsta rummet även i framtiden. Därför söker vi\r\nmänniskor som kan och vill forma framtiden. Som har samma grundvärderingar som vi\r\noch är jordnära, utvecklande, pålitliga och personliga. Som gärna ser sig som Nordens\r\nsamhällsbyggare. Men vi satsar inte bara på att attrahera duktiga människor utan också\r\npå att få dem motiverade att stanna och utvecklas med oss. Länge.\r\n'),(5333,51,'catalogue_question_freetext',''),(5334,51,'catalogue_answer','Vi vill veta mer om dig om dina mål och drömmar. Eftersom Peab är en stor koncern finns det\r\nstora möjligheter att välja var och med vad man vill arbeta. Vill du utvecklas har vi stora möjligheter och vi uppmuntrar okonventionella  karriärvägar. Man får gärna gå hur långt som helst!\r\n'),(5335,51,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(5336,51,'catalogue_contact_same','Ja, yes'),(5337,51,'catalogue_contact_firstname','Johanna'),(5338,51,'catalogue_contact_lastname','Åhman'),(5339,51,'catalogue_contact_email','johanna.ahman@peab.se'),(5340,51,'catalogue_contact_cell','073-337 14 97'),(5341,51,'catalogue_contact_position','Personalchef'),(5342,51,'catalogue_ad_description',''),(5343,51,'catalogue_link_website','http://www.peab.se'),(5344,51,'catalogue_link_website_student','http://www.peab.se/jobba-utvecklas/'),(5345,51,'catalogue_last_day_xjob',''),(5346,51,'catalogue_link_internship',''),(5347,51,'catalogue_last_day_internship',''),(5348,51,'catalogue_link_summerjob',''),(5349,51,'catalogue_last_day_summerjob',''),(5350,51,'catalogue_link_trainee',''),(5351,51,'catalogue_last_day_trainee',''),(5352,51,'catalogue_link_positions','http://www.peab.se/jobba-utvecklas/'),(5353,51,'catalogue_link_facebook','http://www.peab.se/facebook'),(5354,51,'catalogue_link_twitter','http://www.peab.se/twitter'),(5355,51,'catalogue_link_youtube','http://www.peab.se/youtube'),(5356,52,'company_username','jensun'),(5357,52,'b