 Umeå.\r\n\r\nSveriges bästa arbetsplats\r\nEn medarbetarundersökning 2010 visade att vår personal trivs mycket bra på Polarbröd och arbetsmiljö upplevs som god. 2009 utsågs Polarbröd av Veckans affärer till Sveriges bästa arbetsplats. Framgångsfaktorerna är många. Arbetsglädje, jämställdhet och god kommunikation är en del. Handlingsberedskap och modet att ta språng är en annan del som präglar Polarbröd.\r\n\r\nPolarbröd   alltid mjukt och gott\r\nDen goda smaken och traditionen med hällbakade kakbröd har byggt Polarbröds framgång. Vårt bröd är Polfärskt®  vilket innebär att vi på traditionellt norrländskt vis fryser vårt bröd direkt efter gräddningen. Brödet bevaras i en obruten fryskedja och tinas först på väg till din butik. Att baka utan konserveringsmedel och andra onödiga tillsatser är en grundbult i Polarbröds verksamhet. Målet är att baka med så naturliga råvaror som möjligt, dock aldrig på bekostnad av smak eller kvalitet. Allt bröd från Polarbröd är mjölkfritt och fritt från allergener. Ett av våra bagerier bakar ekologiskt bröd.\r\n\r\nMiljön i fokus Polarbröd arbetar hela tiden för att bli mer resurseffektiva. Målet är att baka så bra bröd som möjligt men att anstränga miljön så lite som möjligt. Läs gärna mer på Polarbröds klimatsida www.polarbrod.se/klimat\r\n\r\nVi behöver dig\r\nCivilingenjörer och maskintekniker. IT folk och systemvetare, personalvetare, livsmedelstekniker och ekonomer med inriktning mot redovisning, marknadsföring och industri. Polarbröd behöver engagerade medarbetare som delar våra värderingar och arbetssätt. Kom och hälsa på i vår monter.  Polarbröd tar gärna emot studenter som vill göra examensarbeten. Låt oss diskutera dina idéer. Välkommen!\r\n\r\nLäs gärna mer på www.polarbrod.se. \r\nVi gillar dig. Gilla oss på Facebook.\r\n'),(5436,52,'catalogue_students_dont_know','Vår VD, Karin Bodin, sjunger i ett countryband som heter CC Campers och det har förekommit att hon sjungit för oss på en eller annan personalfest!\r\n\r\nVisste du att Frankrike är Polarbröds tredje största marknad? Fransmännen älskar sitt Pain Polar och gör gärna varma mackor med fyllning emellan av Polarkaka.'),(5437,52,'catalogue_why_visit','Välkommen till vår monter för att diskutera framtida arbetsmöjligheter, eller idéer till examensarbete! '),(5438,52,'catalogue_question_freetext',''),(5439,52,'catalogue_answer','För att du söker utmaningar och möjlighet att påverka ditt arbetsmråde genom ständiga förbättringar.\r\n\r\nFör att du vill arbeta tillsammans med andra och ha roligt på arbetet.\r\n\r\nFör att du vill arbeta med ett av Sveriges starkaste konsumentvarumärken.\r\n\r\nFör att du tycker att det är viktigt att arbeta miljömedvetet och vill vara en del av en organisation som tar stort ansvar för hållbar utveckling.'),(5440,52,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(5441,52,'catalogue_contact_same','Ja, yes'),(5442,52,'catalogue_contact_firstname',''),(5443,52,'catalogue_contact_lastname',''),(5444,52,'catalogue_contact_email',''),(5445,52,'catalogue_contact_cell',''),(5446,52,'catalogue_contact_position','HR-samordnare'),(5447,52,'catalogue_ad_description','Både annonsen och fritexten till högra sidan av kataloguppslaget har mailats till katalog@larv.org. Där framgår hur vi vill att rubriker och styckeindelningar av fritexten ska se ut.'),(5448,52,'catalogue_link_website','http://polarbrod.se'),(5449,52,'catalogue_link_website_student','http://'),(5450,52,'catalogue_last_day_xjob',''),(5451,52,'catalogue_link_internship',''),(5452,52,'catalogue_last_day_internship',''),(5453,52,'catalogue_link_summerjob',''),(5454,52,'catalogue_last_day_summerjob',''),(5455,52,'catalogue_link_trainee',''),(5456,52,'catalogue_last_day_trainee',''),(5457,52,'catalogue_link_positions','http://polarbrod.se/lediga_jobb.aspx'),(5458,52,'catalogue_link_facebook','http://www.facebook.com/polarbrod.sverige'),(5459,52,'catalogue_link_twitter','http://'),(5460,52,'catalogue_l