ngsund, Göteborg, Malmö'),(5852,56,'catalogue_employees_sweden','240'),(5853,56,'catalogue_countries','Sverige, Norge, Ryssland'),(5854,56,'catalogue_employees_global','2100'),(5855,56,'catalogue_company_description','REINERTSEN Sverige AB is part of REINERTSEN AS, one of Scandinavia s largest consultancy and contractor companies. In Sweden, our areas of business are Oil & Gas, Energy & Industry and Infrastructure. We have 230 employees in Gothenburg, Stenungsund, Malmo and Stockholm. During the past few years, the company has seen a healthy growth and currently has more than 2100 employees and a turnover of 2,8 billion Norwegian Kronor.\r\nProjects are run according to REINERTSEN Sverige AB s management system, which is certified according to ISO 9001 and ISO 14001.'),(5856,56,'catalogue_students_dont_know','Reinertsen is a Norwegian surname, meaning that the company is family owned.'),(5857,56,'catalogue_why_visit','Come and meet engineers from REINERTSEN. Ask us about how it is to work as an engineer at our company and what kind of project we work with. \r\n\r\nREINERTSEN is a frequent supervisor of Master Thesis projects in the field of Civil Engineering resulting in one to three Master Thesis projects almost every year for the last twenty years. That is also a reason to come and visit our exhibition booth.\r\n\r\n\r\nWe are known for our technical high skills and we have  \r\n\r\n\r\nSince its introduction in Sweden in 1990, there has been a cooperative scheme between Reinertsen and Chalmers University of Technology in Göteborg. Among other things Reinertsen is a frequent supervisor of Master Thesis projects in the field of Civil Engineering resulting in one to three Master Thesis projects almost every year for the last twenty years. \r\nSupervision of Master Thesis projects is an important part of Reinertsen s marketing towards the future engineers currently being students. The Master Thesis work is usually carried out at the Reinertsen office, in close contact with the supervisor, and the subjects studied are usually related to past or coming projects. In order to apply for doing your Master Thesis project at Reinertsen, follow the instructions shown below.\r\nReinertsen usually get a handful (approximately 5-10) applications each year regarding Master Thesis work at the company. However, our resources are limited to about 2-3 theses/year in the field of Civil Engineering. Hence, we will consider all applicants and then determine who/whom we will accept. To do this we will need the following information:\r\n'),(5858,56,'catalogue_question_freetext',''),(5859,56,'catalogue_answer','Infrastructure\r\nThis business area includes bridges and civil works, roads and transportation, water and sanitation technology, landscaping and the environment. We cover all of the various stages, from pre-study to construction documentation and tender documentation.\r\n\r\nEnergy and Industry\r\nThis business area carries out industrial projects, HVAC design, construction projects and plant-related projects within the nuclear power and petrochemical industries. Our projects include everything from special investigations to multi-discipline industrial projects.\r\n\r\nOil and Gas\r\nThis business area deals mainly with the Norwegian offshore industry, with projects within process design, underwater technology and multi-discipline projects\r\n'),(5860,56,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(5861,56,'catalogue_contact_same','Ja, yes'),(5862,56,'catalogue_contact_firstname','Sara'),(5863,56,'catalogue_contact_lastname','Nordenstam'),(5864,56,'catalogue_contact_email','sara.nordenstam@reinertsen.com'),(5865,56,'catalogue_contact_cell','010-211 50 11'),(5866,56,'catalogue_contact_position','Personalchef'),(5867,56,'catalogue_ad_description','Massa folk på en tågstation, blå botten.'),(5868,56,'catalogue_link_website','http://www.reinertsen.se'),(5869,56,'catalog