 till att dra fiber till nya bostadsområden eller säkra kommunikation på arbetsplatser och i bostäder. Vårt mål är att kombinationen av kvalitet, kompetens och säker leverans gör att våra kunder ska uppleva våra tjänster som marknadens mest prisvärda   och därmed vara det självklara valet för fältservice.\r\n'),(6068,58,'catalogue_question_freetext',''),(6069,58,'catalogue_answer','På Relacom finns möjlighet till internationell karriär och personlig utveckling. Relacom har en väl utarbetad kvalitets- och miljöpolicy som alla medarbetare ska känna till och arbeta efter. Genom ständiga förbättringar av verksamhet och kompetens är vi förberedda och engagerade för att möta eller överträffa våra kunders behov och förväntningar vid varje tillfälle. Relacom Academy är Relacoms interna utbildningshus som säkerställer att kompetensutvecklingen för alla som jobbar inom Relacom följer våra kunders krav och medarbetares utvecklingplaner.\r\n\r\n'),(6070,58,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(6071,58,'catalogue_contact_same','Ja, yes'),(6072,58,'catalogue_contact_firstname','Sanna '),(6073,58,'catalogue_contact_lastname','A Bergqvist'),(6074,58,'catalogue_contact_email','sanna.ahltorp-bergqvist@se.relacom.com'),(6075,58,'catalogue_contact_cell','0709652303'),(6076,58,'catalogue_contact_position','HR Controller'),(6077,58,'catalogue_ad_description',''),(6078,58,'catalogue_link_website','http://www.relacom.se'),(6079,58,'catalogue_link_website_student','http://'),(6080,58,'catalogue_last_day_xjob',''),(6081,58,'catalogue_link_internship',''),(6082,58,'catalogue_last_day_internship',''),(6083,58,'catalogue_link_summerjob',''),(6084,58,'catalogue_last_day_summerjob',''),(6085,58,'catalogue_link_trainee',''),(6086,58,'catalogue_last_day_trainee',''),(6087,58,'catalogue_link_positions','http://www.relacom.se/lediga-tjanster'),(6088,58,'catalogue_link_facebook','http://'),(6089,58,'catalogue_link_twitter','http://'),(