v.\r\n\r\nRiksbyggen finns över hela Sverige och är uppdelat i affärsområdena Fastighetsförvaltning och Bostad. Vi erbjuder ett brett utbud av tjänster inom teknisk och ekonomisk förvaltning till bostadsrättsföreningar, kommersiella och offentliga fastighetsägare. \r\n\r\nVårt rekryteringsbehov under de närmaste åren är stort. Vi söker framtidens fastighetsproffs och är intresserade av många olika utbildningsbakgrunder inom till exempel ekonomi, juridik, teknik, energi, försäljning och beteendevetenskap. Vi värdesätter också personligt engagemang, ansvarstagande och initiativförmåga. \r\n\r\nMed vår kooperativa värdegrund är Riksbyggen en attraktiv arbetsgivare som erbjuder medarbetarna möjlighet till utveckling, delaktighet och inflytande. Här får du ett jobb med rum för hela livet!\r\n'),(6171,59,'catalogue_students_dont_know','Riksbyggen har finns på över 40 orter runt om i Sverige och utvecklar, förvaltar och förbättrar rummen som du bor och arbetar i.'),(6172,59,'catalogue_why_visit',''),(6173,59,'catalogue_question_freetext',''),(6174,59,'catalogue_answer','Som medarbetare i Riksbyggen har du mycket att säga till om. Vårt sätt att arbeta bygger på självständighet och stort eget ansvar, och vi satsar på kontinuerlig kompetensutveckling och högt i tak. \r\n\r\n'),(6175,59,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(6176,59,'catalogue_contact_same','Ja, yes'),(6177,59,'catalogue_contact_firstname','Emma'),(6178,59,'catalogue_contact_lastname','Olofsson'),(6179,59,'catalogue_contact_email','emma.olofsson@riksbyggen.se'),(6180,59,'catalogue_contact_cell','090-159647'),(6181,59,'catalogue_contact_position','HR samordnare, Fastighetsförvaltning Norr'),(6182,59,'catalogue_ad_description',''),(6183,59,'catalogue_link_website','http://www.riksbyggen.se'),(6184,59,'catalogue_link_website_student','http://www.riksbyggen.se/Jobb-och-Karriar/'),(6185,59,'catalogue_last_day_xjob',''),(6186,59,'catalogue_link_interns