trial group with advanced products and world-leading positions in selected areas   tools for metal cutting, equipment and tools for the mining and construction industries, stainless materials, special alloys, metallic and ceramic resistance materials as well as process systems. In 2010 the Group had about 47,000 employees and representation in 130 countries, with annual sales of nearly SEK 83,000 M.'),(6276,60,'catalogue_students_dont_know','Daniel Shechtmans (Nobel Prize in Chemistry for 2011) discovery of quasicrystals is linked to Sandvik\'s R&D. Sandvik research engineers were the first in the world to discover quasicrystals in steel.'),(6277,60,'catalogue_why_visit','Vill du vara med och fira Sandviks 150-årsjubileum?\r\nI samband med Sandviks 150-årsjubileum kommer Sandvik att ordna flertalet evenemang i Göransson Arena i Sandviken under namnet Framtidsdagarna. Ett av evenemangen riktar sig till studenter på högskolor och universitet runt om i Sverige. \r\n\r\nVi bjuder in till en kväll där du som student kan få möjlighet att se hela Sandviks verksamhet samt träffa anställda och chefer på alla nivåer inom företaget. Under avslappnade och festliga former ska vi tillsammans fira företagets historia och framtid. Evenemanget äger rum fredagen den 1 juni 2012 och Sandvik står för alla resekostnader, boende och naturligtvis är deltagandet för dig som student gratis.\r\n\r\nBesök oss i montern om du vill veta mer!'),(6278,60,'catalogue_question_freetext',''),(6279,60,'catalogue_answer','Sandvik är ett globalt industriföretag där internationella resor i tjänsten är mycket vanligt förekommande. Om man som anställd hellre vill arbeta utomlands så finns det tre vägar ut i världen. Ett Assignee uppdrag varar mellan 3-12 månader vartefter den anställde återvänder till hemlandet. Ett Expatriate uppdrag varar minst 12 månader men målet är att personen skall återvända till hemlandet. Som anställd på Sandvik kan man även flytta till ett annat land på permanent basis. Många tjänster utlyses internt inom Sandvik koncernen vilket öppnar upp en värld av möjligheter för den som vill flytta utomlands.'),(6280,60,'catalogue_question','Dessa möjligheter för en internationell karriär erbjuder vårat företag:, Our company provides the following opportunities of an international career:'),(6281,60,'catalogue_contact_same','Ja, yes'),(6282,60,'catalogue_contact_firstname','Tommi'),(6283,60,'catalogue_contact_lastname','Miettinen'),(6284,60,'catalogue_contact_email','tommi.miettinen@sandvik.com'),(6285,60,'catalogue_contact_cell',''),(6286,60,'catalogue_contact_position','Manager University Relations'),(6287,60,'catalogue_ad_description',''),(6288,60,'catalogue_link_website','www.sandvik.com'),(6289,60,'catalogue_link_website_student','http://www.sandvik.se/student'),(6290,60,'catalogue_last_day_xjob',''),(6291,60,'catalogue_link_internship',''),(6292,60,'catalogue_last_day_internship',''),(6293,60,'catalogue_link_summerjob',''),(6294,60,'catalogue_last_day_summerjob',''),(6295,60,'catalogue_link_trainee',''),(6296,60,'catalogue_last_day_trainee',''),(6297,60,'catalogue_link_positions','http://www.sandvik.com/career'),(6298,60,'catalogue_link_facebook','http://www.facebook.se/sandvik.karriar'),(6299,60,'catalogue_link_twitter','http://'),(6300,60,'catalogue_link_youtube','http://www.youtube.com/sandvik'),(6301,61,'company_username','Seco Tools AB'),(6302,61,'billing_reference','HR /Smeds'),(6303,61,'billing_phone','+46 223 40 212'),(6304,61,'billing_address','Björnbacksvägen'),(6305,61,'billing_zipcode','738 82'),(6306,61,'billing_city','Fagersta'),(6307,61,'billing_country','Sverige'),(6308,61,'billing_extra_information','Ni kommer att få ett inköpsnr som ska anges på fakturan.'),(6309,61,'contact_firstname','Carina'),(6310,61,'contact_lastname','Smeds'),(6311,61,'contact_email','carina.smeds@secotools.com'),(6312,61,'contact_alt_email','lena.dyrberg@secotools.com'),(6313,61,'contact_cell','+46702971980'),(6314,61,'contact_phone','+46-223 40 212'),(