 full range of technological IT knowledge and expertise. Sogeti Sverige AB is a part of the Sogeti Group, owned by Cap Gemini S.A., listed on the Paris Stock Exchange. For more information, please visit www.sogeti.se.\r\n\r\n'),(6486,62,'catalogue_students_dont_know','På Universums senaste lista över Sveriges bästa arbetsgivare i alla branscher blev vi det högst placerade IT-företaget med vår tredjeplats. www.sogeti.se/prsba2011'),(6487,62,'catalogue_why_visit','Max 140 tecken. Här har du chans att locka studenterna till er montern.\r\nMax 140 characters. This is a chance to convice students to come to your booth.'),(6488,62,'catalogue_question_freetext',''),(6489,62,'catalogue_answer','Vilka möjligheter nyexade studenter har till intressanta och utmanande uppdrag inom Sogetis regi med verksamhet på lokal marknad men det det stora multinationella företagets resurser.'),(6490,62,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(6491,62,'catalogue_contact_same','Ja, yes'),(6492,62,'catalogue_contact_firstname',''),(6493,62,'catalogue_contact_lastname',''),(6494,62,'catalogue_contact_email',''),(6495,62,'catalogue_contact_cell',''),(6496,62,'catalogue_contact_position','Teamchef'),(6497,62,'catalogue_ad_description','Nya hungriga IT-konsulter till Sogeti i Luleå!'),(6498,62,'catalogue_link_website','http://www.sogeti.se'),(6499,62,'catalogue_link_website_student','http://www.sogeti.se/Jobb/Student/'),(6500,62,'catalogue_last_day_xjob',''),(6501,62,'catalogue_link_internship',''),(6502,62,'catalogue_last_day_internship',''),(6503,62,'catalogue_link_summerjob',''),(6504,62,'catalogue_last_day_summerjob',''),(6505,62,'catalogue_link_trainee',''),(6506,62,'catalogue_last_day_trainee',''),(6507,62,'catalogue_link_positions','http://www.sogeti.se/Jobb/Lediga-jobb/'),(6508,62,'catalogue_link_facebook','http://www.facebook.com/#!/sogeti'),(6509,62,'catalogue_link_twitter','http://'),(6510,62,'catalogue_link_