itteratur som är nödvändig för bygg- och fastighetssektorn. Svensk Byggtjänst är välkänt hos de flesta byggproffs och fastighetsförvaltare. \r\n'),(6591,63,'catalogue_students_dont_know','Vi ger ut världens viktigaste bok.'),(6592,63,'catalogue_why_visit',''),(6593,63,'catalogue_question_freetext',''),(6594,63,'catalogue_answer','AMA'),(6595,63,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(6596,63,'catalogue_contact_same','Ja, yes'),(6597,63,'catalogue_contact_firstname','Susanne'),(6598,63,'catalogue_contact_lastname','Nyberg'),(6599,63,'catalogue_contact_email','sng@byggtjanst.se'),(6600,63,'catalogue_contact_cell','0706-290899'),(6601,63,'catalogue_contact_position','Utbildningssamordnare'),(6602,63,'catalogue_ad_description',''),(6603,63,'catalogue_link_website','http://www.byggtjanst.se'),(6604,63,'catalogue_link_website_student','http://www.byggtjanst.se/student'),(6605,63,'catalogue_last_day_xjob',''),(6606,63,'catalogue_link_internship',''),(6607,63,'catalogue_last_day_internship',''),(6608,63,'catalogue_link_summerjob',''),(6609,63,'catalogue_last_day_summerjob',''),(6610,63,'catalogue_link_trainee',''),(6611,63,'catalogue_last_day_trainee',''),(6612,63,'catalogue_link_positions','http://'),(6613,63,'catalogue_link_facebook','http://'),(6614,63,'catalogue_link_twitter','http://'),(6615,63,'catalogue_link_youtube','http://'),(6616,64,'company_username','Semcon Caran AB'),(6617,64,'billing_reference','Avd 43'),(6618,64,'billing_phone','070-4160579'),(6619,64,'billing_address','Leverantörsreskontra'),(6620,64,'billing_zipcode','417 80'),(6621,64,'billing_city','Göteborg'),(6622,64,'billing_country','Sweden'),(6623,64,'billing_extra_information',''),(6624,64,'contact_firstname','Lotta'),(6625,64,'contact_lastname','Lundgren'),(6626,64,'contact_email','lotta.lundgren@semcon.com'),(6627,64,'contact_alt_email','hans.westergren@semcon.com, emma.groth@semcon.com, hanna.vali@semcon.com'),(6628,