 start till mål. '),(6697,64,'catalogue_why_visit','Semcon arbetar med allt från mindre uppdrag till större komplexa projekt. Detta ger våra medarbetare möjligheter att utvecklas genom att vara med och påverka utvecklingen av framtidens produkter, tjänster och informationslösningar inom en rad olika branscher. Besök vår monter så ska vi berätta mer om Semcons spännande värld och om hur du kan bli en del av den!'),(6698,64,'catalogue_question_freetext',''),(6699,64,'catalogue_answer','Gillar du att lösa problem och vågar du ställa saker på sin spets? Då passar du hos oss! Vår drivkraft är att utveckla framtiden genom smarta idéer som gör världen bättre och våra kunder till vinnare. Genom att utveckla våra kunders produkter på ett klimatsmart sätt bidrar vi till en bättre och resurssnålare värld. Var med oss och skapa framtiden! \r\n \r\n\"\"Alla mina kolleger är trevliga och hjälpsamma, var i världen de än finns. De hjälper varandra och lär sig av varandra, och det ökar allas förmåga,\"\" GuBo  Tekniskillustratör. Semcon Beijing.\r\n\r\n För en sådan som jag, som inte vill bestämma sig, är Semcon ett bra företag. Jag skulle tröttna om jag inte fick jobba med olika saker  Pär   Konceptdesigner. Semcon Göteborg.'),(6700,64,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(6701,64,'catalogue_contact_same','Ja, yes'),(6702,64,'catalogue_contact_firstname','Hans'),(6703,64,'catalogue_contact_lastname','Westergren'),(6704,64,'catalogue_contact_email','hans.westergren@semcon.com'),(6705,64,'catalogue_contact_cell','+46(0)70-416 05 85'),(6706,64,'catalogue_contact_position','Manager Semcon Dalarna'),(6707,64,'catalogue_ad_description',''),(6708,64,'catalogue_link_website','http://www.semcon.com'),(6709,64,'catalogue_link_website_student','http://'),(6710,64,'catalogue_last_day_xjob',''),(6711,64,'catalogue_link_internship',''),(6712,64,'catalogue_last_day_internship',''),(6713,64,'catalogue_link_summerjob',''),(6714,6