n','2 900'),(7638,73,'catalogue_countries','Norge'),(7639,73,'catalogue_employees_global','8'),(7640,73,'catalogue_company_description','Vi är Sveriges ledande driftentreprenör och det fjärde största väg- och anläggningsföretaget i landet med 2 800 medarbetare. Vår kärnverksamhet är att utföra nybyggnation samt sköta drift, service och underhåll av Sveriges vägar och annan infrastruktur. Uppdragen omfattar allt ifrån vägar, gator, broar till järnvägar, hamnar och fjärrvärme.\r\nEnligt våra kunder är vi det mest trovärdiga företaget i branschen.'),(7641,73,'catalogue_students_dont_know','Satsningpå arbete och välmående gör oss friskast i branschen\r\nDet är viktigt hur våra medarbetare mår. Vi satsar mycket på hälsofrågor, därför är Svevias medarbetare friskast i branschen.\r\nVart tredje år genomför vi en omfattande hälsokartläggning, där en hälsocoach ger råd kring hur vi kan förbättra våra motions-, sov- och kostvanor. \r\nSamtliga medarbetare erbjuds också en årlig friskvårdspeng för att kunna träna.\r\n\r\nDen totala sjukfrånvaron låg år 2010 kvar på den låga nivån 2,1 procent.\r\n\r\nVårt kontinuerliga arbete med hälsofrågor är en bidragande del till att våra medarbetare är friskast i branschen.'),(7642,73,'catalogue_why_visit',''),(7643,73,'catalogue_question_freetext',''),(7644,73,'catalogue_answer','Vi erbjuder dig\r\n\r\nMöjligheter till personlig utveckling\r\nOmväxlande arbetsuppgifter\r\nEn innovativ bransch med snabba förändringar\r\nEn arbetsmiljö med högt ställda etiska normer\r\nEtt utmanande arbete'),(7645,73,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(7646,73,'catalogue_contact_same','Ja, yes'),(7647,73,'catalogue_contact_firstname',''),(7648,73,'catalogue_contact_lastname',''),(7649,73,'catalogue_contact_email',''),(7650,73,'catalogue_contact_cell',''),(7651,73,'catalogue_contact_position','HR-specialist'),(7652,73,'catalogue_ad_description',''),(7653,73,'catalogue_link_website','http://w