och underhållstjänster. Dessutom bedrivs verksamhet inom fastighetsuthyrning och bredband. Bolaget är helägt av Skellefteå kommun och 2010 var antalet anställda cirka 640, med en omsättning på 4,5 miljarder kronor.'),(7956,76,'catalogue_students_dont_know','\" 	Skellefteå Kraft är en av Sveriges största kraftproducenter\r\n\" 	Skellefteå Krafts energiportfölj motverkar vår tids största klimatutmaning, utsläppen av koldioxid från fossila bränslen som kol och olja'),(7957,76,'catalogue_why_visit','I montern kan du träffa och ställa frågor till våra medarbetare som hunnit arbeta hos oss några år och kan reflektera över Skellefteå Kraft som arbetsgivare. \r\n\r\nEnergibranschen är en framtidsbransch '),(7958,76,'catalogue_question_freetext',''),(7959,76,'catalogue_answer','\" 	Arbetsplatsen med utrymme för balans i livet\r\n\" 	Så är det att jobba på Skellefteå Kraft\r\no	Utmanade yrkesroller i en innovativ bransch\r\no	Din kompetens kan fortsätta att utvecklas hos oss\r\no	Program för ledarutveckling\r\no	Balans mellan arbete och privatliv \r\no	Personalföreningar\r\no	Friskvård och Företagshälsovård\r\n\" 	Skellefteå Krafts energiportfölj motverkar vår tids största klimatutmaning, utsläppen av koldioxid från fossila bränslen som kol och olja\r\n\" 	Vindkraft i kallt klimat\r\n\" 	Blaiken   ett av Europas största landbaserade vindkraftparker byggs av Skellefteå Kraft\r\n\" 	100 års erfarenhet av vattenkraftproduktion. \r\n\" 	Världsledande kompetens inom utvecklingen av bioenergikombinat\r\n\" 	Lediga tjänster\r\n\" 	Exjobb\r\n\" 	Praktik\r\n\" 	Studiebesök\r\n\" 	Skellefteå Kraft bjuder in studenter till Vintervind 2012 - ett internationellt seminarium om vindkraft i kallt klimat. 7-8 feb 2012 i Skellefteå\r\n'),(7960,76,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(7961,76,'catalogue_contact_same','Ja, yes'),(7962,76,'catalogue_contact_firstname','Johanna'),(7963,76,'catalogue_contact_lastname