onitor_stand',''),(8048,77,'booth_threephase','Nej, no'),(8049,77,'booth_threephase_description',''),(8050,77,'booth_width','6'),(8051,77,'booth_depth','2'),(8052,77,'booth_height','3'),(8053,77,'booth_extra_area','6'),(8054,77,'booth_total_cost','28500'),(8055,77,'catalogue_company_name','SSAB'),(8056,77,'catalogue_cities','Luleå, Borlänge, Oxelösund, Finspång, Stockholm'),(8057,77,'catalogue_employees_sweden','6500'),(8058,77,'catalogue_countries','45'),(8059,77,'catalogue_employees_global','9000'),(8060,77,'catalogue_company_description','SSAB är ett attraktivt kunskapsföretag som finns på alla kontinenter och i över 45 länder. Möjlighet finns att arbeta i olika internationella miljöer och på någon av våra fem stora produktionsorter; Borlänge, Luleå och Oxelösund i Sverige samt Montpelier och Mobile i USA. Många av våra medarbetare arbetar lokalt och globalt på samma gång.\r\n\r\nSSAB har en helhetssyn på människan. Anställda i koncernen erbjuds kontinuerlig kompetensutveckling och det finns stora karriärmöjligheter i hela koncernen. Lika möjligheter och balans i livet är självklarheter för oss. Vi vet att ett aktivt liv utanför arbetet ökar förmågan att prestera bra resultat även på arbetet.\r\n\r\nVi arbetar hela tiden med att utveckla produkter som skapar fördelar både för våra kunder och för miljön. Därför söker vi ständigt nya medarbetare med innovativa idéer. Källan till SSABs framgång är en samlad kompetens och erfarenhet. För att möta morgondagens krav behöver SSAB ständigt ny kompetens samt nya idéer och tankebanor för att kunna behålla positionen som en världsledande tillverkare av höghållfasta stål. \r\n\r\nVi vill tillsammans med kunniga och engagerade medarbetare forma en lättare, starkare och mer hållbar framtid. Kanske är du en av våra framtida medarbetare   någon som vill vara med och skapa en starkare, lättare och mer hållbar värld. \r\n'),(8061,77,'catalogue_students_dont_know','SSAB har anställda i 45 olika länder, vi har produktionsanläggningar i både Sverige och i USA. I Kina sker också bearbetning och färdigställning av de olika stålprodukterna. '),(8062,77,'catalogue_why_visit','Du har chans att vinna en intervju och ett studiebesök på SSAB om du deltar vår tävling i montern. Du får också chans att träffa personer som arbetar inom olika områden på SSAB för att ställa frågor om vad just du kan arbeta med efter din examen. De arbetsuppgifter vi erbjuder spänner över ett stort antal områden, från produktion och arbetsledning till forskning och utveckling.  '),(8063,77,'catalogue_question_freetext',''),(8064,77,'catalogue_answer','På vår hemsida, under rubriken \"\"karriär\"\", finns intervjuer med medarbetare som beskriver sina roller och utvecklingsmöjligheter inom SSAB. '),(8065,77,'catalogue_question','Dessa utvecklingsmöjligheter genom kompetensutveckling/internutbildningar/mentorskap mm erbjuds för våra nyanställda:,  These development opportunities through training / in-house training / mentoring, etc. are offered our new employees:'),(8066,77,'catalogue_contact_same','Nej, no'),(8067,77,'catalogue_contact_firstname','Agneta'),(8068,77,'catalogue_contact_lastname','Ekman'),(8069,77,'catalogue_contact_email','agneta.ekman@ssab.com'),(8070,77,'catalogue_contact_cell','+46 70-358 23 90'),(8071,77,'catalogue_contact_position','HR Partner'),(8072,77,'catalogue_ad_description',''),(8073,77,'catalogue_link_website','http://www.ssab.com'),(8074,77,'catalogue_link_website_student','http://www.ssab.com/sv/Karriar/'),(8075,77,'catalogue_last_day_xjob',''),(8076,77,'catalogue_link_internship',''),(8077,77,'catalogue_last_day_internship',''),(8078,77,'catalogue_link_summerjob',''),(8079,77,'catalogue_last_day_summerjob',''),(8080,77,'catalogue_link_trainee',''),(8081,77,'catalogue_last_day_trainee',''),(8082,77,'catalogue_link_positions','http://www.ssab.com/Karriar/Lediga-tjanster1/Lediga-tjanster/'),(8083,77,'catalogue_link_facebook','http://www.facebook.com/pages/SSAB-AB/145401631365'),(8084,77,'catalogue_l