70,79,'catalogue_company_description','Smurfit Kappa Kraftliner i Piteå är Europas största kraftlinerbruk med kapacitet att årligen tilverka 700 000 ton papper. Det nyfiberbaserade papper som tillverkas kallas kraftliner och används för tillverkning av högklassig wellpapp.\r\nFabriken i Piteå ingår i Smurfit Kappa Group som har 38 000 anställda fördelade på 350 enheter i 22 Europeiska länder och i 9 länder i Latinamerika.'),(8271,79,'catalogue_students_dont_know','Att vi är störst i Europa på vår produkt.\r\nAtt vi har de lägsta koldioxidutsläppen per ton producerad liner i branschen. \r\nAtt oljeförbrukningen minskat med 87% de senaste fem åren.\r\nAtt Pite Energis fjärrvärmenät som idag når ca 3000 fastigheter till största delen får sin energi från Smurfit Kappa Kraftliner.'),(8272,79,'catalogue_why_visit','Få en inblick i vad skogsindustrin står för idag och vilka yrkesval som kan komma ifråga i den framtidsbransch som skogsindustrin är. '),(8273,79,'catalogue_question_freetext',''),(8274,79,'catalogue_answer','Vi har fokus på miljön. Koldioxidutsläppen de lägsta i branschen. Att pappersindustrin även kan fungera som ett bioraffinaderi för produktion av syntesgas, metanol, DME, gröna kemikalier osv från massabrukets biprodukter. \r\nInformera om våra olika yrkesval som kan komma ifråga i den framtidsbransch som skogsindustrin är. Vi jobbar med värderingar och strävar efter att vara en arbetsplats där alla mår bra och där arbetsmiljön är trivsam och säker. Informera om kommande rekryteringsbehov. Att arbeta hos oss ger internationella kontakter med möjlighet till tjänstgöring utomlands för kortare och längre perioder. \r\n'),(8275,79,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(8276,79,'catalogue_contact_same','Ja, yes'),(8277,79,'catalogue_contact_firstname','Margareta'),(8278,79,'catalogue_contact_lastname','Karlsson'),(8279,79,'catalogue_contact_email','margareta.karlsson@smurfitkappa.se