rontlinjen.\r\n'),(8586,82,'catalogue_students_dont_know','20% av våra anställda är anmälda till Göteborgsvarvet i maj 2012! Vi har 11 olika nationaliteter på våra kontor i Sverige. 12% har en PhD, 79% Master och 9% Bachelors degree.'),(8587,82,'catalogue_why_visit','Kom till vår monter och fråga oss om SNAC, Scandpower Nuclear Academy, där nyanställda konsulter utbildas av företagets veteraner.'),(8588,82,'catalogue_question_freetext',''),(8589,82,'catalogue_answer','För att diskutera möjligheterna med att jobba med säkerhetsfrågor inom energi och transportbranschen.'),(8590,82,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(8591,82,'catalogue_contact_same','Ja, yes'),(8592,82,'catalogue_contact_firstname','Carl'),(8593,82,'catalogue_contact_lastname','Lowisin'),(8594,82,'catalogue_contact_email','clo@scandpower.com'),(8595,82,'catalogue_contact_cell','+46(0)70 869 54 21 '),(8596,82,'catalogue_contact_position','Consult'),(8597,82,'catalogue_ad_description','Scandpower arbetar med riskhantering, säkerhet, kvalitet, miljö och effektivitet inom främst energi, transport och processindustri. Vi befinner oss nu i en spännande fas där vi ska öka andelen konsultuppdrag på den internationella marknaden. Idag har vi konsultverksamhet i Sverige, Norge, Nordamerika, Storbritannien, Kina, Malaysia och Korea.\r\nScandpower utvecklar världsledande mjukvaror för olika typer av risk och tillförlitlighetsanalyser. Vår programsvit RiskSpectrum® används idag på hälften av världens kärnkraftverk och dagligen av våra konsulter.\r\nVåra kunder förväntar sig professionella tjänster och produkter och vi utvecklar kontinuerligt vår personal och våra tjänster, metoder och mjukvaror för att behålla vår plats i frontlinjen.\r\n'),(8598,82,'catalogue_link_website','http://www.scandpower.com'),(8599,82,'catalogue_link_website_student','http://www.scandpower.com/'),(8600,82,'catalogue_last_day_xjob',''),(8601,82,'catalogue_l