rastruktur. Vi ser till att såväl ung som gammal får omsorg och trygghet, att barn och ungdomar får möjlighet till utbildning och att människor i behov av stöd får det. För att berika våra invånares liv erbjuder vi även ett brett utbud av kultur- och fritidsaktiviteter.\r\nVi hoppas att du vill delta i vårt arbete med att göra Skellefteå till en ännu bättre plats att bo och verka i. I gengäld kan vi erbjuda dig en attraktiv arbetsgivare som prioriterar din utveckling och ser värdet av din kompetens och ditt engagemang.\r\nVarmt välkommen till Skellefteå kommun!'),(8796,84,'catalogue_students_dont_know','Vi är en av få offentliga arbetsgivare som driver utvecklingen från idé till verklighet. Hos oss ingår helheten; tänkande, skissande, ritande, räknande, byggande och utförande.'),(8797,84,'catalogue_why_visit','Vi kan erbjuda dig:\r\n\" 	Sommarjobb\r\n\" 	Praktikjobb\r\n\" 	Traineejobb\r\n\" 	Anställning\r\nNågra exempel på varför vi behöver dig:\r\n\" 	Rent vatten, en ny huvudvattentäkt ska anläggas.\r\n\" 	Bryter barriärer, nya stora broar ska byggas.\r\n\" 	Satsar på hållbart resande, ett nytt resecentrum ska uppföras.\r\n\" 	Bygger med kretsloppstänkande, för både bostäder och förskolor.\r\n\" 	En IT-intensiv utveckling pågår för att möta framtidens krav på tillgänglighet och öppenhet.'),(8798,84,'catalogue_question_freetext',''),(8799,84,'catalogue_answer','Du vill ha ett varierat och självständigt arbete. \r\nDu tycker det är roligt att kunna jobba långsiktigt och se resultat av det du gör. \r\nDu gillar att arbeta med problemlösning i ett helhetsperspektiv och att följa en process hela vägen. \r\nAtt få arbeta med människor och flera olika yrkesgrupper är också viktigt för dig. Du vill se att det du gör i ditt arbete har verklig nytta i samhället. Du vill göra skillnad!  \r\n'),(8800,84,'catalogue_question','Dessa egenskaper söker vi främst hos dig som medarbetare hos oss:, We are looking for someone with, mainly, the following qualities:'),(8801,84,'catalogue_contact_same','Ja, yes'),(8802,84,'catalogue_contact_firstname',''),(8803,84,'catalogue_contact_lastname',''),(8804,84,'catalogue_contact_email',''),(8805,84,'catalogue_contact_cell',''),(8806,84,'catalogue_contact_position','Skellefteå kommun'),(8807,84,'catalogue_ad_description','Skellefteå kommun är en av Norrlands största arbetsgivare. Hos oss jobbar runt 8000 medarbetare för att kommuninvånarna ska kunna leva ett tryggt och bra liv.\r\nVi har över 300 yrkesgrupper representerade inom en mängd områden.\r\nVi ansvarar för energi- och miljöfrågor, mark- och vatten, fastigheter och infrastruktur. Vi ser till att såväl ung som gammal får omsorg och trygghet, att barn och ungdomar får möjlighet till utbildning och att människor i behov av stöd får det. För att berika våra invånares liv erbjuder vi även ett brett utbud av kultur- och fritidsaktiviteter.\r\nVi hoppas att du vill delta i vårt arbete med att göra Skellefteå till en ännu bättre plats att bo och verka i. I gengäld kan vi erbjuda dig en attraktiv arbetsgivare som prioriterar din utveckling och ser värdet av din kompetens och ditt engagemang.\r\nVarmt välkommen till Skellefteå kommun!'),(8808,84,'catalogue_link_website','www.skelleftea.se'),(8809,84,'catalogue_link_website_student','www.skelleftea.se/student'),(8810,84,'catalogue_last_day_xjob',''),(8811,84,'catalogue_link_internship',''),(8812,84,'catalogue_last_day_internship',''),(8813,84,'catalogue_link_summerjob',''),(8814,84,'catalogue_last_day_summerjob',''),(8815,84,'catalogue_link_trainee',''),(8816,84,'catalogue_last_day_trainee',''),(8817,84,'catalogue_link_positions','http://www.skelleftea.se/ledigajobb'),(8818,84,'catalogue_link_facebook','http://http://www.facebook.com/skelleftea'),(8819,84,'catalogue_link_twitter','http://http://twitter.com/#!/Skeakommun '),(8820,84,'catalogue_link_youtube','http://www.youtube.com/user/Skellefteakommun'),(8821,85,'company_username','Tria2012'),(8822,85,'billing_reference','Karin Degerlund'),(8823,85,'billing_