g Sweroad skickar vi varje år ut duktiga medarbetare till projekt runt om i världen. Vi är erkänt duktiga på exempelvis miljö- och trafiksäkerhetsfrågor, och vår kompetens efterfrågas i länder som inte har kommit lika långt som vi.\r\n\r\n'),(9007,86,'catalogue_why_visit',''),(9008,86,'catalogue_question_freetext',''),(9009,86,'catalogue_answer','Du kan bland annat göra karriär som chef, projektledare, driftledare, byggledare eller specialist. Eftersom vi är en så bred organisation med många olika verksamhetsområden kan vi erbjuda stora möjligheter att utvecklas eller byta jobb internt. För att vi ska kunna följa med i den allt snabbare utvecklingen är det viktigt att våra medarbetare har möjlighet till kontinuerlig kompetensutveckling under hela sitt yrkesliv.\r\n\r\n'),(9010,86,'catalogue_question','Dessa utvecklingsmöjligheter genom kompetensutveckling/internutbildningar/mentorskap mm erbjuds för våra nyanställda:,  These development opportunities through training / in-house training / mentoring, etc. are offered our new employees:'),(9011,86,'catalogue_contact_same','Ja, yes'),(9012,86,'catalogue_contact_firstname',''),(9013,86,'catalogue_contact_lastname',''),(9014,86,'catalogue_contact_email','personalcenter@trafikverket.se'),(9015,86,'catalogue_contact_cell',''),(9016,86,'catalogue_contact_position','Personal'),(9017,86,'catalogue_ad_description',''),(9018,86,'catalogue_link_website','http://www.trafikverket.se'),(9019,86,'catalogue_link_website_student','http://'),(9020,86,'catalogue_last_day_xjob',''),(9021,86,'catalogue_link_internship',''),(9022,86,'catalogue_last_day_internship',''),(9023,86,'catalogue_link_summerjob',''),(9024,86,'catalogue_last_day_summerjob',''),(9025,86,'catalogue_link_trainee',''),(9026,86,'catalogue_last_day_trainee',''),(9027,86,'catalogue_link_positions','http://'),(9028,86,'catalogue_link_facebook','http://'),(9029,86,'catalogue_link_twitter','http://'),(9030,86,'catalogue_link_youtube','http://'),(9031,87,'company_username','Te