telse och en stark ekonomisk ryggrad gör det möjligt för oss att satsa kraftfullt, långsiktigt och kontinuerligt på att utveckla verksamheten och våra medarbetare. '),(9216,88,'catalogue_students_dont_know','Tyréns är ett personligt företag som också bär på traditioner med långsiktighet och egenfinansierad forsknings- och utvecklingsverksamhet. Att vi har en ägare som inte är börsnoterad och står fri från andra intressen är också en viktig del för integriteten och trovärdigheten hos ett konsultföretag. Det är detta som är Tyréns profil och som också ger oss en särprägel på marknaden.\r\n\r\n'),(9217,88,'catalogue_why_visit','Kom och träffa oss som jobbar på Tyréns, kanske vi har exjobbet eller praktikplatsen du letar efter.'),(9218,88,'catalogue_question_freetext',''),(9219,88,'catalogue_answer','Vi är nyfikna på dig!\r\n \r\nDe goda livsbetingelserna börjar hos oss på Tyréns, och det här är ett kvitto på att vi arbetar på rätt sätt. Våra medarbetare måste få utvecklas som professionella konsulter samtidigt som de ska kunna ha balans i sina liv. Det måste gå att uppnå en jämvikt mellan ambitioner, målsättningar, fritid och familj. Våra resultat avspeglar hur vi lyckas med vårt arbete att skapa goda livsbetingelser, både för Tyréns och för vårt samhälle.\r\n\r\nSom nyutexaminerad medarbetare börjar man vanligen som konsult som deltar i uppdrag under ledning av en uppdragsansvarig. Ju mer man lär sig om området och konsultjobbet desto större uppgifter och ansvar får man. Beroende på utveckling och intresse så väljer man väg och de vanligaste utvecklingsvägarna är att: fördjupa sig inom sitt kompetensområde och bli specialist, ta mer ansvar i uppdrag för att bli uppdragsansvarig, ta större och större uppdrag som projektledare i kundprojekt eller gå vidare med sikte på att bli chef i linjen.\r\n\r\nUtvecklingsmöjligheter utöver den utveckling som karriärvägarna kan erbjuda så finns även möjligheter inom Tyréns forsknings- och utvecklingsverksamhet. Genom den stiftelse som äger Tyréns läggs ca 20 mkr per år i rena forsknings- och utvecklingsprojekt. Detta är projekt som genomförs helt internt på Tyréns eller i samarbete med högskolor och företag.\r\n'),(9220,88,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(9221,88,'catalogue_contact_same','Nej, no'),(9222,88,'catalogue_contact_firstname','Lisa '),(9223,88,'catalogue_contact_lastname','Stridsman'),(9224,88,'catalogue_contact_email','lisa.stridsman@tyrens.se'),(9225,88,'catalogue_contact_cell','070-5473714'),(9226,88,'catalogue_contact_position','Trafikplanerare'),(9227,88,'catalogue_ad_description',''),(9228,88,'catalogue_link_website','http://www.tyrens.se/'),(9229,88,'catalogue_link_website_student','http://www.tyrens.se/sv/Karriar/Student/'),(9230,88,'catalogue_last_day_xjob',''),(9231,88,'catalogue_link_internship',''),(9232,88,'catalogue_last_day_internship',''),(9233,88,'catalogue_link_summerjob',''),(9234,88,'catalogue_last_day_summerjob',''),(9235,88,'catalogue_link_trainee',''),(9236,88,'catalogue_last_day_trainee',''),(9237,88,'catalogue_link_positions','http://www.tyrens.se/sv/Karriar/Lediga-jobb/'),(9238,88,'catalogue_link_facebook','http://www.facebook.com/tyrensab'),(9239,88,'catalogue_link_twitter','http://twitter.com/#!/tyrens_ab'),(9240,88,'catalogue_link_youtube','http://www.youtube.com/tyrensab'),(9241,89,'company_username','Tieto Sweden AB'),(9242,89,'billing_reference','Anders Österlund'),(9243,89,'billing_phone','+46 73 838 8318'),(9244,89,'billing_address','FE 391'),(9245,89,'billing_zipcode','83880'),(9246,89,'billing_city','Hackås'),(9247,89,'billing_country','Sverige'),(9248,89,'billing_extra_information','120533, 91917 projektnummer'),(9249,89,'contact_firstname','Alexander '),(9250,89,'contact_lastname','Lundqvist '),(9251,89,'contact_email','alexander.lundqvist-cruz@tieto.com'),(9252,89,'contact_alt_email','anders.osterlund@tieto.com'),(9253,89,'contact_cell','+46 (0)10 481 00 00'),(9254,89,'conta