 Toyota Industries Corporation, TICO.'),(9426,90,'catalogue_students_dont_know','Nästan allting du har omkring dig i din vardag har någon gång fraktats med hjälp av en truck'),(9427,90,'catalogue_why_visit',''),(9428,90,'catalogue_question_freetext','Vad heter vårt välkända produktionssystem som gjort oss världsledande inom kvalitet?'),(9429,90,'catalogue_answer','Ständiga förbättringar, oändliga karriärmöjligheter, världens bästa truckar, TPS, Toyota Way'),(9430,90,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(9431,90,'catalogue_contact_same','Ja, yes'),(9432,90,'catalogue_contact_firstname','Sara'),(9433,90,'catalogue_contact_lastname','Wennstam'),(9434,90,'catalogue_contact_email','sara.wennstam@toyota-industries.eu'),(9435,90,'catalogue_contact_cell','072-230 36 10'),(9436,90,'catalogue_contact_position','HR'),(9437,90,'catalogue_ad_description',''),(9438,90,'catalogue_link_website','http://www.toyota-forklifts.eu/en/Careers/Pages/Career.aspx'),(9439,90,'catalogue_link_website_student','http://'),(9440,90,'catalogue_last_day_xjob',''),(9441,90,'catalogue_link_internship',''),(9442,90,'catalogue_last_day_internship',''),(9443,90,'catalogue_link_summerjob',''),(9444,90,'catalogue_last_day_summerjob',''),(9445,90,'catalogue_link_trainee',''),(9446,90,'catalogue_last_day_trainee',''),(9447,90,'catalogue_link_positions','http://www.toyota-forklifts.eu/en/Careers/mjolby'),(9448,90,'catalogue_link_facebook','http://'),(9449,90,'catalogue_link_twitter','http://'),(9450,90,'catalogue_link_youtube','http://'),(9451,91,'company_username','Vectura'),(9452,91,'billing_reference','10311'),(9453,91,'billing_phone','104845315'),(9454,91,'billing_address','FE 275'),(9455,91,'billing_zipcode','83383'),(9456,91,'billing_city','Strömsund'),(9457,91,'billing_country','Sverige'),(9458,91,'billing_extra_information',''),(9459,91,'contact_firstname','Anette'),(9460,91,'contact_lastname','Fröjd'),(9461,91,'contact