inns.Vi berättar mer om vårt traineeprogram.'),(9533,91,'catalogue_question_freetext',''),(9534,91,'catalogue_answer','Det finns många vägar in i Vectura, allt från examensjobb och praktikplats till en fast anställning. Vi tar årligen in ett stort antal medarbetare, både nyutexaminerade och med några års erfarenhet. Du kan välja att söka till vår tefteraktade traineeutbildning. Under ett års tid får 20 utvalda talanger lära sig om konsultyrket, om affärsmannaskap, presentationsteknik, ledarskap och en fördjupad kunskap om företaget. Självklart får du också prova på att jobba tillsammans med erfarna och kunniga medarbetre. Alla trainees får en personlig handledare och en tillsvidareanställning på ett av våra kontor. '),(9535,91,'catalogue_question','Dessa utvecklingsmöjligheter genom kompetensutveckling/internutbildningar/mentorskap mm erbjuds för våra nyanställda:,  These development opportunities through training / in-house training / mentoring, etc. are offered our new employees:'),(9536,91,'catalogue_contact_same','Ja, yes'),(9537,91,'catalogue_contact_firstname',''),(9538,91,'catalogue_contact_lastname',''),(9539,91,'catalogue_contact_email',''),(9540,91,'catalogue_contact_cell',''),(9541,91,'catalogue_contact_position','HR '),(9542,91,'catalogue_ad_description',''),(9543,91,'catalogue_link_website','http://www.vectura.se'),(9544,91,'catalogue_link_website_student','http://www.vectura.se/sv/Jobba-hos-oss/Student/'),(9545,91,'catalogue_last_day_xjob',''),(9546,91,'catalogue_link_internship',''),(9547,91,'catalogue_last_day_internship',''),(9548,91,'catalogue_link_summerjob',''),(9549,91,'catalogue_last_day_summerjob',''),(9550,91,'catalogue_link_trainee',''),(9551,91,'catalogue_last_day_trainee',''),(9552,91,'catalogue_link_positions','http://www.vectura.se/sv/Jobba-hos-oss/Att-jobba-pa-Vectura/'),(9553,91,'catalogue_link_facebook','http://www.facebook.com/vectura'),(9554,91,'catalogue_link_twitter','http://'),(9555,91,'catalogue_link_youtube','http://www.youtube