airs, Vattenfall and students usally discuss the energy industry, new technologies and environmental issues, but also our need for future competencies, thesis projects, summer workers and trainee programmes.'),(9745,93,'catalogue_question','Det här vill vi gärna prata om  i vår monter:,  We would like to talk about this at our booth:'),(9746,93,'catalogue_contact_same','Ja, yes'),(9747,93,'catalogue_contact_firstname','Hanna'),(9748,93,'catalogue_contact_lastname','Welander'),(9749,93,'catalogue_contact_email','student@vattenfall.com'),(9750,93,'catalogue_contact_cell','087396505'),(9751,93,'catalogue_contact_position','Studentkoordinator'),(9752,93,'catalogue_ad_description',''),(9753,93,'catalogue_link_website','http://www.vattenfall.se'),(9754,93,'catalogue_link_website_student','http://www.vattenfall.se/student'),(9755,93,'catalogue_last_day_xjob',''),(9756,93,'catalogue_link_internship',''),(9757,93,'catalogue_last_day_internship',''),(9758,93,'catalogue_link_summerjob',''),(9759,93,'catalogue_last_day_summerjob',''),(9760,93,'catalogue_link_trainee',''),(9761,93,'catalogue_last_day_trainee',''),(9762,93,'catalogue_link_positions','http://www.vattenfall.se/jobb'),(9763,93,'catalogue_link_facebook','http://www.facebook.com/vattenfallnordicjobs'),(9764,93,'catalogue_link_twitter','http://www.twitter.com/vattenfall_se'),(9765,93,'catalogue_link_youtube','http://www.youtube.com/vattenfall'),(9766,94,'company_username','Volvo koncernen'),(9767,94,'billing_reference','Lina Hult'),(9768,94,'billing_phone','0739024488'),(9769,94,'billing_address','ARC2 dep 5143'),(9770,94,'billing_zipcode','405 08'),(9771,94,'billing_city','Göteborg'),(9772,94,'billing_country','Sweden'),(9773,94,'billing_extra_information','Gällande fakturering så måste det ske enligt följande. \r\n1.	Ni mailar fakturan till mig efter arbetsmarknadsdagen. lina.hult.2@volvo.com\r\n2.	Fakturan läggs in i Volvos EBD och det genereras ett ordernummer. \r\n        Utan detta ordernummer kan ni inte få beta