det få av våra branschkollegor som kan erbjuda.\r\n\r\nXdin är ett av Sveriges snabbast växande teknik- och IT-konsultbolag. Vi behöver mer kompetenta ingenjörer! '),(10058,96,'catalogue_question_freetext',''),(10059,96,'catalogue_answer','At Xdin we believe that true commitment comes with the opportunity of being able to influence one s own situation and development. That is why freedom of choice is important to us when it comes to choice of assignment, benefits, salary and education. That is something few of our competitors can offer.\r\n\r\nXdin is one of Swedens fastest growing engineering and IT consulancy companies. We need more skilled and committed engineers!'),(10060,96,'catalogue_question','Därför skall du arbeta hos oss:,  You should consider working with us because:'),(10061,96,'catalogue_contact_same','Ja, yes'),(10062,96,'catalogue_contact_firstname','Magnus'),(10063,96,'catalogue_contact_lastname','Pettersson'),(10064,96,'catalogue_contact_email','magnus.pettersson@xdin.com'),(10065,96,'catalogue_contact_cell','+46 701 693719'),(10066,96,'catalogue_contact_position','Student relations manager'),(10067,96,'catalogue_ad_description','Annons måste kopmpletteras senare. Vi har precis bytt logotyp för företaget.'),(10068,96,'catalogue_link_website','http://www.xdin.com'),(10069,96,'catalogue_link_website_student','http://www.xdin.com/sv-se/karri%C3%A4r/studenter.aspx'),(10070,96,'catalogue_last_day_xjob',''),(10071,96,'catalogue_link_internship',''),(10072,96,'catalogue_last_day_internship',''),(10073,96,'catalogue_link_summerjob',''),(10074,96,'catalogue_last_day_summerjob',''),(10075,96,'catalogue_link_trainee',''),(10076,96,'catalogue_last_day_trainee',''),(10077,96,'catalogue_link_positions','http://www.xdin.com/sv-se/karri%C3%A4r/ledigajobb.aspx'),(10078,96,'catalogue_link_facebook','http://www.facebook.com/XdinAB'),(10079,96,'catalogue_link_twitter','http://'),(10080,96,'catalogue_link_youtube','http://www.youtube.com/user/xdin1991'),(10081,97,'comp