lyttar, behandlar, analyserar och återför vatten till miljön, och vi hjälper människor att använda vatten effektivt   hemma, på arbetet, på fabrikerna och i jordbruket. I mer än 150 länder har vi en stark och långvarig relation med kunder som vet att vi står för en dynamisk kombination av ledande produktvarumärken och expertkunskaper om applikationer med stöd av vår historia som innovatörer.'),(10161,97,'catalogue_students_dont_know','Vi tar ett stort socialt ansvar.\r\nFN har uppskattat att över en miljard människor saknar rent dricksvatten. Därför är ett socialt ansvar från vår sida helt naturligt och nödvändigt. Det ideella arbetet kan se ut på många sätt. Vi bidrar med utrustning för vattenförsörjning och vattenrening, sponsrar utbildningar och skolor, deltar i humanitärt hjälparbete och donerar pengar. Dessutom samarbetar vi med organisationer som Water for People och Mercy Corps i utvecklingsländer samt är grundare och sponsor av Stockholm Water Prize. Vatten är trots allt en mänsklig rättighet'),(10162,97,'catalogue_why_visit','Hos oss kan du jobba med allt från forskning och utveckling till produktion, IT och marknadsföring/information. Samarbeten mellan avdelningar och grupper är vanligt, så ett integrerat sätt att tänka är en klar fördel. Värt att nämnas är också att vi målmedvetet arbetar för att lösa upp de traditionella yrkesmässiga könsrollerna. Givetvis kan du alltid skaffa nya erfarenheter genom att byta till en annan tjänst inom företaget. Karriärmöjligheterna är stora för den som vill.'),(10163,97,'catalogue_question_freetext',''),(10164,97,'catalogue_answer','Vatten är en global fråga. Då är det logiskt att du också har globala kontakter   både kollegor och kunder. Som vi redan nämnt finns Xylem i över hundra länder. Kunderna kommer från många olika verksamheter: bland annat reningsverk, industrier, gruvor och byggverksamhet. Utlandsresor och möten med andra kulturer är följaktligen inget ovanligt. Välkommen ut i världen!'),(10165,97,'catalogue_question','Dessa möjligheter för en internationell karriär erbjuder vårat företag:, Our company provides the following opportunities of an international career:'),(10166,97,'catalogue_contact_same','Ja, yes'),(10167,97,'catalogue_contact_firstname',''),(10168,97,'catalogue_contact_lastname',''),(10169,97,'catalogue_contact_email',''),(10170,97,'catalogue_contact_cell',''),(10171,97,'catalogue_contact_position','Employer Branding'),(10172,97,'catalogue_ad_description','Xylem annons'),(10173,97,'catalogue_link_website','http://www.xyleminc.com'),(10174,97,'catalogue_link_website_student','http://www.xyleminc.com/en-us/careers'),(10175,97,'catalogue_last_day_xjob',''),(10176,97,'catalogue_link_internship',''),(10177,97,'catalogue_last_day_internship',''),(10178,97,'catalogue_link_summerjob',''),(10179,97,'catalogue_last_day_summerjob',''),(10180,97,'catalogue_link_trainee',''),(10181,97,'catalogue_last_day_trainee',''),(10182,97,'catalogue_link_positions','https://sjobs.brassring.com/TGWebHost/home.aspx?partnerid=25400&siteid=5487'),(10183,97,'catalogue_link_facebook','http://www.facebook.com/xylem.jobb'),(10184,97,'catalogue_link_twitter','http://twitter.com/xyleminc'),(10185,97,'catalogue_link_youtube','http://www.youtube.com/user/XylemIncorporated'),(10186,98,'company_username','NCC CONSTRUCTION'),(10187,98,'billing_reference','ncc consttruction sverige ab (sverker örmin)'),(10188,98,'billing_phone','090-168117 070-5626047'),(10189,98,'billing_address','fe 610'),(10190,98,'billing_zipcode','83385'),(10191,98,'billing_city','strömsund'),(10192,98,'billing_country','sverige'),(10193,98,'billing_extra_information','mark fakturan med LARV KONTO 14001057'),(10194,98,'contact_firstname','sverker'),(10195,98,'contact_lastname','örmin'),(10196,98,'contact_email','sverker.ormin@ncc.se'),(10197,98,'contact_alt_email',''),(10198,98,'contact_cell','070-5626047'),(10199,98,'contact_phone','090-168117'),(10200,98,'org_name','ncc'),(10201,98,'org_number','556613-4929'),(10202,98,'