,'booth_extra_help_build_no','X'),(10247,98,'booth_extra_highchairs',''),(10248,98,'booth_extra_hightables','3'),(10249,98,'booth_extra_carpet',''),(10250,98,'booth_extra_plant',''),(10251,98,'booth_extra_monitor','1'),(10252,98,'booth_extra_monitor_stand','1'),(10253,98,'booth_threephase','Nej, no'),(10254,98,'booth_threephase_description',''),(10255,98,'booth_width','4'),(10256,98,'booth_depth','3'),(10257,98,'booth_height','2,25'),(10258,98,'booth_extra_area',''),(10259,98,'booth_total_cost','20700'),(10260,98,'catalogue_company_name','NCC'),(10261,98,'catalogue_cities','Hela landet'),(10262,98,'catalogue_employees_sweden','10000'),(10263,98,'catalogue_countries','norden ,baltiska steterna,ryssland'),(10264,98,'catalogue_employees_global','18000'),(10265,98,'catalogue_company_description','NCC är ett av Nordens ledande bygg- och fastighetsutvecklingsföretag. Omsättningen år 2010 var 49 Mdr SEK.\r\nNCC är verksamt inom hela värdekedjan när det gäller att skapa miljöer för arbete, boende och kommunikation. \r\n\r\nNCC utvecklar och bygger bostäder, kommersiella fastigheter, industrilokaler och offentliga byggnader, vägar och anläggningar samt övrig infrastruktur. NCC erbjuder även insatsvaror för byggproduktion, såsom kross och asfalt, samt svarar för beläggning, drift och underhåll av vägar.\r\n\r\nNCC:s vision är att vara det ledande företaget i utvecklingen av framtidens miljöer för arbete, boende och kommunikation.\r\n'),(10266,98,'catalogue_students_dont_know','NCC bygger serverhallar åt facebook i Luleå\r\nhttp://www.flickr.com/photos/ncc_ab'),(10267,98,'catalogue_why_visit','Hos oss får ni möjligheter att träffa såväl före detta studenter(som nu jobbar inom NCC)och erfarna chefer som kan ge er en rättvisande bild av företaget.'),(10268,98,'catalogue_question_freetext',''),(10269,98,'catalogue_answer','På NCC har du stora möjligheter till utveckling. Vi har ett brett utbud av internutbildningar och karriärvägarna är många. Utveckling av våra medarbetare är en förutsättning för att NCC ska nå sina mål och göra framsteg som bolag. \r\nVi uppmuntrar våra anställda att själva ta ansvar för sin egen utveckling.\r\nDin utveckling inom NCC har dessutom god hjälp av att arbetsformerna ser ut som de gör. Du kan arbeta väldigt självständigt, eller som en del av en grupp.\r\n'),(10270,98,'catalogue_question','Dessa utvecklingsmöjligheter genom kompetensutveckling/internutbildningar/mentorskap mm erbjuds för våra nyanställda:,  These development opportunities through training / in-house training / mentoring, etc. are offered our new employees:'),(10271,98,'catalogue_contact_same','Ja, yes'),(10272,98,'catalogue_contact_firstname','Sverker'),(10273,98,'catalogue_contact_lastname','Örmin'),(10274,98,'catalogue_contact_email','Sverker.ormin@ncc.se'),(10275,98,'catalogue_contact_cell','070-5626047'),(10276,98,'catalogue_contact_position','personalchef'),(10277,98,'catalogue_ad_description','NCC är ett av Nordens ledande bygg- och fastighetsutvecklingsföretag med geografiskt fokus på den nordiska marknaden. Verksamhet bedrivs även i Baltikum och Tyskland. \r\n\r\nTillsammans med kunden finner NCC behovsanpassade, kostnadseffektiva och kvalitativa lösningar som skapar mervärde för NCC:s intressenter och som bidrar till en hållbar samhällsutveckling. NCC:s värderingar är ärlighet, respekt och tillit. \r\n\r\n\r\nDärför skall du arbeta hos oss:\r\nVi blir aldrig bättre än våra medarbetare. Därför är ett av våra mål att vara branschledande när det gäller att rekrytera, behålla och utveckla befintlig personal. Tycker du att det är roligt att prova på nya saker så har du hittat rätt. Hos oss har du goda möjligheter att röra på dig och prova på nya, spännande uppgifter. Kanske vill du jobba utomlands en tid, eller växla mellan olika typer av projekt och verksamhetsområden? \r\n\r\n'),(10278,98,'catalogue_link_website','http://www.ncc.se'),(10279,98,'catalogue_link_website_student','http://ww.ncc.se/student'),(10280,98,'catalogue_last_day_xjob'