alogue_employees_sweden','3500'),(10368,99,'catalogue_countries','I ett tjugotal länder'),(10369,99,'catalogue_employees_global','4500'),(10370,99,'catalogue_company_description','ÅF är ett ledande teknikkonsultföretag.\r\nVi fokuserar på energi och miljö, infrastruktur och industri.\r\nVår bas finns i Europa, men vår verksamhet och kunder finns i hela världen.\r\nDet som gör oss unika är våra medarbetare och branschens största erfarenhetsbank.\r\nVi brukar sammanfatta det med:\r\nÅF - Innovation by experience.'),(10371,99,'catalogue_students_dont_know','Vi anställde den första miljökonsulten 1901.\r\n'),(10372,99,'catalogue_why_visit','Kom till vår monter för att inspirera och inspireras! Träffa våra sköna medarbetare som berättar om ÅF:s karriärvägar, hur det är att arbeta som teknisk konsult, vad man ska tänka på inför ex-jobbet och om hållbarhet (inklusive lönsamhet!). Vi vill träffa dig så kom, kom, kom.'),(10373,99,'catalogue_question_freetext',''),(10374,99,'catalogue_answer','Vi söker dig för att du är DU. Vi tror på varje individs inneboende potential och vi vill utvecklas tillsammans med dig. Om du har rätt kunskaper, en positiv inställning och ett stort driv så finns det stora möjligheter till samarbete mellan dig och oss!'),(10375,99,'catalogue_question','Dessa egenskaper söker vi främst hos dig som medarbetare hos oss:, We are looking for someone with, mainly, the following qualities:'),(10376,99,'catalogue_contact_same','Ja, yes'),(10377,99,'catalogue_contact_firstname',''),(10378,99,'catalogue_contact_lastname',''),(10379,99,'catalogue_contact_email',''),(10380,99,'catalogue_contact_cell',''),(10381,99,'catalogue_contact_position','Employer Brand Manager'),(10382,99,'catalogue_ad_description',''),(10383,99,'catalogue_link_website','http://www.afconsult.com'),(10384,99,'catalogue_link_website_student','http://www.afconsult.com/student'),(10385,99,'catalogue_last_day_xjob',''),(10386,99,'catalogue_link_internship',''),(10387,99,'catalogue_last_day_inter