INSERT INTO `crew` VALUES (11,243,'funktionar','zasd',1321309565,''),(10,58,'foretagsvard','Jag studerar mitt 3 år på Väg och Vatten och funderar på att göra praktik till sommaren. Jag tycker det varit jättekul och lärorikt de föregående två åren då jag vart företagsvärd. Detta år hoppas jag på att få vara mässvärd till ett ännu mer intressant företag och kanske kunna knyta lite bra kontakter gällande praktik och så. ',1321309565,''),(12,254,'foretagsvard','Jag stod som företagsvärd för Sandvik i fjol och vill gärna ta tillfället i akt att knyta flera kontakter för framtida jobb och exjobb. Jag skulle gärna vara företagsvärd åt svensk kärnkraft om de kommer upp i år igen',1321309565,''),(13,260,'foretagsvard','Eftersom jag tidigare varit engagerad i LARV vet jag hur givande och roligt det är. Var medhjälpare till företagsvärdsansvarig 09 och Företagsvärd 10. ',1321309565,''),(14,261,'foretagsvard','Jag har varir företagsvärd de två senaste åren och skulle vilja vara det igen. Detta året skulle jag vilja hamna hos ett företag som har praktikplatser. Skulle vilja få lite arbetslivserfarenhet innan jag går ut universitetet.',1321309565,''),(15,275,'foretagsvard','Jag var företagsvärd förra året.\r\nJag skulle vilja ha bättre kontakt med företag och försöka komma på vad jag vill jobba med och vart.\r\nTycker det är intressant att umgås med ett företag under ett event som detta då man hinner diskutera och få svar på väldigt mycket.\r\nTycker det ät ett roligt och väldigt givande event och skulle gärna vara med ett år till!',1321309565,''),(16,283,'foretagsvard','Genom att vara företagsvärd förra året fick jag insikten om hur fantastiskt bra LARV är och hur kul det var att vara företagsvärd. Därför är det en självklarhet att jag söker igen :) \r\n\r\nVem är jag då och varför är jag kanske världens bästa företagsvärd? \r\nJag pluggar 3e året på I-programmet och är en engagerad figur. Just nu är det StiL Alpina som tar upp mycket av tiden men även föreningsverksamhet. Det som gör mig till en bra företagsvärd är att jag får saker gjort och jag är inte lagt åt det blyga hållet. Mina åtaganden ser jag mycket seriöst på, oavsett vad där är, och jag ser alltid till att göra det fullt ut. Jag ser LARV som en enormt viktig del för att knyta samman det akademiska och arbetslivet och jag är övertygad om att jag kan bidra till att göra LARV bättre. \r\n\r\nSen är jag trevlig också :)  \r\n\r\nMVH Daniel Entoft ',1321309565,''),(17,298,'foretagsvard','Var företagsvärd för första gången förra året och tyckte att det var otroligt kul att få komma ett företag lite närmare genom kontakt före, innan och efter mässan. Var även kul att närvara på mässan under hela dagen och prata med representanter från alla olika företag. Middagen på kvällen var även den trevlig, kul att få sitta ner och prata med ännu fler representanter från olika företag. Jag ser fram emot LARV 2012 och hoppas på att få skapa lite nya kontakter inför framtiden och det kommande arbetslivet. ',1321309565,''),(18,303,'foretagsvard','Skulle gärna vilja vara företagsvärd åt Tyréns.',1321309565,''),(19,313,'foretagsvard','Jag börjar närma mig slutet av min utbildning och vill knyta kontakter med arbetslivet. På LARV som företagsvärd har man en unik möjlighet att få träffa företagen och se till att de får en trevlig mässa.\r\n\r\n2011 var jag företagsvärd åt Hifab AB',1321309565,''),(20,318,'foretagsvard','Jag vill vara företagsvärd för att jag tycker att det är ett bra sätt till att skapa nya kontakter med företag. Jag var företagsvärd förra året och fick då en väldigt positiv upplevelse samt bra kontakter. Jag känner därför att det vore lärorikt och intressant att vara värd i år igen då examen kommer närmare och det är ett bra sätt att visa upp sig. ',1321309565,''),(21,320,'foretagsvard','Hej\r\n\r\nVar företagsvärd förra året åt Tieto Enator och tyckte det var intressant och givande eftersom man fick prata med folk som arbetade på företaget och därmed fick en bra bild om hur deras arbetsplats såg ut.\r\n\r\nDärför skulle jag gärna vilja vara det i år igen och då för ett annat företag för att vidga vyerna. \r\n\r\nJag skulle vara en bra ambassadör för att jag har engagerat mig i i-sektionen eller närmare bestämt arbetsmarknadsutskottet och har där fått en känsla för företagskontakter och att jag var företagsvärd förra året.\r\n\r\nJag går just nu år 3 på Industriell ekonomi programmet.\r\n\r\n//Mattias',1321309565,''),(22,321,'foretagsvard','Jag tyckte att det var väldigt roligt att arbeta som företagsvärd förra året och skulle gärna vilja göra det igen.',1321309565,''),(23,324,'foretagsvard','Jag var företagsvärd förra året. Detta var en väldigt trevlig upplevelse där jag lärde mig mycket. Jag tycker detta är en ypperlig chans att bygga en relation till ett företag samt lära sig mer om hur arbetsmarknaden ser ut idag. ',1321309565,''),(24,430,'foretagsvard','LARV är en en utmärkt möjlighet att knyta värdefulla kontakter med näringslivet kombinerat med att göra någon meningsfullt. Efter att ha varit företagsvärd i fjol fick jag mersmak av arbetet. Jag har lätt att ta kontakt och kommunicera med människor vilket gör att jag passar bra i rollen som företagsvärd.\r\n\r\nJag vet att önskning av företag inte skulle uttryckas i denna motivering. Dock vill jag gärna vill knyta närmare kontakt med Vattenfall, därför önskar jag en extra gång :)',1321309565,''),(25,432,'foretagsvard','Har tidigare varit företagsvärd för Svensk Byggtjänst och NCC. \r\nJag tycker det är ett bra sätt att komma i kontakt med företag och visa att man är engagerad. \r\n\r\nJag har just nu praktik på Sweco i Stockholm och skulle därför gärna vara företagsvärd för detta företag för att bibehålla kontakten och även träffa kollegor från andra kontor i Sverige.',1321309565,''),(26,433,'foretagsvard','Jag valde av personliga själ att inte göra praktik för min utbildning. Därför har jag än så länge inte fått in en fot i något framtida företag. Jag är på mitt sista läsår och arbetslivet närmar sig allt mer. I år vill jag ta till vara på chansen att vara företagsvärd på LARV. Jag ser LARV som en väldigt bra chans att få kontakt med företag som jag kan tänkas jobba med i framtiden. Jag har tidigare varit funktionär under alla år sedan 2008 via Stils innebandylag men hoppas jag kan få vara företagsvärd i år. Det skulle vara väldigt kul och givande.',1321309565,''),(27,434,'foretagsvard','Jag var företagsvärd förra året och tyckte det var väldigt kul och givande. Det är ett bra tillfälle att få kontakt med företag. Jag vill gärna engagera mig i år igen och företagsvärd är den roll som jag tror passar mig bäst.',1321309565,''),(28,435,'foretagsvard','jag tycker att det var väldigt roligt att jobba som företagsvärd på LARV förra året och ser fram emot att göra det igen! LARV skapar stora möjligheter att knyta kontakter med olika företag för framtida möjligheter till sommarjobb, exjobb och till sist jobb :)',1321309565,''),(29,437,'foretagsvard','Jag var företagsvärd för larv 2011 och tycker jag fick en bra kontakt med det företaget jag var värd för. Därför skulle jag gärna vilja vara värd igen.',1321309565,''),(30,438,'foretagsvard','Möta ett företag och skapa kontakt med det. Var företagsvärd förra året.',1321309565,''),(31,441,'foretagsvard','Jag har nu gått snart halva min utbildning (2,5 år) och har under studietiden engagerat mig en hel del på sidan av studierna. Jag sjunger i Snapsakademien, där jag även suttit i styrelsen som kassör i två år. Jag har varit sångansvarig för Lulespexet 2010, och var phösare nolle-p 2010. Jag har suttit som programrådsrepresentant för Hållbar Energiteknik sen jag började i ettan. Är den som drar i kommande företagskvällar för programmet, och kommer att engagera mig i den förening som inom kort tid kommer att skapas för HET-klasserna. \r\n\r\nJag ser mig själv som en utåtriktad och samarbetsvillig person, som gillar att få saker gjort! Tycker också om när folk visar ideellt engagemang, och vill gärna inspirera folk att göra det. ',1321309565,''),(32,442,'foretagsvard','test',1321309565,''),(33,445,'foretagsvard','Jag anser mig vara ett bra val till företagsvärd. Just nu har jag påbörjat mitt fjärde år på Civilingenjörsprogrammet med inriktning maskinteknik. \r\nJag har tidigare varit engagerad i teknologkårens phaestmästeri och driver även en mindre hårdrocksförening vid namn Riff. Genom mina engagemang har jag lärt mig en hel del om att ta ansvar, leda mindre projekt samt att ta kontakt med nya människor och företag.\r\nJag ser mig själv som en drivande och ansvarsfull person med en positiv inställning till det mesta och en stark viljestyrka.',1321309565,''),(34,446,'foretagsvard','Jag skulle väldigt gärna vilja vara företagsvärd under LARVmässan 2012.\r\n\r\nJag är en noggrann, ansvarsfull och social person som ser fram emot LARV som en möjlighet att knyta kontakter och att få ta del av arbetet med Sveriges bästa arbetsmarknadsmässa!\r\n',1321309565,''),(35,447,'foretagsvard','Min kusin Emilia Utsi har studerat till civilekonom vid LTU och hon har tidigare jobbat som mässvärd på LARV. Hon har delgivit mig sina erfarenheter av vad det innebär att vara mässvärd och  att representera mässan utåt gentemot företaget, samt vikten av att tillhandahålla företaget god service både före och under mässdagen. Jag är övertygad om att jag är rätt person för denna roll då jag är framåt och tycker om att träffa nya människor. \r\n\r\nKan snabbt också nämna att jag tidigare b.la. jobbat på Vattenfalls besöksanläggning i Porjus med att ta emot besökare samt också genomgått ett ledarskapsprogram genom svenska sametinget för att bli ambassadör för rennäringen.\r\n\r\nSom en mässvärd skulle jag vara serviceinriktad och profesionell i min kontakt med företaget och se till att de får en riktigt positiv upplevelse av LARV :)\r\n\r\nVänligen\r\n\r\nIsak Utsi\r\n',1321309565,''),(36,448,'foretagsvard','Jag var företagsvärd förra året 2010. Det fungerade bra och var kul och trevligt så jag skulle vilja vara det även detta år! \r\n\r\nJag går tredje året på Civilingenjör Arkitektur. I år skulle jag gärna ta chansen att vara företagsvärd hos någon av företagen jag har tänkt söka praktik hos, då främst JM men också de andra byggföretagen som PEAB, Skanska och NCC.\r\n\r\n\r\nVänliga Hälsningar\r\nMagda',1321309565,''),(37,449,'inredning','Sofie tester! \r\n\r\nVart hamnar denna? ',1321309565,''),(38,450,'foretagsvard','\r\nHar som målsättning att kombinera mina intressen med min utbildning. Anledningen till att jag går teknisk design är att jag annars blir kroniskt kreativ i marginalerna på mina räknehäften - jag måste helt enkelt få utlopp för min kreativitet.\r\n\r\nÄr i övrigt hjälpsam av naturen, var phösare åt öppen ingång under senaste nolleperioden (gick själv öppen ingång, älskar det gänget) och arbetar nu inom kunskapsmentorerna för att hjälpa ettorna att komma in i studierna. \r\n\r\nEtt stort intresse är friluftslivet. Är av den anledningen med i friluftssektionen som marknadsföringsansvarig samt arrangerar resor varje termin. Min uppgift inom organisationen övrig tid är att ansvara för katalogen samt affischer, främst layout. \r\n\r\nMitt drömkarriärscenario innefattar ett arbete där jag utnyttjar min utbildning för att ta fram produkter inom friluftslivet, där jag givetvis spenderar en hel del tid personligen med att testa prototyperna praktiskt. Av den anledningen vore det jättekul om företag inom branchen finns med på årets LARV-mässa. Det vore helt fantastiskt att få knyta kontakter och bolla idéer med någon som är insatt i området.\r\n \r\nSlutligen jobbade jag också på SSAB här i Luleå i somras. Det gav både erfarenhet och inspiration till fortsatta studier - känner att jag trivs mycket bra här uppe och att jag har möjlighet att genomföra det jag vill åstadkomma med hjälp av universitetet. \r\n',1321309565,''),(39,452,'foretagsvard','Hej! \r\n\r\nJag har försökt anmäla mig sedan i morse, men det har krånglat och efter att ha pratat med Sofie så har jag nu fått bekräftelse att det funkar.\r\n\r\nJag var företagsvärd förra året och tyckte det var riktigt kul. Jag vann även en tävling året innan då jag skrev hur LARV kunde förbättras inför de kommande åren. För övrigt är jag med i damföreningen DeLuxe som jag själv varit med och grundat och kommer vara med i projektgruppen som bestämmer hur inredningen på LARV 2012 kommer se ut.\r\n\r\nJag är inne på mitt 3e år Teknisk Design och jobbar som studentambassadör på fritiden. Jag är även gruppledare på StiL och marknadsföringschef på STUK bar & restaurang. Tillsammans med fyra stycken har jag även startat en eventrörelse vid namn Animaux (www.clubanimaux.com). \r\n\r\nJag är en driven person och tycker om att arbeta med människor. Jag älskar skapandet i alla dess former, alltifrån produkter till kontakter. Jag ser LARV som ett tillfälle att ta i akt för att just skapa nya nätverk. \r\n\r\nJag hoppas att jag får önska det företaget jag vill nu i år!\r\nTack,  mvh\r\nTina Koohnavard',1321309565,''),(40,456,'foretagsvard','Jag tycker det skulle vara jättekul att vara företagsvärd. Jag har hört mycket bra från förra årets LARV och vill därför inte missa det i år. Dessutom tror jag att det är ett toppen tillfälle att få lite kontakter inför praktiken.',1321309565,''),(41,457,'foretagsvard','Hej.\r\nJag läser mitt tredje och sista år vid brandingenjörsprogrammet. Detta innebär att jag ska skriva mitt examensarbete till sommaren alternativt till hösten 2012. Av denna anledning är jag väldigt intresserad att representera ett företag som har anknytning till min utbildning och därmed skapa nya kontakter.\r\n\r\nSom person är jag driven, engagerad, social och framåtriktad. Jag tycker om att anta nya utmaningar och se till att slutföra dessa. Utöver skolan är jag engagerad i StiL Alpina och lägger därav mycket av mitt engagemang dit. \r\n\r\nUnder min studietid har jag även jobbat extra åt Firetech Engineering i Luleå med att hålla brandskyddsutbildningar på olika sjukhus, vårdcentraler i BD län. Samt att jag innan och under min studietid har arbetat bland annat som guide på Inlandsbanans turisttåg mellan Kristinehamn och Gällivare. Vilket innebär att du måste vara en serviceinriktad person som kan tala inför folk, ofta på flera olika språk.\r\n\r\nSer fram emot LARV 2012, och vill gärna vara företagsvärd!\r\n\r\nMed vänlig hälsning Louise Söderberg.\r\n',1321309565,''),(42,458,'foretagsvard','Jag går nu mitt tredje år på Civilingenjör Arkitektur (och Väg och vatten) och vill gärna skapa lite kontakter inför praktiken som vi ska ut på till sommaren. Jag tycker att det är roligt att hjälpa till och det skulle vara en bra och rolig erfarenhet att få vara företagsvärd. ',1321309565,''),(43,459,'foretagsvard','Jag skulle gärna vilja möta ett företag som har något att göra med det jag studerar för att utveckla mitt kontaktnät och komma närmare arbetsmarknaden.',1321309565,''),(44,460,'foretagsvard','Var företagsvärd förra året för SAAB Automobile. Är utåtriktad och tycker om att träffa nya människor. Tyckte därför att LARV var riktigt kul förra året. Då man kunde knyta mycket nya kontakter. Är driven och strukturerad, har därför startat en egen motionshockeyförening för studenter. Är service minded vilket är viktigt då företagen ska känna att de står i centrum.\r\n\r\nJag fick god kontakt med mitt företag förra året och de trivdes bra med mig. Vill väldigt gärna göra ett ännu bättre jobb i år!',1321309565,''),(45,463,'foretagsvard','Jag studerar tredje året på Civilingenjör Arkitektur, och har för tillfället förlagt en termin i USA vid Clarkson University. Under min studietid har jag bland annat suttit med i Kårfullmäktige, varit phösare och varit (och är) programråd. Under LARV 2011 var jag företagsvärd för min hemkommun Kramfors. \r\nVad som gör mig till en bra företagsvärd är att jag är utåtriktad och brinner för att nätverka, ta ansvar och jobba hårt. Har jag tagit på mig mig att göra en viss uppgift så ser jag till att det blir gjort till fullo. ',1321309565,''),(46,464,'foretagsvard','Att stå face-to-face med företagen man har i hopp på att arbeta med i framtiden är en värdefull chans som jag ej vill missa!\r\n\r\nSpeciellt detta år, 30 års jubileet. Det låter bra och spännande med tanke på bredare utbud, ty jag går en speciellt/nystartad utbildning. \r\n\r\nJag söker till LARV, från utlandet på utbytestermin i Singapore, kommer vara tillbaka efter nyår. Jag kan hur som helst ta ansvar för ett företag jag har blivit tillgiven. \r\n\r\nJag tycker det slutligen är viktigt att främja den här typen av organisationer. Därför vill jag vara med och gör mitt tillskott detta läsår(11/12).\r\n/Johan',1321309565,''),(47,468,'eventvard','Jag har inte arbetat med LARV tidigare, men insåg vid förra årets mässa att det är något jag vill vara en del av. Jag är övertygad om att jag skulle göra ett bra jobb, då jag jobbar effektivt och är utåtriktad och strukturerat lagd. Uppgifter som innefattar att organisera och planera passar mig allra bäst, men jag tar mig an allt från roddning till sociala uppgifter med stor entusiasm.',1321309565,''),(48,470,'foretagsvard','Hej!\r\nMitt namn är Olle Jacobson och jag studerar civilingenjör årskurs 2 med inriktning mot industriell ekonomi. Jag skulle vilja vara företagsvärd för att jag är duktigt på att prata och hantera olika situationer med folk och är väldigt hjälpsam. Det skulle vara roligt att vara företagsvärd åt Bosch Rexroth för att jag har sommarjobbat åt dem som leveransbevakare på ett av deras dotterbolag Hägglunds Drives i Örnsköldsvik. Det skulle vara roligt att knyta lite extra kontakt med dem här på LTU för att kunna visa hur framstående detta universitet är.\r\n\r\nMVH\r\nOlle Jacobson',1321309565,''),(49,471,'foretagsvard','Hej! jag heter Fredrik Eriksson.\r\nÄr inne på mitt andra år av studier i Luleå, där jag studerar till civilingenjör i väg- och vattenbyggnad. \r\nJag är glad och trevlig och tror jag skulle fungera bra som företagsvärd för jag har lätt att hantera nya människor samt nya situationer. Det jag tror jag kommer att få ut av att jobba på LARV är erfarenhet av att arbeta på mässor sedan förhoppningsvis  värdefulla kontakter med företag.\r\n\r\nDå jag studerar väg- och vattenbyggnad har jag tänkte att i framtiden jobba inom byggbranschen, så jag hade gärna varit värd för ett företag som är verksam i denna bransch t.ex. NCC, PEAB och SKANSKA.   ',1321309565,''),(50,472,'funktionar','Vill gärna hjälpa till med något och funktionär är ett bra sätt att starta på. Hjälpte till under 40 års firandet så lite erfarenhet har ja ju.',1321309565,''),(51,473,'foretagsvard','Jag besökte LARV 2011 som jag tyckte var väldigt intressant och har väntat sen dess på att få kunna hjälpa till och vara en del av LARV 2012! Jag tycker att det är väldigt bra att kunna få kontakt med de olika företagen ni tar hit och känner att det skulle ge jättemycket. Dessutom skulle det vara en kul grej att få testa på.\r\n\r\nJag är 20 år, läser andra året teknisk design och är en väldigt öppen och trevlig person. Jag är aktiv i 6m, maskinsektionens sexmästeri, och är van vid att ha många bollar i luften och  att vara ett ansikte utåt!',1321309565,''),(52,474,'foretagsvard','Jag skulle vilja vara företagsvärd då jag anser att det skulle passa mig som handen i hansken.\r\nJag läser internationell ekonomi och det är mitt 1a år. På sidan av studierna är jag med i ekonomsektionen där vi har nära samarbeten med företag från Luleå- och Norrbottens näringsliv. Jag trivs bra med rollen som kontaktperson då jag tycker det är roligt att organisera, planera samt att jag gillar mötet med intressanta personer som innehar intressanta roller på företag. Jag tycker det är roligt att få chansen att representera LTU.',1321309565,''),(53,1,'chauffor','123',1323117304,''),(54,1,'chauffor','123',1323117309,''),(55,1,'chauffor','123',1323117464,''),(56,1,'chauffor','123',1323117515,''),(57,1,'chauffor','123',1323117607,''),(58,1,'ftv','asdw',1324772065,'');
