INSERT INTO `dynamic` VALUES (1,'welcome','welcome dynamic',1,1319108888),(2,'welcome','<p>\n	welcome dynamicafwa</p>\n',1,1319111336),(3,'welcome','<p>\n	welcome dynamicawfaw</p>\n',1,1319111337),(4,'welcome','<p>\n	welcome dynamicawfaw</p>\n',1,1319111374),(5,'welcome','\r\n\n	welcome dynamicawfaw\r\n\r\n\n',1,1319111374),(6,'welcome','<p>\n	welcome dynamicawfaw</p>\n',1,1319111422),(7,'welcome','<p>\n	welcome dynamicawfawawfawfd</p>\n',1,1319111426),(8,'welcome','<p>\n	welcome dynamicawfawawfawfd</p>',1,1319111470),(9,'welcome','<p>\n	welcome dynamicawfawawfawfd</p>',1,1319111479),(10,'welcome','<p>\n	welcome dynamicawfawawfawfd</p>',1,1319111506),(11,'welcome','<p>\n	welcome dynamicawfawawfawfd</p>',1,1319111515),(13,'student','<p>\n	information f&ouml;r studenter</p>',1,1319145637),(14,'foretag','<p>\n	information f&ouml;r f&ouml;retag</p>',1,1319145647),(15,'kontakt','<p>\n	kontaktinformation</p>',1,1319145656),(16,'kontakt','<p>\n	kontaktinformation</p>',1,1319145682),(45,'user','<h1>\n	Mina Sidor</h1>\n<p>\n	Det h&auml;r &auml;r Din sida. H&auml;r kommer information om just dig och ditt engagemang inom LARV att finnas tillg&auml;nglig.</p>',1,1321300933),(18,'kontakt','<p>\n	&nbsp;</p>\n<div class=\"tools\">\n	<h3 style=\"margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; font-size: 14px; font-weight: bold; color: rgb(152, 27, 30); \">\n		Projektledare</h3>\n</div>\n<div class=\"top2\">\n	<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Projektledaren &auml;r &auml;ven Arbetsmarknadsenhetens ordf&ouml;rande p&aring; Teknologk&aring;ren. Att vara projektledare f&ouml;r LARV ing&aring;r i dennes uppgifter. Denna post tills&auml;tts av K&aring;rfullm&auml;ktige och &auml;r en helarvoderad post, vilket inneb&auml;r att denne f&ouml;rtroendevalda person tar ett &aring;rs uppeh&aring