\n	Mina Sidor</h1>\n<p>\n	Det h&auml;r &auml;r Dina sidor. H&auml;r kommer information om just dig och ditt engagemang inom LARV att finnas tillg&auml;nglig.</p>',1,1321301855),(47,'omlarv','<p>\n	&nbsp;</p>\n<div class=\"tools\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<h1 style=\"font-size: 18px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; width: 520px; color: rgb(152, 27, 30); \">\n		Om LARV</h1>\n</div>\n<div class=\"top2\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Syftet med LARV &auml;r att fungera som en plattform f&ouml;r kontakt mellan student och f&ouml;retag.&nbsp;<br />\n		Lule&aring; ARbetsmarknadsVecka, LARV, arrangeras av Teknologk&aring;ren vid Lule&aring; Tekniska Universitet f&ouml;r medlemmar, i f&ouml;rsta hand.&nbsp;<br />\n		Under en veckas tid arrangeras evenemang f&ouml;r att det fysiska m&ouml;tet p&aring; m&auml;ss-dagen ska bli s&aring; v&auml;rdefullt det g&aring;r, f&ouml;r b&aring;da parter!</p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		LARV blir m&ouml;jligt tack vare&nbsp;<strong>Teknologk&aring;rens medlemmar</strong>; den&nbsp;<strong>projektgrupp</strong>&nbsp;som varje &aring;r g&ouml;r sitt allt f&ouml;r att f&ouml;rvekliga projektet och givetvis v&aring;ra&nbsp;<strong>g&auml;stande f&ouml;retag</strong>&nbsp;och&nbsp;<strong>samarbetspartners!</strong></p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		<em>Intresserad av samarbete? L&auml;s mer om samarbeten under &quot;aktiviteter&quot;</em></p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		<em>S&ouml;ker du LARV-projektgrupp, l&auml;s mer under &quot;kontakt&quot;</em></p>\n</div>\n<div style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); clear: both; \">\n	&nbsp;</div>\n<br />\n<div class=\"tools\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<h1 style=\"font-size: 18px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; width: 520px; color: rgb(152, 27, 30); \">\n		Onsdagen den 25e januari &auml;r det dags! LARV firar 30!</h1>\n</div>\n<div class=\"top2\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Onsdagen den&nbsp;<strong>25e januari</strong>&nbsp;h&aring;lls en m&auml;ssa med f&ouml;retag fr&aring;n hela landet.</p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		F&ouml;r att l&auml;ra mer om hur LARV fungerar och vad som sker och erbjuds dig varesig du &auml;r student eller f&ouml;retag, l&auml;s mer under flikarna i menyn!</p>\n</div>\n<div style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); clear: both; \">\n	&nbsp;</div>\n<div class=\"tools\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<h2 style=\"font-size: 16px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; width: 520px; margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; color: rgb(152, 27, 30); \">\n		Nytt f&ouml;r i &aring;r!</h2>\n</div>\n<div class=\"top2\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		LARV 2012 anordnas f&ouml;r 30 &aring;ret i rad och f&ouml;r att fira detta l&auml;ggs det extra krut f&ouml;r att g&ouml;ra just LARV 2012 till det b&auml;sta hittills!</p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		LARV siktar &aring;ter p&aring; att generera v&auml;rdefulla evenemang under en veckas tid f&ouml;r att du som student eller arbetsgivare ska f&aring; ett lyckat m&ouml;te under m&auml;ssdagen. Med f&ouml;rel&auml;sningar, presentationer, nya tj&auml;nster s&aring; som montermontering eller annonsering i den interaktiva webbkatalog som skapas finns m&aring;nga m&ouml;jligheter till synlighet inf&ouml;r LARV. Samarbete med det campusbel&auml;gna gymmet Stil inneb&auml;r m&ouml;jlighet till &ouml;kad exponering och m&ouml;te med studenter &auml;ven innan LARV. L&auml;s mer nedan.</p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		LARV 2012 &auml;r m&auml;ssan Ni inte f&aring;r missa i &aring;r!</p>\n</div>\n<div style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); clear: both; \">\n	&nbsp;</div>\n<div class=\"tools\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<h3 style=\"margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; font-size: 14px; color: rgb(152, 27, 30); \">\n		Samarbeten med Stil Alpina</h3>\n</div>\n<div class=\"top2\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		<strong>Annonsering i Stil Alpinas resekatalog &auml;r inte l&auml;ngre m&ouml;jlig.&nbsp;</strong>&Auml;r ni intresserade av detta erbjudande f&ouml;r kommande &aring;r v&auml;nligen skriv ett mail med &auml;mnet ALPINA till ao@teknologkaren.se</p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		&Auml;n finns det d&auml;remot &auml;nnu m&ouml;jlighet att delta i monterevenemang innan LARV f&ouml;r att ytterligare locka till just er monter d&aring; m&auml;ssdagen anl&auml;nder. Kanske ni &auml;ven intresserar er f&ouml;r att synas i samband med n&aring;gon av de m&aring;nga&nbsp;<br />\n		alpina resorna som anordnas. F&ouml;r mer information om detta erbjudande; v&auml;nligen kontakta projektledare f&ouml;r LARV per telefon; 0706862585</p>\n</div>\n<div style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); clear: both; \">\n	&nbsp;</div>\n<div class=\"tools\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<h1 style=\"font-size: 18px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 5px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; width: 520px; color: rgb(152, 27, 30); \">\n		Varf&ouml;r bes&ouml;ka LARV?</h1>\n</div>\n<div class=\"top2\" style=\"color: rgb(0, 0, 0); font-family: Helvetica, Arial, Verdana, \'Trebuchet MS\', san-serif; text-align: left; background-color: rgb(242, 242, 242); \">\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		M&aring;nga LTU-studenter har flyttat l&aring;ngv&auml;ga f&ouml;r sina studier och drar sig heller inte f&ouml;r att g&ouml;ra det igen. De kan antas ha kommit en bra bit i mognadsprocessen mycket tack vare detta. Som student vid LTU &auml;r man &auml;ven van att arbeta i projekt och finnes ofta sj&auml;lvst&auml;ndiga och jordn&auml;ra.&nbsp;<br />\n		M&aring;nga studenter engagerar sig &auml;ven i k&aring;rer, sektioner och egna projekt och det finns &auml;ven en god andel som under studietiden startar eget...</p>\n	<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		V&auml;lkommen till LARV!</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321305162),(48,'omlarv','<h1>Om Larv</h1>\n\nSyftet med LARV är att fungera som en plattform för kontakt mellan student och företag. \nLuleå ARbetsmarknadsVecka, LARV, arrangeras av Teknologkåren vid Luleå Tekniska Universitet för medlemmar, i första hand. \nUnder en veckas tid arrangeras evenemang för att det fysiska mötet på mäss-dagen ska bli så värdefullt det går, för båda parter! \n\nLARV blir möjligt tack vare <strong>Teknologkårens medlemmar</strong>; den <strong>projektgrupp</strong> som varje år gör sitt allt för att förvekliga projektet och givetvis våra <strong>gästande företag</strong> och <strong>samarbetspartners!</strong>\n\n\n<em>Intresserad av samarbete? Läs mer om samarbeten under \"aktiviteter\" </strong></em>\n\n<em>Söker du LARV-projektgrupp, läs mer under \"kontakt\"</em>',1,1321305264),(49,'omlarv','<h1>\n	Om Larv</h1>\n<p>\n	Syftet med LARV &auml;r att fungera som en plattform f&ouml;r kontakt mellan student och f&ouml;retag. Lule&aring; ARbetsmarknadsVecka, LARV, arrangeras av Teknologk&aring;ren vid Lule&aring; Tekniska Universitet f&ouml;r medlemmar, i f&ouml;rsta hand. Under en veckas tid arrangeras evenemang f&ouml;r att det fysiska m&ouml;tet p&aring; m&auml;ss-dagen ska bli s&aring; v&auml;rdefullt det g&aring;r, f&ouml;r b&aring;da parter!</p>\n<p>\n	LARV blir m&ouml;jligt tack vare <strong>Teknologk&aring;rens medlemmar</strong>; den <strong>projektgrupp</strong> som varje &aring;r g&ouml;r sitt allt f&ouml;r att f&ouml;rvekliga projektet och givetvis v&aring;ra <strong>g&auml;stande f&ouml;retag</strong> och <strong>samarbetspartners!</strong></p>\n<p>\n	<em>Intresserad av samarbete? L&auml;s mer om samarbeten under &quot;aktiviteter&quot;.</em></p>\n<p>\n	<em>S&ouml;ker du LARV-projektgrupp, l&auml;s mer under &quot;Kontakt&quot;</em></p>',1,1321305297),(50,'omlarv','<h1>\n	Om Larv</h1>\n<p>\n	Syftet med LARV &auml;r att fungera som en plattform f&ouml;r kontakt mellan student och f&ouml;retag. Lule&aring; ARbetsmarknadsVecka, LARV, arrangeras av Teknologk&aring;ren vid Lule&ari