information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en &lt;l&auml;nk&gt;FAQ&lt;/l&auml;nk&gt; som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<div>\n	&nbsp;</div>',1,1321306062),(67,'foretag.signup','<h1>\n	Arbetsmarknadsdagar.se</h1>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat att f&ouml;renkla f&ouml;r f&ouml;retag att genomf&ouml;ra anm&auml;lningar till de olika m&auml;ssorna. P&aring; arbetsmarknadsdagar.se kan f&ouml;retag idag spara information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en &lt;l&auml;nk&gt;FAQ&lt;/l&auml;nk&gt; som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<div>\n	&nbsp;</div>',1,1321306070),(68,'foretag.signup','<h1>\n	Arbetsmarknadsdagar.se</h1>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat att f&ouml;renkla f&ouml;r f&ouml;retag att genomf&ouml;ra anm&auml;lningar till de olika m&auml;ssorna. P&aring; arbetsmarknadsdagar.se kan f&ouml;retag idag spara information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en &lt;l&auml;nk&gt;FAQ&lt;/l&auml;nk&gt; som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<div>\n	&nbsp;</div>\n<div>\n	<a href=\"http://www.arbetsmarknadsdagar.se/\">Till Arbetsmarknadsdagar.se</a></div>',1,1321306110),(69,'foretag','<h1>\n	Om Larv</h1>\n<p>\n	Syftet med LARV &auml;r att fungera som en plattform f&ouml;r kontakt mellan student och f&ouml;retag.&nbsp;</p>\n<p>\n	Lule&aring; ARbetsmarknadsVecka, LARV, arrangeras av Teknologk&aring;ren vid Lule&aring; Tekniska Universitet f&ouml;r medlemmar, i f&ouml;rsta hand.&nbsp;</p>\n<p>\n	Under en veckas tid arrangeras evenemang f&ouml;r att det fysiska m&ouml;tet p&aring; m&auml;ss-dagen ska bli s&aring; v&auml;rdefullt det g&aring;r, f&ouml;r b&aring;da parter!&nbsp;</p>\n<p>\n	LARV blir m&ouml;jligt tack vare <strong>Teknologk&aring;rens medlemmar</strong>; den <strong>projektgrupp</strong> som varje &aring;r g&ouml;r sitt allt f&ouml;r att f&ouml;rvekliga projektet och givetvis v&aring;ra <strong>g&auml;stande f&ouml;retag</strong>&nbsp;och <strong>samarbetspartners!</strong></p>\n<p>\n	<em>Intresserad av samarbete? L&auml;s mer om samarbeten under &quot;aktiviteter&quot;.</em></p>\n<p>\n	<em>S&ouml;ker du LARV-projektgrupp, l&auml;s mer under &quot;kontakt&quot;.</em></p>\n<p>\n	&nbsp;</p>',1,1321307004),(70,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	&nbsp;</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<div>\n	&nbsp;</div>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV &auml;r:</p>\n<ul>\n	<li>\n		<p>\n			Skjuts till boende eller Campus vid ankomst till Lule&aring;</p>\n	</li>\n	<li>\n		<p>\n			Skjuts till och fr&aring;n boende vid deltagande p&aring; &quot;kv&auml;llen f&ouml;re&quot; och m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			Monteryta: 3*2 m, h&ouml;jd; 3m</p>\n	</li>\n	<li>\n		<p>\n			F&ouml;retagsv&auml;rd som underst&ouml;djer arbetet f&ouml;r just Ert f&ouml;retag inf&ouml;r och under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			2 biljetter till lunch, fika och &nbsp;LARVbankett</p>\n	</li>\n	<li>\n		<p>\n			Uppslag i m&auml;sskatalog(webbaserad)</p>\n	</li>\n	<li>\n		<p>\n			Tr&aring;dl&ouml;s internetuppkoppling</p>\n	</li>\n	<li>\n		<p>\n			El</p>\n	</li>\n	<li>\n		<p>\n			M&ouml;jlighet till personliga samtal med utvalda studenter</p>\n	</li>\n	<li>\n		<p>\n			Tilltr&auml;de till &quot;Kv&auml;llen F&ouml;re&quot;</p>\n	</li>\n</ul>\n<p>\n	Givetvis finns det m&ouml;jlighet att &ouml;ka p&aring; paketet med;</p>\n<ul>\n	<li>\n		<p>\n			Ut&ouml;kad monteryta</p>\n	</li>\n	<li>\n		<p>\n			Fler biljetter; lunch, fika, bankett&lt;/li&gt;</p>\n	</li>\n	<li>\n		<p>\n			Rekvisita; stolar, bord, mattor, blommor&lt;/li&gt;</p>\n	</li>\n	<li>\n		<p>\n			Monterevenemang(1 dec 2011) eller synlighet i samband med Alpinaresa innan LARV (Kontakt med projektledare per telefon; 0706862585</p>\n	</li>\n	<li>\n		<p>\n			Monterupps&auml;ttning</p>\n	</li>\n	<li>\n		<p>\n			Spridning av utv&auml;rdering; antingen v&aring;r eller en vi tillsammans uppr&auml;ttar s&auml;rskilt f&ouml;r LARV&nbsp;</p>\n	</li>\n	<li>\n		<p>\n			Delgivning av V&aring;r utv&auml;rdering i n&auml;ra anslutning till avslutat LARV</p>\n	</li>\n</ul>',1,1321307023),(71,'foretag','<h1>\n	Om Larv</h1>\n<p>\n	Syftet med LARV &auml;r att fungera som en plattform f&ouml;r kontakt mellan student och f&ouml;retag.&nbsp;</p>\n<p>\n	Lule&aring; ARbetsmarknadsVecka, LARV, arrangeras av Teknologk&aring;ren vid Lule&aring; Tekniska Universitet f&ouml;r medlemmar, i f&ouml;rsta hand.&nbsp;</p>\n<p>\n	Under en veckas tid arrangeras evenemang f&ouml;r att det fysiska m&ouml;tet p&aring; m&auml;ss-dagen ska bli s&aring; v&auml;rdefullt det g&aring;r, f&ouml;r b&aring;da parter!&nbsp;</p>\n<p>\n	LARV blir m&ouml;jligt tack vare <strong>Teknologk&aring;rens medlemmar</strong>; den <strong>projektgrupp</strong> som varje &aring;r g&ouml;r sitt allt f&ouml;r att f&ouml;rvekliga projektet och givetvis v&aring;ra <strong>g&auml;stande f&ouml;retag</strong>&nbsp;och <strong>samarbetspartners!</strong></p>\n<p>\n	&nbsp;</p>\n<p>\n	<em>Intresserad av samarbete? L&auml;s mer om samarbeten under &quot;aktiviteter&quot;.</em></p>\n<p>\n	<em>S&ouml;ker du LARV-projektgrupp, l&auml;s mer under &quot;kontakt&quot;.</em></p>\n<p>\n	&nbsp;</p>',1,1321307049),(72,'student','<h1>\n	Studenter</h1>\n<p>\n	Lule&aring; ARbetsmarknads Vecka, <strong>LARV</strong>, &auml;r din chans att m&ouml;ta intressanta f&ouml;retag p&aring; n&auml;ra h&aring;ll. Genom att ta f&ouml;retagen till skolan, en milj&ouml; m&aring;nga studenter k&auml;nner sig som hemma i, ges en chans att utan press etablera en kontakt med ditt dr&ouml;mf&ouml;retag.</p>\n<p>\n	Vi ger dig b&aring;de tillf&auml;lle att tr&auml;ffa f&ouml;retagen och kommer &auml;ven att anordna f&ouml;rel&auml;sningar om hur just du kan &ouml;ka dina chanser till framtida arbete.</p>\n<p>\n	H&aring;ll ett &ouml;ga &ouml;ppet s&aring; ska du se att det kommer mer information efterhand.</p>',1,1321307411),(73,'student','<h1>\n	Studenter</h1>\n<p>\n	Lule&aring; ARbetsmarknads Vecka, <strong>LARV</strong>, &auml;r din chans att m&ouml;ta intressanta f&ouml;retag p&aring; n&auml;ra h&aring;ll. Genom att ta f&ouml;retagen till skolan, en milj&ouml; m&aring;nga studenter k&auml;nner sig som hemma i, ges en chans att utan press etablera en kontakt med ditt dr&ouml;mf&ouml;retag.</p>\n<p>\n	Vi ger dig b&aring;de tillf&auml;lle att tr&auml;ffa f&ouml;retagen och kommer &auml;ven att anordna f&ouml;rel&auml;sningar om hur just du kan &ouml;ka dina chanser till framtida arbete.</p>\n<p>\n	H&aring;ll ett &ouml;ga &ouml;ppet s&aring; ska du se att det kommer mer information efterhand.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Vill du &ouml;ka dina chanser &auml;nnu mer kan du alltid <a href=\"/student/crewregister/\">Anm&auml;la ditt intresse</a>&nbsp;f&ouml;r att arbeta som funktion&auml;r p&aring; m&auml;ssan.</p>',1,1321307473),(74,'student.categories','<p>\n	&nbsp;</p>\n<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<div>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</div>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<div>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rden ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n<div>\n	Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning. Det g&aring;r &auml;ven bra att &ouml;nska vilket f&ouml;retag du vill vara v&auml;rd f&ouml;r.</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	&nbsp;</p>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>',1,1321307865),(75,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<div>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</div>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<div>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rden ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n<div>\n	Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning. Det g&aring;r &auml;ven bra att &ouml;nska vilket f&ouml;retag du vill vara v&auml;rd f&ouml;r.</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	&nbsp;</p>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>',1,1321307871),(76,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<div>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</div>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<div>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rden ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.</div>\n		<div>\n			&nbsp;</div>\n		<div>\n			Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning. Det g&aring;r &auml;ven bra att &ouml;nska vilket f&ouml;retag du vill vara v&auml;rd f&ouml;r.</div>\n	</div>\n</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>\n<h2>\n	Gods</h2>\n<p>\n	&nbsp;</p>\n<div>\n	Som godsarbetare arbetar du p&aring; Godsmotagningen med att hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</div>\n<div>\n	&nbsp;</div>\n<div>\n	Har du fr&aring;gor skicka dem till logistik@larv.org</div>\n<div>\n	&nbsp;</div>',1,1321307920),(77,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LA