tt hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</p>\n<p>\n	Har du fr&aring;gor skicka dem till logistik@larv.org</p>\n<h2>\n	Event</h2>\n<div>\n	<p>\n		Som Eventv&auml;rd f&ouml;r LARV kommer du att hj&auml;lpa till med att g&ouml;ra LARV till den arbetsmarknadsvecka som namnet syftar till. Tr&auml;ffa f&ouml;retagen p&aring; ett helt annat vis &auml;n du g&ouml;r under m&auml;ssan. Det du ska g&ouml;ra &auml;r att se till s&aring; att eventen g&aring;r smidigt genom att se till s&aring; att cateringen kommer p&aring; plats, att skriva ut utv&auml;rderingar &aring;t f&ouml;retagen mm. &nbsp;Du kommer att hinna bes&ouml;ka m&auml;ssan under dagen d&aring; det mesta av arbetet kommer att vara veckan innan LARV. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.</p>\n	<p>\n		Har du fr&aring;gor skicka dem till event@larv.org</p>\n	<p>\n		&lt;a title=&quot;&quot; href=&quot;/site/crewregister/&quot;&gt;G&aring; till anm&auml;lan&lt;/a&gt;</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321307982),(78,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<p>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</p>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<p>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rden ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.</p>\n		<p>\n			&nbsp;</p>\n		<p>\n			Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning. Det g&aring;r &auml;ven bra att &ouml;nska vilket f&ouml;retag du vill vara v&auml;rd f&ouml;r.</p>\n	</div>\n</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>\n<h2>\n	Gods</h2>\n<p>\n	Som godsarbetare arbetar du p&aring; Godsmotagningen med att hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</p>\n<p>\n	Har du fr&aring;gor skicka dem till logistik@larv.org</p>\n<h2>\n	Event</h2>\n<div>\n	<p>\n		Som Eventv&auml;rd f&ouml;r LARV kommer du att hj&auml;lpa till med att g&ouml;ra LARV till den arbetsmarknadsvecka som namnet syftar till. Tr&auml;ffa f&ouml;retagen p&aring; ett helt annat vis &auml;n du g&ouml;r under m&auml;ssan. Det du ska g&ouml;ra &auml;r att se till s&aring; att eventen g&aring;r smidigt genom att se till s&aring; att cateringen kommer p&aring; plats, att skriva ut utv&auml;rderingar &aring;t f&ouml;retagen mm. &nbsp;Du kommer att hinna bes&ouml;ka m&auml;ssan under dagen d&aring; det mesta av arbetet kommer att vara veckan innan LARV. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.</p>\n	<p>\n		Har du fr&aring;gor skicka dem till event@larv.org</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321307993),(79,'kontakt','<h1>\n	Projektledare</h1>\n<div class=\"top2\">\n	<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Projektledaren &auml;r &auml;ven Arbetsmarknadsenhetens ordf&ouml;rande p&aring; Teknologk&aring;ren. Att vara projektledare f&ouml;r LARV ing&aring;r i dennes uppgifter. Denna post tills&auml;tts av K&aring;rfullm&auml;ktige och &auml;r en helarvoderad post, vilket inneb&auml;r att denne f&ouml;rtroendevalda person tar ett &aring;rs uppeh&aring;ll fr&aring;n studierna.</p>\n</div>\n<div class=\"top2\">\n	<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Eftersom Teknologk&aring;ren ing&aring;r i Reftec sitter projektledaren med i ARG, ARbetsmarknadsGruppen inom Reftec.<br />\n		Du finner mer information om ARG och Reftec&nbsp;<a href=\"http://larv.org/site/foretag/anmalan/Om-anmalan/\" style=\"color: rgb(152, 27, 30); \" title=\"\">h&auml;r.</a>.</p>\n</div>\n<div class=\"top2\">\n	<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Kontaktuppgifter</p>\n	<div style=\"height: 300px;\">\n		<div style=\"float: left; width: 200px;\">\n			<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padd