: 1px; border-top-color: rgb(0, 0, 0); border-right-color: rgb(0, 0, 0); border-bottom-color: rgb(0, 0, 0); border-left-color: rgb(0, 0, 0); border-top-width: 1px; border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; margin-left: 5px; margin-right: 5px; margin-top: 5px; margin-bottom: 5px; \" /></a><br />\n				Linus Winther<br />\n				Email:&nbsp;<a href=\"mailto:avo@teknologkaren.se\" style=\"color: rgb(152, 27, 30); \">avo@teknologkaren.se</a><br />\n				Mobil: 070-825 66 43</p>\n			<p>\n				&nbsp;</p>\n		</div>\n</div>\n<p>\n	&nbsp;</p>',1,1321308779),(82,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<p>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</p>\n	<p>\n		Vid fr&aring;gor, kontakta transport@larv.org</p>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<p>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rden ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.</p>\n		<p>\n			Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning. Det g&aring;r &auml;ven bra att &ouml;nska vilket f&ouml;retag du vill vara v&auml;rd f&ouml;r.</p>\n		<p>\n			Vid fr&aring;gor, kontakta ftv@larv.org</p>\n	</div>\n</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>\n<h2>\n	Gods</h2>\n<p>\n	Som godsarbetare arbetar du p&aring; Godsmotagningen med att hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</p>\n<p>\n	Har du fr&aring;gor skicka dem till logistik@larv.org</p>\n<h2>\n	Event</h2>\n<div>\n	<p>\n		Som Eventv&auml;rd f&ouml;r LARV kommer du att hj&auml;lpa till med att g&ouml;ra LARV till den arbetsmarknadsvecka som namnet syftar till. Tr&auml;ffa f&ouml;retagen p&aring; ett helt annat vis &auml;n du g&ouml;r under m&auml;ssan. Det du ska g&ouml;ra &auml;r att se till s&aring; att eventen g&aring;r smidigt genom att se till s&aring; att cateringen kommer p&aring; plats, att skriva ut utv&auml;rderingar &aring;t f&ouml;retagen mm. &nbsp;Du kommer att hinna bes&ouml;ka m&auml;ssan under dagen d&aring; det mesta av arbetet kommer att vara veckan innan LARV. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.</p>\n	<p>\n		Har du fr&aring;gor skicka dem till event@larv.org</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321328695),(83,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<p>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</p>\n	<p>\n		Vid fr&aring;gor, kontakta transport@larv.org</p>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<p>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rden ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.</p>\n		<p>\n			Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning. Det g&aring;r &auml;ven bra att &ouml;nska vilket f&ouml;retag du vill vara v&auml;rd f&ouml;r.</p>\n		<p>\n			Vid fr&aring;gor, kontakta massvard@larv.org</p>\n	</div>\n</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>\n<h2>\n	Gods</h2>\n<p>\n	Som godsarbetare arbetar du p&aring; Godsmotagningen med att hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</p>\n<p>\n	Har du fr&aring;gor skicka dem till logistik@larv.org</p>\n<h2>\n	Event</h2>\n<div>\n	<p>\n		Som Eventv&auml;rd f&ouml;r LARV kommer du att hj&auml;lpa till med att g&ouml;ra LARV till den arbetsmarknadsvecka som namnet syftar till. Tr&auml;ffa f&ouml;retagen p&aring; ett helt annat vis &auml;n du g&ouml;r under m&auml;ssan. Det du ska g&ouml;ra &auml;r att se till s&aring; att eventen g&aring;r smidigt genom att se till s&aring; att cateringen kommer p&aring; plats, att skriva ut utv&auml;rderingar &aring;t f&ouml;retagen mm. &nbsp;Du kommer att hinna bes&ouml;ka m&auml;ssan under dagen d&aring; det mesta av arbetet kommer att vara veckan innan LARV. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.</p>\n	<p>\n		Har du fr&aring;gor skicka dem till event@larv.org</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321534804),(84,'foretag','<h1>\n	Om Larv</h1>\n<p>\n	Syftet med LARV &auml;r att fungera som en plattform f&ouml;r kontakt mellan student och f&ouml;retag.&nbsp;</p>\n<p>\n	Lule&aring; ARbetsmarknadsVecka, LARV, arrangeras av Teknologk&aring;ren vid Lule&aring; Tekniska Universitet f&ouml;r medlemmar, i f&ouml;rsta hand.&nbsp;</p>\n<p>\n	Under en veckas tid arrangeras evenemang f&ouml;r att det fysiska m&ouml;tet p&aring; m&auml;ss-dagen ska bli s&aring; v&auml;rdefullt det g&aring;r, f&ouml;r b&aring;da parter!&nbsp;</p>\n<p>\n	LARV blir m&ouml;jligt tack vare <strong>Teknologk&aring;rens medlemmar</strong>; den <strong>projektgrupp</strong> som varje &aring;r g&ouml;r sitt allt f&ouml;r att f&ouml;rvekliga projektet och givetvis v&aring;ra <strong>g&auml;stande f&ouml;retag</strong>&nbsp;och <strong>samarbetspartners!</strong></p>\n<p>\n	<em>S&ouml;ker du LARV-projektgrupp, l&auml;s mer under <a href=\"http://www.larv.org/kontakt\">Kontakt</a>.</em></p>\n<p>\n	&nbsp;</p>',1,1321534871),(85,'foretag.signup','<h1>\n	Arbetsmarknadsdagar.se</h1>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat att f&ouml;renkla f&ouml;r f&ouml;retag att genomf&ouml;ra anm&auml;lningar till de olika m&auml;ssorna. P&aring; arbetsmarknadsdagar.se kan f&ouml;retag idag spara information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en FAQ som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<p>\n	<strong>Anm&auml;lan har st&auml;ngt f&ouml;r i &aring;r.</strong></p>\n<div>\n	<a href=\"http://www.arbetsmarknadsdagar.se/\">Till Arbetsmarknadsdagar.se</a></div>',1,1321534958),(86,'student','<h1>\n	Studenter</h1>\n<p>\n	Lule&aring; ARbetsmarknads Vecka, <strong>LARV</strong>, &auml;r din chans att m&ouml;ta intressanta f&ouml;retag p&aring; n&auml;ra h&aring;ll. Genom att ta f&ouml;retagen till skolan, en milj&ouml; m&aring;nga studenter k&auml;nner sig som hemma i, ges en chans att utan press etablera en kontakt med ditt dr&ouml;mf&ouml;retag.</p>\n<p>\n	Vi ger dig b&aring;de tillf&auml;lle att tr&auml;ffa f&ouml;retagen och kommer &auml;ven att anordna f&ouml;rel&auml;sningar om hur just du kan &ouml;ka dina chanser till framtida arbete.</p>\n<p>\n	H&aring;ll ett &ouml;ga &ouml;ppet s&aring; ska du se att det kommer mer information efterhand.</p>\n<p>\n	Vill du &ouml;ka dina chanser &auml;nnu mer kan du alltid <a href=\"/student/crewregister/\">Anm&auml;la ditt intresse</a>&nbsp;f&ouml;r att arbeta som funktion&auml;r p&aring; m&auml;ssan.</p>\n<h2>\n	Onsdagen den 25e januari &auml;r det dags! LARV firar 30!&nbsp;</h2>\n<p>\n	&nbsp;</p>\n<p>\n	Onsdagen den <strong>25e januari</strong>&nbsp;h&aring;lls en m&auml;ssa med f&ouml;retag fr&aring;n hela landet.&nbsp;</p>\n<p>\n	F&ouml;r att l&auml;ra mer om hur LARV fungerar och vad som sker och erbjuds dig varesig du &auml;r student eller f&ouml;retag, l&auml;s mer under flikarna i menyn!&nbsp;</p>\n<h2>\n	Varf&ouml;r bes&ouml;ka LARV?</h2>\n<p>\n	&nbsp;</p>\n<div>\n	M&aring;nga LTU-studenter har flyttat l&aring;ngv&auml;ga f&ouml;r sina studier och drar sig heller inte f&ouml;r att g&ouml;ra det igen. De kan antas ha kommit en bra bit i mognadsprocessen mycket tack vare detta. Som student vid LTU &auml;r man &auml;ven van att arbeta i projekt och finnes ofta sj&auml;lvst&auml;ndiga och jordn&auml;ra.&nbsp;</div>\n<div>\n	M&aring;nga studenter engagerar sig &auml;ven i k&aring;rer, sektioner och egna projekt och det finns &auml;ven en god andel som under studietiden startar eget...</div>\n<div>\n	&nbsp;</div>\n<div>\n	V&auml;lkommen till LARV!</div>\n<h2>\n	Nytt f&ouml;r i &aring;r!&nbsp;</h2>\n<p>\n	&nbsp;</p>\n<p>\n	LARV 2012 anordnas f&ouml;r 30 &aring;ret i rad och f&ouml;r att fira detta l&auml;ggs det extra krut f&ouml;r att g&ouml;ra just LARV 2012 till det b&auml;sta hittills!&nbsp;</p>\n<p>\n	LARV siktar &aring;ter p&aring; att generera v&auml;rdefulla evenemang under en veckas tid f&ouml;r att du som student eller arbetsgivare ska f&aring; ett lyckat m&ouml;te under m&auml;ssdagen. Med f&ouml;rel&auml;sningar, presentationer, nya tj&auml;nster s&aring; som montermontering eller annonsering i den interaktiva webbkatalog som skapas finns m&aring;nga m&ouml;jligheter till synlighet inf&ouml;r LARV. Samarbete med det campusbel&auml;gna gymmet Stil inneb&auml;r m&ouml;jlighet till &ouml;kad exponering och m&ouml;te med studenter &auml;ven innan LARV. L&auml;s mer nedan.&nbsp;</p>\n<p>\n	LARV 2012 &auml;r m&auml;ssan Ni inte f&aring;r missa i &aring;r!&nbsp;</p>\n<h2>\n	Samarbeten med Stil Alpina</h2>\n<p>\n	&nbsp;</p>\n<div>\n	<strong>Annonsering i Stil Alpinas resekatalog &auml;r inte l&auml;ngre m&ouml;jlig.</strong>&nbsp;&Auml;r ni intresserade av detta erbjudande f&ouml;r kommande &aring;r v&auml;nligen skriv ett mail med &auml;mnet ALPINA till ao@teknologkaren.se</div>\n<div>\n	&nbsp;</div>\n<div>\n	&Auml;n finns det d&auml;remot &auml;nnu m&ouml;jlighet att delta i monterevenemang &nbsp;innan LARV f&ouml;r att ytterligare locka till just er monter d&aring; m&auml;ssdagen anl&auml;nder. Kanske ni &auml;ven intresserar er f&ouml;r att synas i samband med n&aring;gon av de m&aring;nga&nbsp;</div>\n<div>\n	alpina resorna som anordnas. F&ouml;r mer information om detta erbjudande; v&auml;nligen kontakta projektledare f&ouml;r LARV per telefon; 0706862585</div>\n<p>\n	&nbsp;</p>\n<div>\n	&nbsp;</div>',1,1321539637),(87,'student','<h1>\n	Studenter</h1>\n<p>\n	Lule&aring; ARbetsmarknads Vecka, <strong>LARV</strong>, &auml;r din chans att m&ouml;ta intressanta f&ouml;retag p&aring; n&auml;ra h&aring;ll. Genom att ta f&ouml;retagen till skolan, en milj&ouml; m&aring;nga studenter k&auml;nner sig som hemma i, ges en chans att utan press etablera en kontakt med ditt dr&ouml;mf&ouml;retag.</p>\n<p>\n	Vi ger dig b&aring;de tillf&auml;lle att tr&auml;ffa f&ouml;retagen och kommer &auml;ven att anordna f&ouml;rel&auml;sningar om hur just du kan &ouml;ka dina chanser till framtida arbete.</p>\n<p>\n	H&aring;ll ett &ouml;ga &ouml;ppet s&aring; ska du se att det kommer mer information efterhand.</p>\n<p>\n	Vill du &ouml;ka dina chanser &auml;nnu mer kan du alltid <a href=\"/student/crewregister/\">Anm&auml;la ditt intresse</a>&nbsp;f&ouml;r att arbeta som funktion&auml;r p&aring; m&auml;ssan.</p>\n<h2>\n	Onsdagen den 25e januari &auml;r det dags! LARV firar 30!&nbsp;</h2>\n<p>\n	Onsdagen den <strong>25e januari</strong>&nbsp;h&aring;lls en m&auml