u se att det kommer mer information efterhand.</p>\n<p>\n	Vill du &ouml;ka dina chanser &auml;nnu mer kan du alltid <a href=\"/student/crewregister/\">Anm&auml;la ditt intresse</a>&nbsp;f&ouml;r att arbeta som funktion&auml;r p&aring; m&auml;ssan.</p>\n<h2>\n	Onsdagen den 25e januari &auml;r det dags! LARV firar 30!&nbsp;</h2>\n<p>\n	Onsdagen den <strong>25e januari</strong>&nbsp;h&aring;lls en m&auml;ssa med f&ouml;retag fr&aring;n hela landet.&nbsp;</p>\n<p>\n	F&ouml;r att l&auml;ra mer om hur LARV fungerar och vad som sker och erbjuds dig varesig du &auml;r student eller f&ouml;retag, l&auml;s mer under flikarna i menyn!&nbsp;</p>\n<h2>\n	Varf&ouml;r bes&ouml;ka LARV?</h2>\n<p>\n	M&aring;nga LTU-studenter har flyttat l&aring;ngv&auml;ga f&ouml;r sina studier och drar sig heller inte f&ouml;r att g&ouml;ra det igen. De kan antas ha kommit en bra bit i mognadsprocessen mycket tack vare detta. Som student vid LTU &auml;r man &auml;ven van att arbeta i projekt och finnes ofta sj&auml;lvst&auml;ndiga och jordn&auml;ra.&nbsp;</p>\n<p>\n	M&aring;nga studenter engagerar sig &auml;ven i k&aring;rer, sektioner och egna projekt och det finns &auml;ven en god andel som under studietiden startar eget...</p>\n<p>\n	V&auml;lkommen till LARV!</p>\n<h2>\n	Nytt f&ouml;r i &aring;r!&nbsp;</h2>\n<p>\n	LARV 2012 anordnas f&ouml;r 30 &aring;ret i rad och f&ouml;r att fira detta l&auml;ggs det extra krut f&ouml;r att g&ouml;ra just LARV 2012 till det b&auml;sta hittills!&nbsp;</p>\n<p>\n	LARV siktar &aring;ter p&aring; att generera v&auml;rdefulla evenemang under en veckas tid f&ouml;r att du som student eller arbetsgivare ska f&aring; ett lyckat m&ouml;te under m&auml;ssdagen. Med f&ouml;rel&auml;sningar, presentationer, nya tj&auml;nster s&aring; som montermontering eller annonsering i den interaktiva webbkatalog som skapas finns m&aring;nga m&ouml;jligheter till synlighet inf&ouml;r LARV. Samarbete med det campusbel&auml;gna gymmet Stil inneb&auml;r m&ouml;jlighet till &ouml;kad exponering och m&ouml;te med studenter &auml;ven innan LARV. L&auml;s mer nedan.&nbsp;</p>\n<p>\n	LARV 2012 &auml;r m&auml;ssan Ni inte f&aring;r missa i &aring;r!&nbsp;</p>\n<h2>\n	Samarbeten med Stil Alpina</h2>\n<p>\n	<strong>Annonsering i Stil Alpinas resekatalog &auml;r inte l&auml;ngre m&ouml;jlig.</strong>&nbsp;&Auml;r ni intresserade av detta erbjudande f&ouml;r kommande &aring;r v&auml;nligen skriv ett mail med &auml;mnet ALPINA till ao@teknologkaren.se</p>\n<p>\n	&Auml;n finns det d&auml;remot &auml;nnu m&ouml;jlighet att delta i monterevenemang &nbsp;innan LARV f&ouml;r att ytterligare locka till just er monter d&aring; m&auml;ssdagen anl&auml;nder. Kanske ni &auml;ven intresserar er f&ouml;r att synas i samband med n&aring;gon av de m&aring;nga&nbsp;alpina resorna som anordnas.</p>\n<p>\n	F&ouml;r mer information om detta erbjudande; v&auml;nligen kontakta projektledare f&ouml;r LARV per telefon; 0706 862 585</p>',1,1321539794),(92,'student.larvcrew','<p>\n	&nbsp;</p>\n<h1>\n	LARV-Crew</h1>\n<p>\n	Projektgruppen best&aring;r av ett tio-tal studenter som jobbar ideellt med LARV ut&ouml;ver sina studier. Varje person i projektgruppen har huvudansvar &ouml;ver ett omr&aring;de men g&ouml;r &auml;ven st&ouml;rre &ouml;vergripande saker inom projektet. Projektgruppen rekryteras av projektledaren.</p>\n<p>\n	Projektgruppen skall v&auml;rna om LARV:s vision och syfte samt att r&auml;tta sig efter policyn f&ouml;r grafisk form och kommunikation som finns f&ouml;r LARV. Projektgruppsmedlemmarna v&auml;ljer &auml;ven medhj&auml;lpare som kompletterar projektgruppsmedlemmen samt har n&aring;got att tillf&ouml;ra projektet. Antalet medhj&auml;lpare best&auml;ms i samr&aring;d med projektledaren.</p>\n<p>\n	Ut&ouml;ver detta finns sen ytterligare f&ouml;retagsv&auml;rdar, chauff&ouml;rer, serveringspersonal och m&aring;nga andra som hj&auml;lper till.</p>\n<h2>\n	Postbeskrivning f&ouml;r LARV2012-projektgrupp&nbsp;</h2>\n<div>\n	<p>\n		LARV best&aring;r av m&aring;nga delprojekt som tillsammans utg&ouml;r den arbetsmarknadsvecka som &aring;rligen ger oss en ov&auml;rderlig kontakt med framtida arbetsgivare. LARV blir vad vi g&ouml;r det till! LARV projektgrupp beh&ouml;ver dig som har tankar och id&eacute;er, &auml;r kreativ eller strategiskt lagd. Har god planeringsf&ouml;rm&aring;ga, &auml;r en probleml&ouml;sare eller riktig &rdquo;vinnarskalle&rdquo;. Skaffa dig erfarenhet och ett bredare n&auml;tverk... f&ouml;r att inte tala om den d&auml;r extra kryddan till ditt CV.</p>\n	<p>\n		<strong>PR-ansvarig;</strong> som marknadsf&ouml;ringsansvarig &auml;r du den som planerar inf&ouml;r- och leder dem som marknadsf&ouml;r LARV s&aring;v&auml;l inom som utanf&ouml;r universitetets v&auml;ggar. Du har n&auml;ra kontakt med grafisk form och andra samarbetspartners under hela projektets g&aring;ng.</p>\n	<p>\n		<strong>Grafiskform;</strong> du som s&ouml;ker har ett &ouml;ga f&ouml;r f&auml;rg och form och sk&ouml;ter b&aring;de den grafiska profilen, utformning av exempelvis namnskyltar och annan rekvisita, roll-ups, tryck och profilprodukter. Du tr&auml;nar inte bara dina f&auml;rdigheter i formgivning utan &auml;ven samarbete och planering.</p>\n	<p>\n		<strong>IT-ansvarig;</strong>&nbsp;LARV beh&ouml;ver, inte bara h&auml;nga med i sv&auml;ngarna, utan visa framf&ouml;tterna! Larvhemsidan &auml;r v&aring;r f&ouml;rsta kontakt med f&ouml;retagen. Visa vad en LTU-student g&aring;r f&ouml;r - utveckla LARVhemsidan. Du har &auml;ven m&ouml;jlighet att leda andra i den grupp du sj&auml;lv uppr&auml;ttar f&ouml;r jobbet och har &auml;ven ansvar f&ouml;r wifi p&aring; m&auml;ssan.</p>\n	<p>\n		<strong>Katalogansvarig;&nbsp;</strong>LARVkatalogen &auml;r, &auml;ven den, en stor puck i arbetet med LARV. Du ser till att s&aring;v&auml;l f&ouml;retagen som studenterna &auml;r n&ouml;jda med katalogens inneh&aring;ll vilken s&aring;v&auml;l informerar som f&ouml;rbereder studenten. &nbsp;Hur ser katalogen ut fram&ouml;ver? Tryckt, p&aring; webben eller i en app? H&auml;nger vi med i utvecklingen?</p>\n	<p>\n		<strong>M&auml;ssbyggnadsansvarig;</strong>&nbsp;har du koll p&aring; inredning och gott flyt? M&auml;ssan beh&ouml;ver god planering av montrar, tillg&aring;ng till lokaler och n&auml;tverk, god ventilation och n&aring;gon som har t&auml;nkt p&aring; s&auml;kerheten!</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Logistikansvarig;&nbsp;</strong>en hel del gods fraktas under detta event fr&aring;n punkt A till B, &auml;r du den som kan logistik? Du har d&aring; &auml;ven hand om hyrt material och direkt kontakt med s&aring;v&auml;l f&ouml;retag som f&ouml;retagsv&auml;rdar och k&aring;rer p&aring; andra orter.</p>\n	<p>\n		<strong>Transportansvarig;</strong>&nbsp;Dina ansvarsomr&aring;den t&auml;cker bokning, planering och ansvar &ouml;ver bokningssystemet f&ouml;r bussar, taxiverksamhet och de chauff&ouml;rer som slussar s&aring;v&auml;l f&ouml;retagsrepresentanter som off-campusstudenter till och fr&aring;n LARV.</p>\n	<p>\n		<strong>Receptionsansvarig;</strong>&nbsp;med god planeringsf&ouml;rm&aring;ga och ditt ansvar &ouml;ver de personliga samtalen ser du till att studenter och f&ouml;retagen kommer varandra riktigt n&auml;ra. Dessutom ser du till att guida s&aring;v&auml;l f&ouml;retag som studenter r&auml;tt under m&auml;ssdagen och planerar f&ouml;r tillg&aring;ng av fika och lunch.</p>\n	<p>\n		<strong>Bankettansvarig;</strong>&nbsp;efter m&auml;ssan tr&auml;ffas f&ouml;retagare och studenter under mer avslappnade former. Som bankettansvarig organiserar du underh&aring;llning, &rdquo;eftersl&auml;pp&rdquo;, mat och personal. Tar fram offerter och ordnar med dekorationer. Du har &auml;ven ansvar f&ouml;r &rdquo;kv&auml;llen f&ouml;re&rdquo;.</p>\n	<p>\n		<strong>Eventansvarig;</strong>&nbsp;LARV best&aring;r av f&ouml;r- och efterevent med en del festliga inslag, f&ouml;rel&auml;sningar och andra evenemang. Du sk&ouml;ter kontakten med f&ouml;rel&auml;sarna, kommer upp med nya id&eacute;er och sk&ouml;ter bokning av s&aring;v&auml;l mat och lokal. &nbsp;&nbsp;</p>\n	<p>\n		<strong>Sponsoransvarig;&nbsp;</strong>som ansvarig f&ouml;r spons &auml;r det du som knyter kontakten och f&ouml;rhandlar med sponsorer s&aring; att LARV har tillg&aring;ng till bland annat bilar och rekvisita. Du kontrollerar &auml;ven att avtal efterf&ouml;ljs och sponsorer synligg&ouml;rs som avtalat.</p>\n	<p>\n		<strong>M&auml;ssv&auml;rd;</strong> m&auml;ssv&auml;rden rekryterar, informerar och matchar f&ouml;retagsv&auml;rdar med f&ouml;retag. Inf&ouml;r och under m&auml;ssan &auml;r det v&auml;rden som leder f&ouml;retagsv&auml;rdarna och ser till att v&auml;rdarna kan besvara f&ouml;retagens fr&aring;gor.</p>\n	<p>\n		<strong>Internationell kontakt;</strong>&nbsp;m&aring;nga studenter &auml;r sugna p&aring; internationell karri&auml;r &ndash; s&aring; &auml;ven utbytesstudenter som nu vistas p&aring; LTU. M&aring;nga f&ouml;retag &auml;r globala. S&ouml;k hit om du &auml;r sugen p&aring; spela en viktig roll f&ouml;r s&aring;v&auml;l f&ouml;retag som studenter!</p>\n	<p>\n		<strong>LARV-CREW:</strong> Du som vill vara del av LARV-CREW och agera f&ouml;retagsv&auml;rd, chauff&ouml;r, servit&ouml;r, fuktion&auml;r eller kanske medhj&auml;lpare till ovanst&aring;ende poster; Skicka din intresseanm&auml;lan redan nu!</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321541512),(93,'student.larvcrew','<p>\n	LARV-Crew</p>\n<p>\n	Projektgruppen best&aring;r av ett tio-tal studenter som jobbar ideellt med LARV ut&ouml;ver sina studier. Varje person i projektgruppen har huvudansvar &ouml;ver ett omr&aring;de men g&ouml;r &auml;ven st&ouml;rre &ouml;vergripande saker inom projektet. Projektgruppen rekryteras av projektledaren.</p>\n<p>\n	Projektgruppen skall v&auml;rna om LARV:s vision och syfte samt att r&auml;tta sig efter policyn f&ouml;r grafisk form och kommunikation som finns f&ouml;r LARV. Projektgruppsmedlemmarna v&auml;ljer &auml;ven medhj&auml;lpare som kompletterar projektgruppsmedlemmen samt har n&aring;got att tillf&ouml;ra projektet. Antalet medhj&auml;lpare best&auml;ms i samr&aring;d med projektledaren.</p>\n<p>\n	Ut&ouml;ver detta finns sen ytterligare f&ouml;retagsv&auml;rdar, chauff&ouml;rer, serveringspersonal och m&aring;nga andra som hj&auml;lper till.</p>\n<h2>\n	Postbeskrivning f&ouml;r LARV2012-projektgrupp&nbsp;</h2>\n<div>\n	<p>\n		LARV best&aring;r av m&aring;nga delprojekt som tillsammans utg&ouml;r den arbetsmarknadsvecka som &aring;rligen ger oss en ov&auml;rderlig kontakt med framtida arbetsgivare. LARV blir vad vi g&ouml;r det till! LARV projektgrupp beh&ouml;ver dig som har tankar och id&eacute;er, &auml;r kreativ eller strategiskt lagd. Har god planeringsf&ouml;rm&aring;ga, &auml;r en probleml&ouml;sare eller riktig &rdquo;vinnarskalle&rdquo;. Skaffa dig erfarenhet och ett bredare n&auml;tverk... f&ouml;r att inte tala om den d&auml;r extra kryddan till ditt CV.</p>\n	<p>\n		<strong>PR-ansvarig;</strong> som marknadsf&ouml;ringsansvarig &auml;r du den som planerar inf&ouml;r- och leder dem som marknadsf&ouml;r LARV s&aring;v&auml;l inom som utanf&ouml;r universitetets v&auml;ggar. Du har n&auml;ra kontakt med grafisk form och andra samarbetspartners under hela projektets g&aring;ng.</p>\n	<p>\n		<strong>Grafiskform;</strong> du som s&ouml;ker har ett &ouml;ga f&ouml;r f&auml;rg och form och sk&ouml;ter b&aring;de den grafiska profilen, utformning av exempelvis namnskyltar och annan rekvisita, roll-ups, tryck och profilprodukter. Du tr&auml;nar inte bara dina f&auml;rdigheter i formgivning utan &auml;ven samarbete och planering.</p>\n	<p>\n		<strong>IT-ansvarig;</strong>&nbsp;LARV beh&ouml;ver, inte bara h&auml;nga med i sv&auml;ngarna, utan visa framf&ouml;tterna! Larvhemsidan &auml;r v&aring;r f&ouml;rsta kontakt med f&ouml;retagen. Visa vad en LTU-student g&aring;r f&ouml;r - utveckla LARVhemsidan. Du har &auml;ven m&ouml;jlighet att leda andra i den grupp du sj&auml;lv uppr&auml;ttar f&ouml;r jobbet och har &auml;ven ansvar f&ouml;r wifi p&aring; m&auml;ssan.</p>\n	<p>\n		<strong>Katalogansvarig;&nbsp;</strong>LARVkatalogen &auml;r, &auml;ven den, en stor puck i arbetet med LARV. Du ser till att s&aring;v&auml;l f&ouml;retagen som studenterna &auml;r n&ouml;jda med katalogens inneh&aring;ll vilken s&aring;v&auml;l informerar som f&ouml;rbereder studenten. &nbsp;Hur ser katalogen ut fram&ouml;ver? Tryckt, p&aring; webben eller i en app? H&auml;nger vi med i utvecklingen?</p>\n	<p>\n		<strong>M&auml;ssbyggnadsansvarig;</strong>&nbsp;har du koll p&aring; inredning och gott flyt? M&auml;ssan beh&ouml;ver god planering av montrar, tillg&aring;ng till lokaler och n&auml;tverk, god ventilation och n&aring;gon som har t&auml;nkt p&aring; s&auml;kerheten!</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Logistikansvarig;&nbsp;</strong>en hel del gods fraktas under detta event fr&aring;n punkt A till B, &auml;r du den som kan logistik? Du har d&aring; &auml;ven hand om hyrt material och direkt kontakt med s&aring;v&auml;l f&ouml;retag som f&ouml;retagsv&auml;rdar och k&aring;rer p&aring; andra orter.</p>\n	<p>\n		<strong>Transportansvarig;</strong>&nbsp;Dina ansvarsomr&aring;den t&auml;cker bokning, planering och ansvar &ouml;ver bokningssystemet f&ouml;r bussar, taxiverksamhet och de chauff&ouml;rer som slussar s&aring;v&auml;l f&ouml;retagsrepresentanter som off-campusstudenter till och fr&aring;n LARV.</p>\n	<p>\n		<strong>Receptionsansvarig;</strong>&nbsp;med god planeringsf&ouml;rm&aring;ga och ditt ansvar &ouml;ver de personliga samtalen ser du till att studenter och f&ouml;retagen kommer varandra riktigt n&auml;ra. Dessutom ser du till att guida s&aring;v&auml;l f&ouml;retag som studenter r&auml;tt under m&auml;ssdagen och planerar f&ouml;r tillg&aring;ng av fika och lunch.</p>\n	<p>\n		<strong>Bankettansvarig;</strong>&nbsp;efter m&auml;ssan tr&auml;ffas f&ouml;retagare och studenter under mer avslappnade former. Som bankettansvarig organiserar du underh&aring;llning, &rdquo;eftersl&auml;pp&rdquo;, mat och personal. Tar fram offerter och ordnar med dekorationer. Du har &auml;ven ansvar f&ouml;r &rdquo;kv&auml;llen f&ouml;re&rdquo;.</p>\n	<p>\n		<strong>Eventansvarig;</strong>&nbsp;LARV best&aring;r av f&ouml;r- och efterevent med en del festliga inslag, f&ouml;rel&auml;sningar och andra evenemang. Du sk&ouml;ter kontakten med f&ouml;rel&auml;sarna, kommer upp med nya id&eacute;er och sk&ouml;ter bokning av s&aring;v&auml;l mat och lokal. &nbsp;&nbsp;</p>\n	<p>\n		<strong>Sponsoransvarig;&nbsp;</strong>som ansvarig f&ouml;r spons &auml;r det du som knyter kontakten och f&ouml;rhandlar med sponsorer s&aring; att LARV har tillg&aring;ng till bland annat bilar och rekvisita. Du kontrollerar &auml;ven att avtal efterf&ouml;ljs och sponsorer synligg&ouml;rs som avtalat.</p>\n	<p>\n		<strong>M&auml;ssv&auml;rd;</strong> m&auml;ssv&auml;rden rekryterar, informerar och matchar f&ouml;retagsv&auml;rdar med f&ouml;retag. Inf&ouml;r och under m&auml;ssan &auml;r det v&auml;rden som leder f&ouml;retagsv&auml;rdarna och ser till att v&auml;rdarna kan besvara f&ouml;retagens fr&aring;gor.</p>\n	<p>\n		<strong>Internationell kontakt;</strong>&nbsp;m&aring;nga studenter &auml;r sugna p&aring; internationell karri&auml;r &ndash; s&aring; &auml;ven utbytesstudenter som nu vistas p&aring; LTU. M&aring;nga f&ouml;retag &auml;r globala. S&ouml;k hit om du &auml;r sugen p&aring; spela en viktig roll f&ouml;r s&aring;v&auml;l f&ouml;retag som studenter!</p>\n	<p>\n		<strong>LARV-CREW:</strong> Du som vill vara del av LARV-CREW och agera f&ouml;retagsv&auml;rd, chauff&ouml;r, servit&ouml;r, fuktion&auml;r eller kanske medhj&auml;lpare till ovanst&aring;ende poster; Skicka din intresseanm&auml;lan redan nu!</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321541517),(94,'student.larvcrew','<h1>\n	LARV-Crew</h1>\n<p>\n	Projektgruppen best&aring;r av ett tio-tal studenter som jobbar ideellt med LARV ut&ouml;ver sina studier. Varje person i projektgruppen har huvudansvar &ouml;ver ett omr&aring;de men g&ouml;r &auml;ven st&ouml;rre &ouml;vergripande saker inom projektet. Projektgruppen rekryteras av projektledaren.</p>\n<p>\n	Projektgruppen skall v&auml;rna om LARV:s vision och syfte samt att r&auml;tta sig efter policyn f&ouml;r grafisk form och kommunikation som finns f&ouml;r LARV. Projektgruppsmedlemmarna v&auml;ljer &auml;ven medhj&auml;lpare som kompletterar projektgruppsmedlemmen samt har n&aring;got att tillf&ouml;ra projektet. Antalet medhj&auml;lpare best&auml;ms i samr&aring;d med projektledaren.</p>\n<p>\n	Ut&ouml;ver detta finns sen ytterligare f&ouml;retagsv&auml;rdar, chauff&ouml;rer, serveringspersonal och m&aring;nga andra som hj&auml;lper till.</p>\n<h2>\n	Postbeskrivning f&ouml;r LARV2012-projektgrupp&nbsp;</h2>\n<div>\n	<p>\n		LARV best&aring;r av m&aring;nga delprojekt som tillsammans utg&ouml;r den arbetsmarknadsvecka som &aring;rligen ger oss en ov&auml;rderlig kontakt med framtida arbetsgivare. LARV blir vad vi g&ouml;r det till! LARV projektgrupp beh&ouml;ver dig som har tankar och id&eacute;er, &auml;r kreativ eller strategiskt lagd. Har god planeringsf&ouml;rm&aring;ga, &auml;r en probleml&ouml;sare eller riktig &rdquo;vinnarskalle&rdquo;. Skaffa dig erfarenhet och ett bredare n&auml;tverk... f&ouml;r att inte tala om den d&auml;r extra kryddan till ditt CV.</p>\n	<p>\n		<strong>PR-ansvarig;</strong> som marknadsf&ouml;ringsansvarig &auml;r du den som planerar inf&ouml;r- och leder dem som marknadsf&ouml;r LARV s&aring;v&auml;l inom som utanf&ouml;r universitetets v&auml;ggar. Du har n&auml;ra kontakt med grafisk form och andra samarbetspartners under hela projektets g&aring;ng.</p>\n	<p>\n		<strong>Grafiskform;</strong> du som s&ouml;ker har ett &ouml;ga f&ouml;r f&auml;rg och form och sk&ouml;ter b&aring;de den grafiska profilen, utformning av exempelvis namnskyltar och annan rekvisita, roll-ups, tryck och profilprodukter. Du tr&auml;nar inte bara dina f&auml;rdigheter i formgivning utan &auml;ven samarbete och planering.</p>\n	<p>\n	