under hela projektets g&aring;ng.</p>\n	<p>\n		<strong>Grafiskform;</strong> du som s&ouml;ker har ett &ouml;ga f&ouml;r f&auml;rg och form och sk&ouml;ter b&aring;de den grafiska profilen, utformning av exempelvis namnskyltar och annan rekvisita, roll-ups, tryck och profilprodukter. Du tr&auml;nar inte bara dina f&auml;rdigheter i formgivning utan &auml;ven samarbete och planering.</p>\n	<p>\n		<strong>IT-ansvarig;</strong>&nbsp;LARV beh&ouml;ver, inte bara h&auml;nga med i sv&auml;ngarna, utan visa framf&ouml;tterna! Larvhemsidan &auml;r v&aring;r f&ouml;rsta kontakt med f&ouml;retagen. Visa vad en LTU-student g&aring;r f&ouml;r - utveckla LARVhemsidan. Du har &auml;ven m&ouml;jlighet att leda andra i den grupp du sj&auml;lv uppr&auml;ttar f&ouml;r jobbet och har &auml;ven ansvar f&ouml;r wifi p&aring; m&auml;ssan.</p>\n	<p>\n		<strong>Katalogansvarig;&nbsp;</strong>LARVkatalogen &auml;r, &auml;ven den, en stor puck i arbetet med LARV. Du ser till att s&aring;v&auml;l f&ouml;retagen som studenterna &auml;r n&ouml;jda med katalogens inneh&aring;ll vilken s&aring;v&auml;l informerar som f&ouml;rbereder studenten. &nbsp;Hur ser katalogen ut fram&ouml;ver? Tryckt, p&aring; webben eller i en app? H&auml;nger vi med i utvecklingen?</p>\n	<p>\n		<strong>M&auml;ssbyggnadsansvarig;</strong>&nbsp;har du koll p&aring; inredning och gott flyt? M&auml;ssan beh&ouml;ver god planering av montrar, tillg&aring;ng till lokaler och n&auml;tverk, god ventilation och n&aring;gon som har t&auml;nkt p&aring; s&auml;kerheten!</p>\n	<p>\n		<strong>Logistikansvarig;&nbsp;</strong>en hel del gods fraktas under detta event fr&aring;n punkt A till B, &auml;r du den som kan logistik? Du har d&aring; &auml;ven hand om hyrt material och direkt kontakt med s&aring;v&auml;l f&ouml;retag som f&ouml;retagsv&auml;rdar och k&aring;rer p&aring; andra orter.</p>\n	<p>\n		<strong>Transportansvarig;</strong>&nbsp;Dina ansvarsomr&aring;den t&auml;cker bokning, planering och ansvar &ouml;ver bokningssystemet f&ouml;r bussar, taxiverksamhet och de chauff&ouml;rer som slussar s&aring;v&auml;l f&ouml;retagsrepresentanter som off-campusstudenter till och fr&aring;n LARV.</p>\n	<p>\n		<strong>Receptionsansvarig;</strong>&nbsp;med god planeringsf&ouml;rm&aring;ga och ditt ansvar &ouml;ver de personliga samtalen ser du till att studenter och f&ouml;retagen kommer varandra riktigt n&auml;ra. Dessutom ser du till att guida s&aring;v&auml;l f&ouml;retag som studenter r&auml;tt under m&auml;ssdagen och planerar f&ouml;r tillg&aring;ng av fika och lunch.</p>\n	<p>\n		<strong>Bankettansvarig;</strong>&nbsp;efter m&auml;ssan tr&auml;ffas f&ouml;retagare och studenter under mer avslappnade former. Som bankettansvarig organiserar du underh&aring;llning, &rdquo;eftersl&auml;pp&rdquo;, mat och personal. Tar fram offerter och ordnar med dekorationer. Du har &auml;ven ansvar f&ouml;r &rdquo;kv&auml;llen f&ouml;re&rdquo;.</p>\n	<p>\n		<strong>Eventansvarig;</strong>&nbsp;LARV best&aring;r av f&ouml;r- och efterevent med en del festliga inslag, f&ouml;rel&auml;sningar och andra evenemang. Du sk&ouml;ter kontakten med f&ouml;rel&auml;sarna, kommer upp med nya id&eacute;er och sk&ouml;ter bokning av s&aring;v&auml;l mat och lokal. &nbsp;&nbsp;</p>\n	<p>\n		<strong>Sponsoransvarig;&nbsp;</strong>som ansvarig f&ouml;r spons &auml;r det du som knyter kontakten och f&ouml;rhandlar med sponsorer s&aring; att LARV har tillg&aring;ng till bland annat bilar och rekvisita. Du kontrollerar &auml;ven att avtal efterf&ouml;ljs och sponsorer synligg&ouml;rs som avtalat.</p>\n	<p>\n		<strong>M&auml;ssv&auml;rd;</strong> m&auml;ssv&auml;rden rekryterar, informerar och matchar f&ouml;retagsv&auml;rdar med f&ouml;retag. Inf&ouml;r och under m&auml;ssan &auml;r det v&auml;rden som leder f&ouml;retagsv&auml;rdarna och ser till att v&auml;rdarna kan besvara f&ouml;retagens fr&aring;gor.</p>\n	<p>\n		<strong>Internationell kontakt;</strong>&nbsp;m&aring;nga studenter &auml;r sugna p&aring; internationell karri&auml;r &ndash; s&aring; &auml;ven utbytesstudenter som nu vistas p&aring; LTU. M&aring;nga f&ouml;retag &auml;r globala. S&ouml;k hit om du &auml;r sugen p&aring; spela en viktig roll f&ouml;r s&aring;v&auml;l f&ouml;retag som studenter!</p>\n	<p>\n		<strong>LARV-CREW:</strong> Du som vill vara del av LARV-CREW och agera f&ouml;retagsv&auml;rd, chauff&ouml;r, servit&ouml;r, fuktion&auml;r eller kanske medhj&auml;lpare till ovanst&aring;ende poster; Skicka din intresseanm&auml;lan redan nu!</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321541534),(96,'student.personligasamtal','<h1>\n	Personliga Samtal</h1>\n<p>\n	En del av de f&ouml;retag som bes&ouml;ker m&auml;ssan erbjuder personliga samtal f&ouml;r studenter. Samtalet ger en n&auml;rmare kontakt med f&ouml;retaget &auml;n vad ett samtal vid montern ger, men det st&auml;ller ocks&aring; h&ouml;gre krav p&aring; studenten d&aring; det &auml;r mer planerat &auml;n bes&ouml;ket vid montern.</p>',1,1321542860),(97,'student.aktiviteter','<h1>\n	Aktiviteter</h1>\n<p>\n	Det kommer f&ouml;rutom sj&auml;lva m&auml;ssan &auml;ven att anordnas ett antal andra event, t.ex f&ouml;rel&auml;sningar.&nbsp;</p>\n<p>\n	Mer information om dessa kommer att publiceras n&auml;rmare m&auml;ssan.</p>',1,1321543082),(98,'student.faq','<p>\n	&nbsp;</p>\n<h1>\n	Vanliga fr&aring;gor om att arbeta p&aring; LARV</h1>\n<p>\n	<strong>Varf&ouml;r ska man jobba som v&auml;rd p&aring; LARV2012?</strong></p>\n<p>\n	Svar: Att jobba som v&auml;rd p&aring; LARV &auml;r roligt. Du f&aring;r inblick i hur arbetet med att arrangera en arbetsmarknadsm&auml;ssa fungerar. Du f&aring;r tr&auml;ffa mycket nytt folk, b&aring;de studenter fr&aring;n olika program och &aring;rskurser samt f&ouml;retagsrepresentanter. Dessutom f&aring;r du g&aring; p&aring; en hejdundrandes bankett.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vem kan s&ouml;ka till v&auml;rd?</strong></p>\n<p>\n	Svar: Alla som pluggar p&aring; LTU kan s&ouml;ka till v&auml;rd, oavsett &aring;rskurs, program och k&aring;rtillh&ouml;righet. Du m&aring;ste d&auml;remot vara medlem i n&aring;gon utav k&aring;rerna.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Hur s&ouml;ker man till v&auml;rd?</strong></p>\n<p>\n	Svar: Under fliken &quot;Anm&auml;lan arbeta med LARV&quot; kommer man framtill 20 december, kunna s&ouml;ka till v&auml;rd. Det &auml;r inte f&ouml;rst till kvarn som g&auml;ller utan alla som skickar in sin ans&ouml;kan kommer ha lika stor chans.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Ska jag skicka med betyg eller CV?</strong></p>\n<p>\n	Svar: Du beh&ouml;ver inte skicka in betyg eller CV, det r&auml;cker med att fylla i uppgifterna i anm&auml;lningsformul&auml;ret.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>N&auml;r &auml;r sista dagen man kan s&ouml;ka?</strong></p>\n<p>\n	Svar: Sista dagen &auml;r 20 december klockan 24.00</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vilka olika typer av arbeten kan man s&ouml;ka?</strong></p>\n<p>\n	Svar: De olika v&auml;rdarna &auml;r f&ouml;retagsv&auml;rd, chauff&ouml;r, m&auml;ssv&auml;rd, event, gods och inredning. Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa mer om vad respektive arbete inneb&auml;r</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vad f&aring;r man n&auml;r man jobbar som v&auml;rd?</strong></p>\n<p>\n	Svar: Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa vad respektive v&auml;rd f&aring;r f&ouml;r sitt arbete p&aring; LARV2012. Under m&auml;ssan f&aring;r man ocks&aring; fika och lunch b&aring;da dagarna.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>N&auml;r ska man jobba?</strong></p>\n<p>\n	Svar: Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa n&auml;r respektive v&auml;rd ska jobba.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vad ska man ha p&aring; sig n&auml;r man jobbar?</strong></p>\n<p>\n	Svar: Alla som jobbar med LARV kommer att f&aring; en pik&eacute;tr&ouml;ja att jobba i.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	Har du ytterligare fr&aring;gor, maila info@larv.org</p>',1,1321543546),(99,'student.faq','<h1>\n	Vanliga fr&aring;gor om att arbeta p&aring; LARV</h1>\n<p>\n	<strong>Varf&ouml;r ska man jobba som v&auml;rd p&aring; LARV2012?</strong></p>\n<p>\n	Svar: Att jobba som v&auml;rd p&aring; LARV &auml;r roligt. Du f&aring;r inblick i hur arbetet med att arrangera en arbetsmarknadsm&auml;ssa fungerar. Du f&aring;r tr&auml;ffa mycket nytt folk, b&aring;de studenter fr&aring;n olika program och &aring;rskurser samt f&ouml;retagsrepresentanter. Dessutom f&aring;r du g&aring; p&aring; en hejdundrandes bankett.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vem kan s&ouml;ka till v&auml;rd?</strong></p>\n<p>\n	Svar: Alla som pluggar p&aring; LTU kan s&ouml;ka till v&auml;rd, oavsett &aring;rskurs, program och k&aring;rtillh&ouml;righet. Du m&aring;ste d&auml;remot vara medlem i n&aring;gon utav k&aring;rerna.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Hur s&ouml;ker man till v&auml;rd?</strong></p>\n<p>\n	Svar: Under fliken &quot;Anm&auml;lan arbeta med LARV&quot; kommer man framtill 20 december, kunna s&ouml;ka till v&auml;rd. Det &auml;r inte f&ouml;rst till kvarn som g&auml;ller utan alla som skickar in sin ans&ouml;kan kommer ha lika stor chans.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Ska jag skicka med betyg eller CV?</strong></p>\n<p>\n	Svar: Du beh&ouml;ver inte skicka in betyg eller CV, det r&auml;cker med att fylla i uppgifterna i anm&auml;lningsformul&auml;ret.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>N&auml;r &auml;r sista dagen man kan s&ouml;ka?</strong></p>\n<p>\n	Svar: Sista dagen &auml;r 20 december klockan 24.00</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vilka olika typer av arbeten kan man s&ouml;ka?</strong></p>\n<p>\n	Svar: De olika v&auml;rdarna &auml;r f&ouml;retagsv&auml;rd, chauff&ouml;r, m&auml;ssv&auml;rd, event, gods och inredning. Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa mer om vad respektive arbete inneb&auml;r</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vad f&aring;r man n&auml;r man jobbar som v&auml;rd?</strong></p>\n<p>\n	Svar: Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa vad respektive v&auml;rd f&aring;r f&ouml;r sitt arbete p&aring; LARV2012. Under m&auml;ssan f&aring;r man ocks&aring; fika och lunch b&aring;da dagarna.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>N&auml;r ska man jobba?</strong></p>\n<p>\n	Svar: Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa n&auml;r respektive v&auml;rd ska jobba.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vad ska man ha p&aring; sig n&auml;r man jobbar?</strong></p>\n<p>\n	Svar: Alla som jobbar med LARV kommer att f&aring; en pik&eacute;tr&ouml;ja att jobba i.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	Har du ytterligare fr&aring;gor, maila info@larv.org</p>',1,1321543553),(100,'student','<h1>\n	Studenter</h1>\n<p>\n	Lule&aring; ARbetsmarknads Vecka, <strong>LARV</strong>, &auml;r din chans att m&ouml;ta intressanta f&ouml;retag p&aring; n&auml;ra h&aring;ll. Genom att ta f&ouml;retagen till skolan, en milj&ouml; m&aring;nga studenter k&auml;nner sig som hemma i, ges en chans att utan press etablera en kontakt med ditt dr&ouml;mf&ouml;retag.</p>\n<p>\n	Vi ger dig b&aring;de tillf&auml;lle att tr&auml;ffa f&ouml;retagen och kommer &auml;ven att anordna f&ouml;rel&auml;sningar om hur just du kan &ouml;ka dina chanser till framtida arbete.</p>\n<p>\n	H&aring;ll ett &ouml;ga &ouml;ppet s&aring; ska du se att det kommer mer information efterhand.</p>\n<p>\n	Vill du &ouml;ka dina chanser &auml;nnu mer kan du alltid <a href=\"/student/crewregister/\">Anm&auml;la ditt intresse</a>&nbsp;f&ouml;r att arbeta som funktion&auml;r p&aring; m&auml;ssan.</p>\n<h2>\n	Onsdagen den 25e januari &auml;r det dags! LARV firar 30!&nbsp;</h2>\n<p>\n	Onsdagen den <strong>25e januari</strong>&nbsp;h&aring;lls en m&auml;ssa med f&ouml;retag fr&aring;n hela landet.&nbsp;</p>\n<p>\n	F&ouml;r att l&auml;ra mer om hur LARV fungerar och vad som sker och erbjuds dig varesig du &auml;r student eller f&ouml;retag, l&auml;s mer under flikarna i menyn!&nbsp;</p>\n<h2>\n	Varf&ouml;r bes&ouml;ka LARV?</h2>\n<p>\n	M&aring;nga LTU-studenter har flyttat l&aring;ngv&auml;ga f&ouml;r sina studier och drar sig heller inte f&ouml;r att g&ouml;ra det igen. De kan antas ha kommit en bra bit i mognadsprocessen mycket tack vare detta. Som student vid LTU &auml;r man &auml;ven van att arbeta i projekt och finnes ofta sj&auml;lvst&auml;ndiga och jordn&auml;ra.&nbsp;</p>\n<p>\n	M&aring;nga studenter engagerar sig &auml;ven i k&aring;rer, sektioner och egna projekt och det finns &auml;ven en god andel som under studietiden startar eget...</p>\n<p>\n	V&auml;lkommen till LARV!</p>\n<h2>\n	Nytt f&ouml;r i &aring;r!&nbsp;</h2>\n<p>\n	LARV 2012 anordnas f&ouml;r 30 &aring;ret i rad och f&ouml;r att fira detta l&auml;ggs det extra krut f&ouml;r att g&ouml;ra just LARV 2012 till det b&auml;sta hittills!&nbsp;</p>\n<p>\n	LARV siktar &aring;ter p&aring; att generera v&auml;rdefulla evenemang under en veckas tid f&ouml;r att du som student eller arbetsgivare ska f&aring; ett lyckat m&ouml;te under m&auml;ssdagen. Med f&ouml;rel&auml;sningar, presentationer, nya tj&auml;nster s&aring; som montermontering eller annonsering i den interaktiva webbkatalog som skapas finns m&aring;nga m&ouml;jligheter till synlighet inf&ouml;r LARV. Samarbete med det campusbel&auml;gna gymmet Stil inneb&auml;r m&ouml;jlighet till &ouml;kad exponering och m&ouml;te med studenter &auml;ven innan LARV. L&auml;s mer nedan.&nbsp;</p>\n<p>\n	LARV 2012 &auml;r m&auml;ssan Ni inte f&aring;r missa i &aring;r!&nbsp;</p>\n<h2>\n	&nbsp;</h2>',1,1321544017),(101,'foretag','<h1>\n	Om Larv</h1>\n<p>\n	Syftet med LARV &auml;r att fungera som en plattform f&ouml;r kontakt mellan student och f&ouml;retag.&nbsp;</p>\n<p>\n	Lule&aring; ARbetsmarknadsVecka, LARV, arrangeras av Teknologk&aring;ren vid Lule&aring; Tekniska Universitet f&ouml;r medlemmar, i f&ouml;rsta hand.&nbsp;</p>\n<p>\n	Under en veckas tid arrangeras evenemang f&ouml;r att det fysiska m&ouml;tet p&aring; m&auml;ss-dagen ska bli s&aring; v&auml;rdefullt det g&aring;r, f&ouml;r b&aring;da parter!&nbsp;</p>\n<p>\n	LARV blir m&ouml;jligt tack vare <strong>Teknologk&aring;rens medlemmar</strong>; den <strong>projektgrupp</strong> som varje &aring;r g&ouml;r sitt allt f&ouml;r att f&ouml;rvekliga projektet och givetvis v&aring;ra <strong>g&auml;stande f&ouml;retag</strong>&nbsp;och <strong>samarbetspartners!</strong></p>\n<p>\n	<em>S&ouml;ker du LARV-projektgrupp, l&auml;s mer under <a href=\"http://www.larv.org/kontakt\">Kontakt</a>.</em></p>\n<h2>\n	Onsdagen den 25e januari &auml;r det dags! LARV firar 30!&nbsp;</h2>\n<p>\n	Onsdagen den&nbsp;<strong>25e januari</strong>&nbsp;h&aring;lls en m&auml;ssa med f&ouml;retag fr&aring;n hela landet.&nbsp;</p>\n<p>\n	F&ouml;r att l&auml;ra mer om hur LARV fungerar och vad som sker och erbjuds dig varesig du &auml;r student eller f&ouml;retag, l&auml;s mer under flikarna i menyn!&nbsp;</p>\n<h2>\n	Varf&ouml;r bes&ouml;ka LARV?</h2>\n<p>\n	M&aring;nga LTU-studenter har flyttat l&aring;ngv&auml;ga f&ouml;r sina studier och drar sig heller inte f&ouml;r att g&ouml;ra det igen. De kan antas ha kommit en bra bit i mognadsprocessen mycket tack vare detta. Som student vid LTU &auml;r man &auml;ven van att arbeta i projekt och finnes ofta sj&auml;lvst&auml;ndiga och jordn&auml;ra.&nbsp;</p>\n<p>\n	M&aring;nga studenter engagerar sig &auml;ven i k&aring;rer, sektioner och egna projekt och det finns &auml;ven en god andel som under studietiden startar eget...</p>\n<p>\n	V&auml;lkommen till LARV!</p>\n<h2>\n	Nytt f&ouml;r i &aring;r!&nbsp;</h2>\n<p>\n	LARV 2012 anordnas f&ouml;r 30 &aring;ret i rad och f&ouml;r att fira detta l&auml;ggs det extra krut f&ouml;r att g&ouml;ra just LARV 2012 till det b&auml;sta hittills!&nbsp;</p>\n<p>\n	LARV siktar &aring;ter p&aring; att generera v&auml;rdefulla evenemang under en veckas tid f&ouml;r att du som student eller arbetsgivare ska f&aring; ett lyckat m&ouml;te under m&auml;ssdagen. Med f&ouml;rel&auml;sningar, presentationer, nya tj&auml;nster s&aring; som montermontering eller annonsering i den interaktiva webbkatalog som skapas finns m&aring;nga m&ouml;jligheter till synlighet inf&ouml;r LARV. Samarbete med det campusbel&auml;gna gymmet Stil inneb&auml;r m&ouml;jlighet till &ouml;kad exponering och m&ouml;te med studenter &auml;ven innan LARV. L&auml;s mer nedan.&nbsp;</p>\n<p>\n	LARV 2012 &auml;r m&auml;ssan Ni inte f&aring;r missa i &aring;r!&nbsp;</p>\n<p>\n	&nbsp;</p>\n<h2>\n	Samarbeten med Stil Alpina</h2>\n<p>\n	<strong>Annonsering i Stil Alpinas resekatalog &auml;r inte l&auml;ngre m&ouml;jlig.</strong>&nbsp;&Auml;r ni intresserade av detta erbjudande f&ouml;r kommande &aring;r v&auml;nligen skriv ett mail med &auml;mnet ALPINA till ao@teknologkaren.se</p>\n<p>\n	&Auml;n finns det d&auml;remot &auml;nnu m&ouml;jlighet att delta i monterevenemang &nbsp;innan LARV f&ouml;r att ytterligare locka till just er monter d&aring; m&auml;ssdagen anl&auml;nder. Kanske ni &auml;ven intresserar er f&ouml;r att synas i samband med n&aring;gon av de m&aring;nga&nbsp;alpina resorna som anordnas.</p>\n<p>\n	F&ouml;r mer information om detta erbjudande; v&auml;nligen kontakta projektledare f&ouml;r LARV per telefon; 0706 862 585</p>',1,1321544060),(102,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV &auml;r:</p>\n<ul>\n	<li>\n		<p>\n			Skjuts till boende eller Campus vid ankomst till Lule&aring;</p>\n	</li>\n	<li>\n		<p>\n			Skjuts till och fr&aring;n boende vid deltagande p&aring; &quot;kv&auml;llen f&ouml;re&quot; och m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			Monteryta: 3*2 m, h&ouml;jd; 3m</p>\n	</li>\n	<li>\n		<p>\n			F&ouml;retagsv&auml;rd som underst&ouml;djer arbetet f&ouml;r just Ert f&ouml;retag inf&ouml;r och under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			2 biljetter till lunch, fika och &nbsp;LARVbankett</p>\n	</li>\n	<li>\n		<p>\n			Uppslag i m&auml;sskatalog(webbaserad)</p>\n	</li>\n	<li>\n		<p>\n			Tr&aring;dl&ouml;s internetuppkoppling</p>\n	</li>\n	<li>\n		<p>\n			El</p>\n	</li>\n	<li>\n		<p>\n			M&ouml;jlighet till personliga samtal med utvalda studenter</p>\n	</li>\n	<li>\n		<p>\n			Tilltr&auml;de till &quot;Kv&auml;llen F&ouml;re&quot;</p>\n	</li>\n</ul>\n<p>\n	Givetvis finns det m&ouml;jlighet att &ouml;ka p&aring; paketet med;</p>\n<ul>\n	<li>\n		<p>\n			Ut&ouml;kad monteryta</p>\n	</li>\n	<li>\n		<p>\n			Fler biljetter; lunch, fika, bankett&lt;/li&gt;</p>\n	</li>\n	<li>\n		<p>\n			Rekvisita; stolar, bord, mattor, blommor&lt;/li&gt;</p>\n	</li>\n	<li>\n		<p>\n			Monterevenemang(1 dec 2011) eller synlighet i samband med Alpinaresa innan LARV (Kontakt med projektledare per telefon; 0706862585</p>\n	</li>\n	<li>\n		<p>\n			Monterupps&auml;ttning</p>\n	</li>\n	<li>\n		<p>\n			Spridning av utv&auml;rdering; antingen v&aring;r eller en vi tillsammans uppr&auml;ttar s&auml;rskilt f&ouml;r LARV&nbsp;</p>\n	</li>\n	<li>\n		<p>\n			Delgivning av V&aring;r utv&auml;rdering i n&auml;ra anslutning till avslutat LARV</p>\n	</li>\n</ul>',1,1321544087),(103,'foretag.signup','<h1>\n	Arbetsmarknadsdagar.se</h1>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat att f&ouml;renkla f&ouml;r f&ouml;retag att genomf&ouml;ra anm&auml;lningar till de olika m&auml;ssorna. P&aring; arbetsmarknadsdagar.se kan f&ouml;retag idag spara information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en FAQ som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<p>\n	<strong>Anm&auml;lan har st&auml;ngt f&ouml;r i &aring;r.</strong></p>\n<div>\n	<a href=\"http://www.arbetsmarknadsdagar.se/\">Till Arbetsmarknadsdagar.se</a></div>\n<div>\n	&nbsp;</div>\n<h2>\n	Fullst&auml;ndig anm&auml;lan</h2>\n<div>\n	<p>\n		Fullst&auml;ndig anm&auml;lan inneh&aring;ller exakta uppgifter och kan l&auml;mnas som senast en m&aring;nad innan m&auml;ssan.&nbsp;</p>\n	<p>\n		<strong>Den fullst&auml;ndiga anm&auml;lan &ouml;ppnar 2012.11.03</strong></p>\n	<p>\n		<strong>Sista anm&auml;lningsdatum &auml;r 2012.11.25</strong></p>\n	<p>\n		&nbsp;</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321544222),(104,'foretag.reftecarg','<h1>\n	Reftec och ARG</h1>\n<p>\n	&nbsp;</p>\n<p>\n	Reftec &auml;r en politiskt och religi&ouml;st obunden samarbetsorganisation, skapad mellan teknolog- och naturvetark&aring;rer fr&aring;n de sju st&ouml;rsta teknologl&auml;ros&auml;tena i Sverige. Dessa &auml;r bel&auml;gna p&aring; orterna G&ouml;teborg, Lule&aring;, Lund, Link&ouml;ping, Stockholm, Ume&aring; och Uppsala. Syftet &auml;r att tillvarata medlemmarnas gemensamma intressen samt att verka f&ouml;r utbyte pch god sammanh&aring;llning mellan medlemmarna.</p>\n<p>\n	ARG (Arbetsmakrnadsgruppen) &auml;r en undergrupp inom Reftec och best&aring;r av studenter som p&aring; hel- eller deltid arbetar med arbetsmarknadsfr&aring;gor och m&auml;ssor p&aring; respektive l&auml;ros&auml;te och k&aring;r. ARG &auml;r ett forum f&ouml;r erfarenhetsutbyte och &aring;siktsbildning r&ouml;rande arbetsmarknadsfr&aring;gor och best&aring;r av en till tv&aring; representanter fr&aring;n vardera k&aring;r. ARG sammantr&auml;der sex till tio g&aring;nger per &aring;r, oftast i samverkan med n&aring;got av Sveriges ledande storf&ouml;retag.</p>\n<p>\n	Under v&aring;ren genomf&ouml;r ARG en &aring;rlig utvecklingskonferens till vilken samarbetsf&ouml;retag bjuds in. Syftet &auml;r att utv&auml;rdera de under &aring;ret genomf&ouml;rda arbetsmarknadsarrangemangen vid k&aring;rerna samt diskutera framtida utveckling.</p>\n<p>\n	arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet inom ARG med syftet att underl&auml;tta f&ouml;r anm&auml;lningar till m&auml;ssor p&aring; samtliga l&auml;ros&auml;ten. Ett &ouml;nskem&aring;l fr&aring;n m&aring;nga f&ouml;retag.</p>\n<p>\n	De studentk&aring;rer som utg&ouml;r ARG &auml;r:</p>\n<ul>\n	<li>\n		<p>\n			Chalmers Studentk&aring;r</p>\n	</li>\n	<li>\n		<p>\n			LinTek, Tekniska H&ouml;gskolan vid Link&ouml;pings Universitet</p>\n	</li>\n	<li>\n		<p>\n			Tekniska H&ouml;gskolans Studentk&aring;r</p>\n	</li>\n	<li>\n		<p>\n			Teknologk&aring;ren vid Lule&aring; Tekniska Universitet</p>\n	</li>\n	<li>\n		<p>\n			Teknologk&aring;ren vid Lunds Tekniska H&ouml;gskola</p>\n	</li>\n	<li>\n		<p>\n			Ume&aring; naturvetar- och teknologk&aring;r</p>\n	</li>\n	<li>\n		<p>\n			Uppsala Natur- och Teknologk&aring;r</p>\n	</li>\n</ul>\n<p>\n	F&ouml;r mer information se: <a href=\"http://www.arbetsmarknadsdagar.se/\">http://www.arbetsmarknadsdagar.se/</a></p>',1,1321544276),(105,'foretag.reftecarg','<h1>\n	Reftec och ARG</h1>\n<p>\n	Reftec &auml;r en politiskt och religi&ouml;st obunden samarbetsorganisation, skapad mellan teknolog- och naturvetark&aring;rer fr&aring;n de sju st&ouml;rsta teknologl&auml;ros&auml;tena i Sverige. Dessa &auml;r bel&auml;gna p&aring; orterna G&ouml;teborg, Lule&aring;, Lund, Link&ouml;ping, Stockholm, Ume&aring; och Uppsala. Syftet &auml;r att tillvarata medlemmarnas gemensamma intressen samt att verka f&ouml;r utbyte pch god sammanh&aring;llning mellan medlemmarna.</p>\n<p>\n	ARG (Arbetsmakrnadsgruppen) &auml;r en undergrupp inom Reftec och best&aring;r av studenter som p&aring; hel- eller deltid arbetar med arbetsmarknadsfr&aring;gor och m&auml;ssor p&aring; respektive l&auml;ros&auml;te och k&aring;r. ARG &auml;r ett forum f&ouml;r erfarenhetsutbyte och &aring;siktsbildning r&ouml;rande arbetsmarknadsfr&aring;gor och best&aring;r av en till tv&aring; representanter fr&aring;n vardera k&aring;r. ARG sammantr&auml;der sex till tio g&aring;nger per &aring;r, oftast i samverkan med n&aring;got av Sveriges ledande storf&ouml;retag.</p>\n<p>\n	Under v&aring;ren genomf&ouml;r ARG en &aring;rlig utvecklingskonferens till vilken samarbetsf&ouml;retag bjuds in. Syftet &auml;r att utv&auml;rdera de under &aring;ret genomf&ouml;rda arbetsmarknadsarrangemangen vid k&aring;rerna samt diskutera framtida utveckling.</p>\n<p>\n	arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet inom ARG med syftet att underl&auml;tta f&ouml;r anm&auml;lningar till m&auml;ssor p&aring; samtliga l&auml;ros&auml;ten. Ett &ouml;nskem&aring;l fr&aring;n m&aring;nga f&ouml;retag.</p>\n<p>\n	De studentk&aring;rer som utg&ouml;r ARG &auml;r:</p>\n<ul>\n	<li>\n		<p>\n			Chalmers Studentk&aring;r</p>\n	</li>\n	<li>\n		<p>\n			LinTek, Tekniska H&ouml;gskolan vid Link&ouml;pings Universitet</p>\n	</li>\n	<li>\n		<p>\n			Tekniska H&ouml;gskolans Studentk&aring;r</p>\n	</li>\n	<li>\n		<p>\n			Teknologk&aring;ren vid Lule&aring; Tekniska Universitet</p>\n	</li>\n	<li>\n		<p>\n			Teknologk&aring;ren vid Lunds Tekniska H&ouml;gskola</p>\n	</li>\n	<li>\n		<p>\n			Ume&aring; naturvetar- och teknologk&aring;r</p>\n	</li>\n	<li>\n		<p>\n			Uppsala Natur- och Teknologk&aring;r</p>\n	</li>\n</ul>\n<p>\n	F&ouml;r mer information se: <a href=\"http://www.arbetsmarknadsdagar.se/\">http://www.arbetsmarknadsdagar.se/</a></p>',1,1321544281),(106,'foretag.samarbeten','<h1>\n	Samarbeten och kringarrangemang</h1>\n<p>\n	&nbsp;</p>\n<p>\n	Under LARV erbjuds studenter delta i olika evenemang kopplade till m&auml;ssdagen. P&aring; olika former erbjuds hj&auml;lp till CV-skrivning, t&auml;vlingar eller st&ouml;ttning inf&ouml;r det kommande m&ouml;tet med en potentiell arbetsgivare.</p>\n<p>\n	Aktiviteterna avser fungera s&aring;v&auml;l inspirerande som f&ouml;rberedande!&nbsp;</p>\n<h2>\n	Hur ser samarbetet ut?</h2>\n<p>\n	Tillsammans med samarbetspartners planeras, marknadsf&ouml;rs och genomf&ouml;rs dessa arrangemang som &auml;r mycket uppskattade av studenterna. Allt i fr&aring;n presentationer till workshops anordnas. Har ni tankar p&aring; hur ni vill tr&auml;ffa studenterna p&aring; LTU? Vi har en uppsj&ouml; av f&ouml;rslag p&aring; arrangemang f&ouml;r den som &auml;r sugen p&aring; att arrangera evenemang som lockar intressanta m&aring;lgrupper.&nbsp;</p>\n<h2>\n	Huvudsamarbetspartners</h2>\n<p>\n	Varje &aring;r erbjuds m&ouml;jligheten att vara huvudsamarbetspartner till LARV. Vi utvecklar d&aring; ett samarbete vilket skr&auml;ddarsys efter &ouml;nskningar fr&aring;n b&aring;da parter. Utan huvudsamarbetspartners skulle LARV inte ha samma m&ouml;jlighet till den goda utveckling den nu har.&nbsp;</p>\n<p>\n	Samarbetet inneb&auml;r mer &auml;n den extra synlighet som f&ouml;retaget f&aring;r med logotyp i samtliga sammanhang; p&aring; f&ouml;retagsv&auml;rdstr&ouml;jorna som syns runt om p&aring; m&auml;ssan, profilprodukter, hemsidan och katalogen.&nbsp;</p>\n<p>\n	Med en huvudsamarbetspartner uppr&auml;ttas f&ouml;raktiviteter inf&ouml;r m&auml;ssan och fler tillf&auml;llen till fysiska tr&auml;ffar med studenter. Givetvis ser vi &auml;ven att huvudsamarbetspartnern talar p&aring; banketten.&nbsp;</p>',1,1321544477),(107,'foretag.samarbeten','<h1>\n	Samarbeten och kringarrangemang</h1>\n<p>\n	Under LARV erbjuds studenter delta i olika evenemang kopplade till m&auml;ssdagen. P&aring; olika former erbjuds hj&auml;lp till CV-skrivning, t&auml;vlingar eller st&ouml;ttning inf&ouml;r det kommande m&ouml;tet med en potentiell arbetsgivare.</p>\n<p>\n	Aktiviteterna avser fungera s&aring;v&auml;l inspirerande som f&ouml;rberedande!&nbsp;</p>\n<h2>\n	Hur ser samarbetet ut?</h2>\n<p>\n	Tillsammans med samarbetspartners planeras, marknadsf&ouml;rs och genomf&ouml;rs dessa arrangemang som &auml;r mycket uppskattade av studenterna. Allt i fr&aring;n presentationer till workshops anordnas. Har ni tankar p&aring; hur ni vill tr&auml;ffa studenterna p&aring; LTU? Vi har en uppsj&ouml; av f&ouml;rslag p&aring; arrangemang f&ouml;r den som &auml;r sugen p&aring; att arrangera evenemang som lockar intressanta m&aring;lgrupper.&nbsp;</p>\n<h2>\n	Huvudsamarbetspartners</h2>\n<p>\n	Varje &aring;r erbjuds m&ouml;jligheten att vara huvudsamarbetspartner till LARV. Vi utvecklar d&aring; ett samarbete vilket skr&auml;ddarsys efter &ouml;nskningar fr&aring;n b&aring;da parter. Utan huvudsamarbetspartners skulle LARV inte ha samma m&ouml;jlighet till den goda utveckling den nu har.&nbsp;</p>\n<p>\n	Samarbetet inneb&auml;r mer &auml;n den extra synlighet som f&ouml;retaget f&aring;r med logotyp i samtliga sammanhang; p&aring; f&ouml;retagsv&auml;rdstr&ouml;jorna som syns runt om p&aring; m&auml;ssan, profilprodukter, hemsidan och katalogen.&nbsp;</p>\n<p>\n	Med en huvudsamarbetspartner uppr&auml;ttas f&ouml;raktiviteter inf&ouml;r m&auml;ssan och fler tillf&auml;llen till fysiska tr&auml;ffar med studenter. Givetvis ser vi &auml;ven att huvudsamarbetspartnern talar p&aring; banketten.&nbsp;</p>',1,1321544486),(108,'foretag.evenemang','<p>\n	&nbsp;</p>\n<div>\n	<h1>\n		Kv&auml;llen F&ouml;re</h1>\n	<p>\n		&rdquo;Kv&auml;llen f&ouml;re&rdquo;, &auml;r ett tillf&auml;lle f&ouml;r f&ouml;retagsrepresentanter och studenter som hj&auml;lper till med m&auml;ssan att ta det lugnt, l&auml;ra k&auml;nna varann b&auml;ttre och &auml;ta gott.</p>\n	<p>\n		Kv&auml;llen b&ouml;rjar oftast 18:00 p&aring; STUK Bar &amp; Restaurang, d&auml;r det serveras en mat och dryck. Trubadurlaget underh&aring;ller med musik.</p>\n	<p>\n		Sista avg&aring;ngen f&ouml;r transport hem brukar vara klockan 23:00 och STUK st&auml;nger d&ouml;rrarna klockan 00:00.</p>\n	<p>\n		&quot;Kv&auml;llen f&ouml;re&quot; f&ouml;r LARV 2012 blir dessutom n&aring;got lite extra! Se till att inte missa denna afton!&nbsp;</p>\n</div>\n<h1>\n	Bankett</h1>\n<p>\n	&nbsp;</p>\n<p>\n	Banketten h&aring;lles p&aring; kv&auml;llen efter m&auml;ssdagen och &auml;r ett tillf&auml;lle f&ouml;r f&ouml;retag och studenter att tala vidare kring m&ouml;tet tidigare under dagen och skaffa sig en b&auml;ttre bild av varandra.&nbsp;</p>\n<p>\n	Kv&auml;llen bjuder p&aring; underh&aring;llning och tal fr&aring;n samarbetspartners &nbsp;och givetvis god den goda maten!&nbsp;</p>\n<p>\n	Banketten h&aring;lles p&aring; STUK Bar &amp; Restaurang och transport tillbaka till boende st&aring;r vi &auml;ven h&auml;r f&ouml;r!&nbsp;</p>\n<h1>\n	Personliga Samtal</h1>\n<div>\n	<p>\n		Personliga samtal inneb&auml;r att student och f&ouml;retag avs&auml;tter tid f&ouml;r ett ost&ouml;rt m&ouml;te i samband med m&auml;ssan.</p>\n	<p>\n		Anm&auml;lan av intresse till personliga samtal g&ouml;rs i samband med den fullst&auml;ndiga anm&auml;lan f&ouml;r f&ouml;retagen och en s&auml;rskild anm&auml;lan finns f&ouml;r studenter.&nbsp;</p>\n	<p>\n		De personliga samtalen &auml;r ett popul&auml;rt och givande inslag till m&auml;ssan!&nbsp;</p>\n</div>\n<h1>\n	Fler Evenemang</h1>\n<p>\n	&nbsp;</p>\n<p>\n	Det finns &auml;ven utrymme f&ouml;r fler evenemang och aktiviteter. M&aring;nga f&ouml;rberedande aktiviteter planeras f&ouml;r dagarna innan m&auml;ssdagen. Ofta g&aring;r dessa f&ouml;raktiviteter under temat &quot;rekryteringsprocessen&quot; men kan &auml;ven ha mer popul&auml;rvetenskaplig natur!</p>\n<p>\n	Vill just Ert f&ouml;retag vara med och arrangera en f&ouml;raktivitet!? Ta d&aring; kontakt med oss eller ta upp detta i samband med inbjudan/anm&auml;lan!&nbsp;</p>\n<p>\n	&nbsp;</p>',1,1321544679),(109,'foretag.evenemang','<p>\n	Kv&auml;llen F&ouml;re</p>\n<div>\n	<p>\n		&rdquo;Kv&auml;llen f&ouml;re&rdquo;, &auml;r ett tillf&auml;lle f&ouml;r f&ouml;retagsrepresentanter och studenter som hj&auml;lper till med m&auml;ssan att ta det lugnt, l&auml;ra k&auml;nna varann b&auml;ttre och &a