med oss eller ta upp detta i samband med inbjudan/anm&auml;lan!&nbsp;</p>',1,1321544687),(110,'foretag.evenemang','<h1>\n	Kv&auml;llen F&ouml;re</h1>\n<div>\n	<p>\n		&rdquo;Kv&auml;llen f&ouml;re&rdquo;, &auml;r ett tillf&auml;lle f&ouml;r f&ouml;retagsrepresentanter och studenter som hj&auml;lper till med m&auml;ssan att ta det lugnt, l&auml;ra k&auml;nna varann b&auml;ttre och &auml;ta gott.</p>\n	<p>\n		Kv&auml;llen b&ouml;rjar oftast 18:00 p&aring; STUK Bar &amp; Restaurang, d&auml;r det serveras en mat och dryck. Trubadurlaget underh&aring;ller med musik.</p>\n	<p>\n		Sista avg&aring;ngen f&ouml;r transport hem brukar vara klockan 23:00 och STUK st&auml;nger d&ouml;rrarna klockan 00:00.</p>\n	<p>\n		&quot;Kv&auml;llen f&ouml;re&quot; f&ouml;r LARV 2012 blir dessutom n&aring;got lite extra! Se till att inte missa denna afton!&nbsp;</p>\n</div>\n<h1>\n	Bankett</h1>\n<p>\n	Banketten h&aring;lles p&aring; kv&auml;llen efter m&auml;ssdagen och &auml;r ett tillf&auml;lle f&ouml;r f&ouml;retag och studenter att tala vidare kring m&ouml;tet tidigare under dagen och skaffa sig en b&auml;ttre bild av varandra.&nbsp;</p>\n<p>\n	Kv&auml;llen bjuder p&aring; underh&aring;llning och tal fr&aring;n samarbetspartners &nbsp;och givetvis god den goda maten!&nbsp;</p>\n<p>\n	Banketten h&aring;lles p&aring; STUK Bar &amp; Restaurang och transport tillbaka till boende st&aring;r vi &auml;ven h&auml;r f&ouml;r!&nbsp;</p>\n<h1>\n	Personliga Samtal</h1>\n<div>\n	<p>\n		Personliga samtal inneb&auml;r att student och f&ouml;retag avs&auml;tter tid f&ouml;r ett ost&ouml;rt m&ouml;te i samband med m&auml;ssan.</p>\n	<p>\n		Anm&auml;lan av intresse till personliga samtal g&ouml;rs i samband med den fullst&auml;ndiga anm&auml;lan f&ouml;r f&ouml;retagen och en s&auml;rskild anm&auml;lan finns f&ouml;r studenter.&nbsp;</p>\n	<p>\n		De personliga samtalen &auml;r ett popul&auml;rt och givande inslag till m&auml;ssan!&nbsp;</p>\n</div>\n<h1>\n	Fler Evenemang</h1>\n<p>\n	Det finns &auml;ven utrymme f&ouml;r fler evenemang och aktiviteter. M&aring;nga f&ouml;rberedande aktiviteter planeras f&ouml;r dagarna innan m&auml;ssdagen. Ofta g&aring;r dessa f&ouml;raktiviteter under temat &quot;rekryteringsprocessen&quot; men kan &auml;ven ha mer popul&auml;rvetenskaplig natur!</p>\n<p>\n	Vill just Ert f&ouml;retag vara med och arrangera en f&ouml;raktivitet!? Ta d&aring; kontakt med oss eller ta upp detta i samband med inbjudan/anm&auml;lan!&nbsp;</p>',1,1321544692),(111,'foretag.ltululea','<p>\n	&nbsp;</p>\n<h1>\n	Om universitetet</h1>\n<p>\n	Lule&aring; tekniska universitet &auml;r Skandinaviens nordligaste tekniska universitet med forskning och utbildning i v&auml;rldsklass. LTU:s samarbete, med f&ouml;retagen och med det omgivande samh&auml;llet, &auml;r v&aring;r styrka. Kontakterna med f&ouml;retag och samh&auml;lle hj&auml;lper oss att utveckla aktuell forskning och utbildning som motsvarar krav som omv&auml;rlden st&auml;ller p&aring; oss och p&aring; v&aring;ra studenter.&nbsp;</p>\n<p>\n	Lule&aring; tekniska universitet bedriver forskning inom tekniskt vetenskapsomr&aring;de och humanistiskt-samh&auml;llsvetenskapligt vetenskapsomr&aring;de. Forskningen oms&auml;tter drygt 600 MSEK och omfattar 69 forsknings&auml;mnen samlade inom 6 prioriterade forskningsomr&aring;den och 6 utvecklingsomr&aring;den. &nbsp;</p>\n<p>\n	Forskningen k&auml;nnetecknas av gr&auml;ns&ouml;verskridande samarbete mellan universitetets forskningsavdelningar och av n&auml;ra samverkan med n&auml;ringsliv och samh&auml;lle.&nbsp;</p>\n<p>\n	S&aring;v&auml;l internationella och nationella storf&ouml;retag som l&auml;nets sm&aring;f&ouml;retag &auml;r involverade i LTU:s forsknings- och utvecklingsprojekt. F&ouml;retagen finns ocks&aring; med som en samverkanspart i universitetets centrumbildningar.&nbsp;</p>',1,1321544762),(112,'foretag.ltululea','<h1>\n	Om universitetet</h1>\n<p>\n	Lule&aring; tekniska universitet &auml;r Skandinaviens nordligaste tekniska universitet med forskning och utbildning i v&auml;rldsklass. LTU:s samarbete, med f&ouml;retagen och med det omgivande samh&auml;llet, &auml;r v&aring;r styrka. Kontakterna med f&ouml;retag och samh&auml;lle hj&auml;lper oss att utveckla aktuell forskning och utbildning som motsvarar krav som omv&auml;rlden st&auml;ller p&aring; oss och p&aring; v&aring;ra studenter.&nbsp;</p>\n<p>\n	Lule&aring; tekniska universitet bedriver forskning inom tekniskt vetenskapsomr&aring;de och humanistiskt-samh&auml;llsvetenskapligt vetenskapsomr&aring;de. Forskningen oms&auml;tter drygt 600 MSEK och omfattar 69 forsknings&auml;mnen samlade inom 6 prioriterade forskningsomr&aring;den och 6 utvecklingsomr&aring;den. &nbsp;</p>\n<p>\n	Forskningen k&auml;nnetecknas av gr&auml;ns&ouml;verskridande samarbete mellan universitetets forskningsavdelningar och av n&auml;ra samverkan med n&auml;ringsliv och samh&auml;lle.&nbsp;</p>\n<p>\n	S&aring;v&auml;l internationella och nationella storf&ouml;retag som l&auml;nets sm&aring;f&ouml;retag &auml;r involverade i LTU:s forsknings- och utvecklingsprojekt. F&ouml;retagen finns ocks&aring; med som en samverkanspart i universitetets centrumbildningar.&nbsp;</p>',1,1321544768),(113,'katalog','<p>\n	&nbsp;</p>\n<h1>\n	LARVKatalogen 2012</h1>\n<p>\n	Katalogen f&ouml;r LARV sl&auml;pps inf&ouml;r m&auml;ssan och beskriver f&ouml;retaget med text och logotyp samt visar p&aring; karta dess monterplacering under m&auml;ssan. Katalogen fungerar som ett steg i arbetet mot att f&ouml;rbereda studenten inf&ouml;r m&auml;ssdagen.</p>\n<p>\n	&nbsp;</p>\n<p>\n	En l&auml;nk till katalogen och besked om dess release g&ouml;rs H&Auml;R!</p>\n<div>\n	&nbsp;</div>',1,1321544937),(114,'katalog','<h1>\n	LARVKatalogen 2012</h1>\n<p>\n	Katalogen f&ouml;r LARV sl&auml;pps inf&ouml;r m&auml;ssan och beskriver f&ouml;retaget med text och logotyp samt visar p&aring; karta dess monterplacering under m&auml;ssan. Katalogen fungerar som ett steg i arbetet mot att f&ouml;rbereda studenten inf&ouml;r m&auml;ssdagen.</p>\n<p>\n	&nbsp;</p>\n<p>\n	En l&auml;nk till katalogen och besked om dess release g&ouml;rs H&Auml;R!</p>\n<div>\n	&nbsp;</div>',1,1321544944),(115,'katalog','<h1>\n	LARVKatalogen 2012</h1>\n<p>\n	Katalogen f&ouml;r LARV sl&auml;pps inf&ouml;r m&auml;ssan och beskriver f&ouml;retaget med text och logotyp samt visar p&aring; karta dess monterplacering under m&auml;ssan. Katalogen fungerar som ett steg i arbetet mot att f&ouml;rbereda studenten inf&ouml;r m&auml;ssdagen.</p>\n<p>\n	En l&auml;nk till katalogen och besked om dess release g&ouml;rs H&Auml;R!</p>\n<h2>\n	Ett steg vidare!&nbsp;</h2>\n<div>\n	<p>\n		Inf&ouml;r m&auml;ssan har man &aring;rligen producerat en m&auml;sskatalog d&auml;r studenterna kan l&auml;sa om samtliga f&ouml;retag som st&auml;ller ut. Alla f&ouml;retagen som st&auml;llt ut har givits ett uppslag i katalogen.</p>\n	<p>\n		Ett webbaserat alternativ minimerar risken f&ouml;r feltryck och kan synligg&ouml;ra ett f&ouml;retag p&aring; ett annat vis. Ett webbaserat alternativ till&aring;ter &auml;ndringar in i sista stund och kan synligg&ouml;ras under en l&auml;ngre tid. Dessutom blir katalogen interaktiv och ges p&aring; s&aring; vis fler dimensioner. S&aring; har vi det d&auml;r med milj&ouml;aspekten, ocks&aring;...</p>\n	<p>\n		Det unders&ouml;ks d&auml;rf&ouml;r hurvida katalogen f&ouml;r &aring;ret blir webbaserad med m&ouml;jlighet till st&ouml;rre interaktion s&aring;som s&ouml;kfunktioner och vidare l&auml;sning men &auml;ven f&ouml;r utskrift f&ouml;r den som &ouml;nskar sin katalog i fysiskt format.&nbsp;</p>\n	<p>\n		Vid fr&aring;gor g&auml;llande katalogen kontakta katalogansvarig p&aring;, katalog@larv.org</p>\n</div>\n<h2>\n	Specifikationer katalogannons i f&auml;rg (web)</h2>\n<p>\n	&nbsp;</p>\n<ul>\n	<li>\n		<p>\n			Annonsen skall vara i f&auml;rg. Annonsens f&auml;rgformat m&aring;ste vara CMYK, (ej RGB).</p>\n	</li>\n	<li>\n		<p>\n			Annonsen skall vara 148x210mm (A5) med 5mm utfall, annonsens storlek inklusive utfall blir d&aring; 158mmx220mm</p>\n	</li>\n	<li>\n		<p>\n			Alla bilder skall vara h&ouml;guppl&ouml;sta, 300 DPI.</p>\n	</li>\n	<li>\n		<p>\n			Alla typsnitt skall vara konverterade till banor.</p>\n	</li>\n	<li>\n		<p>\n			Annonsen skall vara i filformatet PDF.</p>\n	</li>\n	<li>\n		<p>\n			Inga sk&auml;rm&auml;rken, passm&auml;rken, el. dyl. f&aring;r finnas med i annonsen.</p>\n	</li>\n</ul>\n<h2>\n	&nbsp;Annonsering i Alpinakatalog</h2>\n<div>\n	<p>\n		<strong>Tiden f&ouml;r m&ouml;jlighet till annonsering i Alpinakatalogen har l&ouml;pt ut!</strong></p>\n	<p>\n		Som kan avl&auml;sas i inbjudan var sista datum f&ouml;r denna annonseringsm&ouml;jlighet den 10e oktober.&nbsp;</p>\n	<p>\n		&Auml;r ni intresserade av annonsering kommande &aring;r, v&auml;nligen s&auml;nd ett mail med &auml;mnet ALPINA till ao@teknologkaren.se</p>\n	<p>\n		Det finns &auml;ven m&ouml;jlighet f&ouml;r ert f&ouml;retag att innan LARV synas med monter p&aring; StilAlpinas skidyra samt i samband med de alpina resorna. Har ni s&auml;rskilt intresse av detta eller &ouml;nskar mer information, v&auml;nligen kontakta projektledare f&ouml;r LARV per telefon; 070-6862585</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321545099),(116,'katalog','<h1>\n	LARVKatalogen 2012</h1>\n<p>\n	Katalogen f&ouml;r LARV sl&auml;pps inf&ouml;r m&auml;ssan och beskriver f&ouml;retaget med text och logotyp samt visar p&aring; karta dess monterplacering under m&auml;ssan. Katalogen fungerar som ett steg i arbetet mot att f&ouml;rbereda studenten inf&ouml;r m&auml;ssdagen.</p>\n<p>\n	En l&auml;nk till katalogen och besked om dess release g&ouml;rs H&Auml;R!</p>\n<h2>\n	Ett steg vidare!&nbsp;</h2>\n<div>\n	<p>\n		Inf&ouml;r m&auml;ssan har man &aring;rligen producerat en m&auml;sskatalog d&auml;r studenterna kan l&auml;sa om samtliga f&ouml;retag som st&auml;ller ut. Alla f&ouml;retagen som st&auml;llt ut har givits ett uppslag i katalogen.</p>\n	<p>\n		Ett webbaserat alternativ minimerar risken f&ouml;r feltryck och kan synligg&ouml;ra ett f&ouml;retag p&aring; ett annat vis. Ett webbaserat alternativ till&aring;ter &auml;ndringar in i sista stund och kan synligg&ouml;ras under en l&auml;ngre tid. Dessutom blir katalogen interaktiv och ges p&aring; s&aring; vis fler dimensioner. S&aring; har vi det d&auml;r med milj&ouml;aspekten, ocks&aring;...</p>\n	<p>\n		Det unders&ouml;ks d&auml;rf&ouml;r hurvida katalogen f&ouml;r &aring;ret blir webbaserad med m&ouml;jlighet till st&ouml;rre interaktion s&aring;som s&ouml;kfunktioner och vidare l&auml;sning men &auml;ven f&ouml;r utskrift f&ouml;r den som &ouml;nskar sin katalog i fysiskt format.&nbsp;</p>\n	<p>\n		Vid fr&aring;gor g&auml;llande katalogen kontakta katalogansvarig p&aring;, katalog@larv.org</p>\n</div>\n<h2>\n	Specifikationer katalogannons i f&auml;rg (web)</h2>\n<ul>\n	<li>\n		<p>\n			Annonsen skall vara i f&auml;rg. Annonsens f&auml;rgformat m&aring;ste vara CMYK, (ej RGB).</p>\n	</li>\n	<li>\n		<p>\n			Annonsen skall vara 148x210mm (A5) med 5mm utfall, annonsens storlek inklusive utfall blir d&aring; 158mmx220mm</p>\n	</li>\n	<li>\n		<p>\n			Alla bilder skall vara h&ouml;guppl&ouml;sta, 300 DPI.</p>\n	</li>\n	<li>\n		<p>\n			Alla typsnitt skall vara konverterade till banor.</p>\n	</li>\n	<li>\n		<p>\n			Annonsen skall vara i filformatet PDF.</p>\n	</li>\n	<li>\n		<p>\n			Inga sk&auml;rm&auml;rken, passm&auml;rken, el. dyl. f&aring;r finnas med i annonsen.</p>\n	</li>\n</ul>\n<h2>\n	&nbsp;Annonsering i Alpinakatalog</h2>\n<div>\n	<p>\n		<strong>Tiden f&ouml;r m&ouml;jlighet till annonsering i Alpinakatalogen har l&ouml;pt ut!</strong></p>\n	<p>\n		Som kan avl&auml;sas i inbjudan var sista datum f&ouml;r denna annonseringsm&ouml;jlighet den 10e oktober.&nbsp;</p>\n	<p>\n		&Auml;r ni intresserade av annonsering kommande &aring;r, v&auml;nligen s&auml;nd ett mail med &auml;mnet ALPINA till ao@teknologkaren.se</p>\n	<p>\n		Det finns &auml;ven m&ouml;jlighet f&ouml;r ert f&ouml;retag att innan LARV synas med monter p&aring; StilAlpinas skidyra samt i samband med de alpina resorna. Har ni s&auml;rskilt intresse av detta eller &ouml;nskar mer information, v&auml;nligen kontakta projektledare f&ouml;r LARV per telefon; 070-6862585</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321545135),(117,'foretag.transport','<h1>\n	Transport</h1>\n<p>\n	Unikt f&ouml;r LARV &auml;r att vi erbjuder f&ouml;retagen transport till och fr&aring;n sitt boende och flygplats. Bokning av transport sker genom er tilldelade f&ouml;retagsv&auml;rd.</p>\n<p>\n	F&ouml;r fr&aring;gor ber vi er kontakta <a href=\"mailto:transport@larv.org\">transport@larv.org</a></p>',1,1321545659),(118,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV kan ni l&auml;sa om under <a href=\"/foretag/signup/\">Anm&auml;lan</a></p>\n<ul>\n	<li>\n		<p>\n			Skjuts till boende eller Campus vid ankomst till Lule&aring;</p>\n	</li>\n	<li>\n		<p>\n			Skjuts till och fr&aring;n boende vid deltagande p&aring; &quot;kv&auml;llen f&ouml;re&quot; och m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			Monteryta: 3*2 m, h&ouml;jd; 3m</p>\n	</li>\n	<li>\n		<p>\n			F&ouml;retagsv&auml;rd som underst&ouml;djer arbetet f&ouml;r just Ert f&ouml;retag inf&ouml;r och under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			2 biljetter till lunch, fika och &nbsp;LARVbankett</p>\n	</li>\n	<li>\n		<p>\n			Uppslag i m&auml;sskatalog(webbaserad)</p>\n	</li>\n	<li>\n		<p>\n			Tr&aring;dl&ouml;s internetuppkoppling</p>\n	</li>\n	<li>\n		<p>\n			El</p>\n	</li>\n	<li>\n		<p>\n			M&ouml;jlighet till personliga samtal med utvalda studenter</p>\n	</li>\n	<li>\n		<p>\n			Tilltr&auml;de till &quot;Kv&auml;llen F&ouml;re&quot;</p>\n	</li>\n</ul>\n<p>\n	Givetvis finns det m&ouml;jlighet att &ouml;ka p&aring; paketet med;</p>\n<ul>\n	<li>\n		<p>\n			Ut&ouml;kad monteryta</p>\n	</li>\n	<li>\n		<p>\n			Fler biljetter; lunch, fika, bankett&lt;/li&gt;</p>\n	</li>\n	<li>\n		<p>\n			Rekvisita; stolar, bord, mattor, blommor&lt;/li&gt;</p>\n	</li>\n	<li>\n		<p>\n			Monterevenemang(1 dec 2011) eller synlighet i samband med Alpinaresa innan LARV (Kontakt med projektledare per telefon; 0706862585</p>\n	</li>\n	<li>\n		<p>\n			Monterupps&auml;ttning</p>\n	</li>\n	<li>\n		<p>\n			Spridning av utv&auml;rdering; antingen v&aring;r eller en vi tillsammans uppr&auml;ttar s&auml;rskilt f&ouml;r LARV&nbsp;</p>\n	</li>\n	<li>\n		<p>\n			Delgivning av V&aring;r utv&auml;rdering i n&auml;ra anslutning till avslutat LARV</p>\n	</li>\n</ul>',1,1321545755),(119,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV kan ni l&auml;sa om under <a href=\"/foretag/signup/\">Anm&auml;lan</a></p>',1,1321545773),(120,'foretag.signup','<h1>\n	Arbetsmarknadsdagar.se</h1>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat att f&ouml;renkla f&ouml;r f&ouml;retag att genomf&ouml;ra anm&auml;lningar till de olika m&auml;ssorna. P&aring; arbetsmarknadsdagar.se kan f&ouml;retag idag spara information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en FAQ som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<p>\n	<strong>Anm&auml;lan har st&auml;ngt f&ouml;r i &aring;r.</strong></p>\n<div>\n	<a href=\"http://www.arbetsmarknadsdagar.se/\">Till Arbetsmarknadsdagar.se</a></div>\n<h1>\n	Baspaketet</h1>\n<div>\n	<p>\n		<strong>Pris: 15 000SEK*</strong></p>\n	<ul>\n		<li>\n			<p>\n				Monteryta 3m*2m&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Biljetter f&ouml;r tv&aring; personer till lunch, fika och bankett med eftersl&auml;pp&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Ett uppslag i katalogen&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				1 f&ouml;retagsv&auml;rd&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Internet&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				El&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				M&ouml;jlighet till LARV-samtal, personliga samtal med v&aring;ra medlemmar</p>\n		</li>\n		<li>\n			<p>\n				Kv&auml;llen f&ouml;re&nbsp;</p>\n		</li>\n	</ul>\n	<p>\n		Naturligtvis finns det m&ouml;jligheter att f&aring; en st&ouml;rre monteryta, fler biljetter till bankett, v&auml;xter till montern eller andra tillval. Priser f&ouml;r detta finner ni nedan och detta anm&auml;les i kompletterande anm&auml;lan.&nbsp;</p>\n	<p>\n		*LARV f&ouml;rfakturerar grundpaketet. Eventuella till&auml;gg, inklusive de som &ouml;nskas i kompletterande anm&auml;lan, faktuerars i efterhand. Var v&auml;nlig ange eventuellt ordernummer f&ouml;r faktura.&nbsp;</p>\n	<h2>\n		Tillval</h2>\n	<p>\n		&nbsp;</p>\n	<div>\n		Eftersom vi inser att varje f&ouml;retag har unika montrar och &ouml;nskem&aring;l s&aring; finner ni nedan en prislista f&ouml;r de ut&ouml;kningar som ni kan g&ouml;ra till grundpaketet:</div>\n	<div>\n		&nbsp;</div>\n	<ul>\n		<li>\n			<p>\n				Monteryta 1000 kr/m2&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				F&ouml;retagsv&auml;rd 1000 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Kataloguppslag 5000 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Dagsbiljett (lunch &amp; fika) 120 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Middagsbiljett 600 kr/st inklusive sl&auml;ppbiljett.&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Sl&auml;ppbiljett 50 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Barbongar (f&ouml;rk&ouml;p) 45 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				1 h&auml;fte, 4 Barbongar, (f&ouml;rk&ouml;p) 180 kr&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Barbongar (m&auml;sspris) 55 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Hyra st&aring;bord ca 300 kr/bord (PREL pris)&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Hyra barstolar ca 200kr/stol (PREL pris)&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Hyra dator/TV/video Sj&auml;lvkostnadspris med visst p&aring;slag&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Extra Dryck 10 kr/st (De f&ouml;rsta 10 &auml;r gratis)&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Kopiering Sj&auml;lvkostnadspris med visst p&aring;slag&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Extra IP-nummer 500 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				V&auml;xter ca 200 kr/v&auml;xt (PREL pris)&nbsp;</p>\n		</li>\n	</ul>\n</div>\n<h2>\n	Fullst&auml;ndig anm&auml;lan</h2>\n<div>\n	<p>\n		Fullst&auml;ndig anm&auml;lan inneh&aring;ller exakta uppgifter och kan l&auml;mnas som senast en m&aring;nad innan m&auml;ssan.&nbsp;</p>\n	<p>\n		<strong>Den fullst&auml;ndiga anm&auml;lan &ouml;ppnar 2012.11.03</strong></p>\n	<p>\n		<strong>Sista anm&auml;lningsdatum &auml;r 2012.11.25</strong></p>\n	<p>\n		&nbsp;</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321545892),(121,'foretag.signup','<h1>\n	Arbetsmarknadsdagar.se</h1>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat