li>\n		<li>\n			<p>\n				F&ouml;retagsv&auml;rd 1000 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Kataloguppslag 5000 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Dagsbiljett (lunch &amp; fika) 120 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Middagsbiljett 600 kr/st inklusive sl&auml;ppbiljett.&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Sl&auml;ppbiljett 50 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Barbongar (f&ouml;rk&ouml;p) 45 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				1 h&auml;fte, 4 Barbongar, (f&ouml;rk&ouml;p) 180 kr&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Barbongar (m&auml;sspris) 55 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Hyra st&aring;bord ca 300 kr/bord (PREL pris)&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Hyra barstolar ca 200kr/stol (PREL pris)&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Hyra dator/TV/video Sj&auml;lvkostnadspris med visst p&aring;slag&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Extra Dryck 10 kr/st (De f&ouml;rsta 10 &auml;r gratis)&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Kopiering Sj&auml;lvkostnadspris med visst p&aring;slag&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				Extra IP-nummer 500 kr/st&nbsp;</p>\n		</li>\n		<li>\n			<p>\n				V&auml;xter ca 200 kr/v&auml;xt (PREL pris)&nbsp;</p>\n		</li>\n	</ul>\n</div>\n<h2>\n	Fullst&auml;ndig anm&auml;lan</h2>\n<div>\n	<p>\n		Fullst&auml;ndig anm&auml;lan inneh&aring;ller exakta uppgifter och kan l&auml;mnas som senast en m&aring;nad innan m&auml;ssan.&nbsp;</p>\n	<p>\n		<strong>Den fullst&auml;ndiga anm&auml;lan &ouml;ppnar 2012.11.03</strong></p>\n	<p>\n		<strong>Sista anm&auml;lningsdatum &auml;r 2012.11.25</strong></p>\n	<p>\n		&nbsp;</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321545910),(122,'foretag.signup','<h1>\n	Anm&auml;lan</h1>\n<h2>\n	Arbetsmarknadsdagar.se</h2>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar