skapsomr&aring;de och humanistiskt-samh&auml;llsvetenskapligt vetenskapsomr&aring;de. Forskningen oms&auml;tter drygt 600 MSEK och omfattar 69 forsknings&auml;mnen samlade inom 6 prioriterade forskningsomr&aring;den och 6 utvecklingsomr&aring;den. &nbsp;</p>\n<p>\n	Forskningen k&auml;nnetecknas av gr&auml;ns&ouml;verskridande samarbete mellan universitetets forskningsavdelningar och av n&auml;ra samverkan med n&auml;ringsliv och samh&auml;lle.&nbsp;</p>\n<p>\n	S&aring;v&auml;l internationella och nationella storf&ouml;retag som l&auml;nets sm&aring;f&ouml;retag &auml;r involverade i LTU:s forsknings- och utvecklingsprojekt. F&ouml;retagen finns ocks&aring; med som en samverkanspart i universitetets centrumbildningar.&nbsp;</p>\n<div>\n	&nbsp;</div>\n<p>\n	&nbsp;</p>',1,1321558844),(129,'omlarv.ltu','<h1>\n	Om universitetet</h1>\n<p>\n	Lule&aring; tekniska universitet &auml;r Skandinaviens nordligaste tekniska universitet med forskning och utbildning i v&auml;rldsklass. LTU:s samarbete, med f&ouml;retagen och med det omgivande samh&auml;llet, &auml;r v&aring;r styrka. Kontakterna med f&ouml;retag och samh&auml;lle hj&auml;lper oss att utveckla aktuell forskning och utbildning som motsvarar krav som omv&auml;rlden st&auml;ller p&aring; oss och p&aring; v&aring;ra studenter.&nbsp;</p>\n<p>\n	Lule&aring; tekniska universitet bedriver forskning inom tekniskt vetenskapsomr&aring;de och humanistiskt-samh&auml;llsvetenskapligt vetenskapsomr&aring;de. Forskningen oms&auml;tter drygt 600 MSEK och omfattar 69 forsknings&auml;mnen samlade inom 6 prioriterade forskningsomr&aring;den och 6 utvecklingsomr&aring;den. &nbsp;</p>\n<p>\n	Forskningen k&auml;nnetecknas av gr&auml;ns&ouml;verskridande samarbete mellan universitetets forskningsavdelningar och av n&auml;ra samverkan med n&auml;ringsliv och samh&auml;lle.&nbsp;</p>\n<p>\n	S&aring;v&auml;l internationella och nationella storf&ouml;retag som l&auml;nets sm&aring;f&ouml;retag &auml;r involverade i LTU:s forsknings- och utvecklingsprojekt. F&ouml;retagen finns ocks&aring; med som en samverkanspart i universitetets centrumbildningar.&nbsp;</p>\n<div>\n	&nbsp;</div>\n<p>\n	&nbsp;</p>',1,1321558849),(130,'omlarv.lulea','<h1>\n	Om Lule&aring;</h1>\n<h2>\n	Strax efter istiden kommer de f&ouml;rsta m&auml;nniskorna</h2>\n<p>\n	&nbsp;</p>\n<p>\n	Redan f&ouml;r ca 7 000 &aring;r sedan kom de f&ouml;rsta m&auml;nniskor hit. Hundratals l&auml;mningar fr&aring;n sten&aring;ldern har hittats inom kommunen, bl a vid N&auml;verberget i M&aring;ttsund och Unby-R&aring;berget n&auml;ra Selet. M&auml;nniskorna kom troligen fr&aring;n &ouml;ster, via Finland.</p>\n<h2>\n	Omr&aring;det koloniseras av kungen och kyrkan</h2>\n<div>\n	<p>\n		Lule&aring; - eller Lulu - har samiskt ursprung och kan uttydas &quot;&ouml;stligt vatten&quot;. Namnet f&ouml;rekommer f&ouml;r f&ouml;rsta g&aring;ngen i ett dokument 1327. D&auml;r ber&auml;ttas att en fyrmannagrupp 1327 med &auml;rkebiskopen Olof i Uppsala i spetsen tilldelats Lule &auml;lvdal. Efter stridigheter mellan Sverige/Finland och Novgorod/Ryssland om var gr&auml;nsen skulle g&aring; startade svenska kronan och kyrkan en &quot;kolonisation&quot; i norr. Avsikten var att omr&aring;det skulle bebyggas och uppodlas. Lule&aring; hade dock varit befolkat sedan f&ouml;rhistorisk tid och troligtvis f&ouml;rekom jordbruk redan d&aring;. Omr&aring;det ovanf&ouml;r Skellefte&aring; hade emellertid varit ett ingenmansland och i och med att svenska kronan och kyrkan visade sin n&auml;rvaro i kustlandet inf&ouml;rlivades omr&aring;det i det svenska riket. Den enast&aring;ende kyrkan i Gammelstad byggdes under 1400-talet.</p>\n	<h2>\n		Lule&aring; stad grundas och flyttas till sin nuvarande plats</h2>\n	<div>\n		<p>\n			I mitten av 1400-talet utgjorde Lule&aring; socken en omfattande yta p&aring; &ouml;ver 4 200 km2. Omr&aring;det str&auml;ckte sig ovanf&ouml;r lappmarksgr&auml;nsen med Jokkmokk och G&auml;llivare inkluderade. Med tiden minskade Lule&aring; n&auml;r omr&aring;den avs&ouml;ndrades. Lule&aring; stad grundlades kring medeltidskyrkan i Gammelstad 1621. Lule&aring; kom att bli en betydande handelsstad p&aring; sydligare hamnar, fr&auml;mst d&aring; Stockholm, med fiske som huvudn&auml;ring. P&aring; grund av den kraftiga landh&ouml;jnignen m&aring;ste stan redan 1649 flyttas en mil till sin nuvarande plats.</p>\n		<h2>\n			Krig och ryska h&auml;rjningar- hinder i Lule&aring;s utveckling</h2>\n		<div>\n			<p>\n				Utvecklingen gick l&aring;ngsamt i den nya staden och &auml;nnu i slutet av 1700-talet hade Lule&aring; endast bykarakt&auml;r. Lule&aring; drabbades h&aring;rt av stormakttidens krig, senare ocks&aring; av ryska h&auml;rjningar. Staden drabbades ocks&aring; av sv&aring;ra br&auml;nder. Carl von Linn&eacute; bes&ouml;kte kommunen p&aring; sin lappl&auml;ndska resa 1732 och drack brunn i Gammelstad. Han beskrev Lule&aring; som en by om &auml;n sk&ouml;n.</p>\n			<h2>\n				Industriell verksamhet kommer ig&aring;ng</h2>\n			<div>\n				<p>\n					N&auml;r Lule&aring; &aring;terh&auml;mtat sig fr&aring;n stormaktstidens krig b&ouml;rjade en snabb befolkningstillv&auml;xt. En stor del av befolkningen f&ouml;rs&ouml;rjde sig p&aring; jordbruket och missv&auml;xter slog h&aring;rt. Under 1830-talet led en stor del av Lule&aring;borna n&ouml;d och ett antal hj&auml;lpaktioner kom till st&aring;nd utifr&aring;n. Karl Fredrik Liljevalch satsade pengar i en varvsindustri och ville frig&ouml;ra den lokala skaparkraften. Efter honom kom fler, bl a Christian G&uuml;ltzau som &auml;ven han byggde upp ett varv och producerade h&ouml;gklassiga fartyg. Med nya kunskaper utvecklades och effektiviserades ocks&aring; jordbruket under denna tid och Lule&aring;bygden upplevde en kraftig ekonomisk tillv&auml;xt.</p>\n			</div>\n			<div>\n				<h2>\n					Lule&aring; utvecklas mot ett modernt samh&auml;lle</h2>\n				<p>\n					Under 1800-talets senare h&auml;lft intr&auml;ffade en rad betydelsefulla h&auml;ndelser i Lule&aring;s historia. L&auml;nsstyrelse och landsh&ouml;vding flyttades till Lule&aring; 1856 och staden fick sitt f&ouml;rsta lasarett n&aring;gra &aring;r senare. Ett nytt r&aring;dhus uppr&auml;ttades, den f&ouml;rsta banken &ouml;ppnades 1857 och den f&ouml;rsta telefonledningen installerades 1883. P&aring; Altappen byggdes en s&aring;g och ett j&auml;rnverk, den f&ouml;rsta verkliga storindustrin i l&auml;net, den brann dock senare ned. 1888 invidges malmbanan till G&auml;llivare och 1894 fick Lule&aring; anknytning till Norra stambanan och en regulj&auml;r &aring;ngb&aring;tsf&ouml;rbindelse med Stockholm uppr&auml;ttades. F&ouml;r&auml;ndringar inom n&auml;ringslivet bildade nya sociala klasser vilket resulterade i strejker, facklig organisering och en politisk medvetenhet.</p>\n				<h2>\n					Lule&aring; - St&aring;l och Hamnstaden</h2>\n				<div>\n					<p>\n						Under 1900-talet ersattes jordbruket alltmer med industriell verksamhet. Flera f&ouml;rs&ouml;k att f&ouml;r&auml;dla lapplandsmalmen gjordes och med malmbanan kunde Lule&aring; j&auml;rnverk i Karlsvik invigas 1906. Dess historia blev kort. P&aring; 1940-talet byggdes Norrbottens j&auml;rnverk upp, numera SSAB Lule&aring;, och fick en avg&ouml;rande betydelse f&ouml;r Lule&aring; och hela l&auml;net. Lule&aring; blev allm&auml;nt k&auml;nd som &quot;st&aring;l- och hamnstaden&quot;. Utvecklingen och expansionen under 1800- och 1900-talet har gjort Lule&aring; till Norrbottens ledande stad.</p>\n					<h2>\n						Dagens Lule&aring;</h2>\n					<div>\n						<p>\n							Dagens Lule&aring; &auml;r resultatet av en kommunsammanslagning 1969. D&aring; blev Lule&aring; stad, dagens Nederlule&aring; och R&aring;ne&aring; en storkommun p&aring; 1810 km2. Idag har Lule&aring; ca 72 000 inv&aring;nare och har utvecklats till ett teknologiskt centrum i norr. De viktigaste h&ouml;rnstenarna &auml;r metallurgi, utbildning och forskning samt goda kommunikationer. I Lule&aring; finns flera f&ouml;retag som h&ouml;r till de v&auml;rldsledande inom sin gren, bl a Plannja, SSAB och Scania. Lule&aring; har &auml;ven utvecklats till en stad som kan erbjuda ett rikt kulturliv, ett stort utbud p&aring; fritidsaktiviteter och mycket mera som g&ouml;r Lule&aring; till en trivsam stad att leva i.</p>\n						<p>\n							&nbsp;</p>\n						<p>\n							L&auml;s mer om Lule&aring; p&aring; <a href=\"http://www.lulea.se\">www.lulea.se.</a></p>\n						<p>\n							&nbsp;</p>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>',1,1321559054),(131,'omlarv.lulea','<h1>\n	Om Lule&aring;</h1>\n<h2>\n	Strax efter istiden kommer de f&ouml;rsta m&auml;nniskorna</h2>\n<p>\n	Redan f&ouml;r ca 7 000 &aring;r sedan kom de f&ouml;rsta m&auml;nniskor hit. Hundratals l&auml;mningar fr&aring;n sten&aring;ldern har hittats inom kommunen, bl a vid N&auml;verberget i M&aring;ttsund och Unby-R&aring;berget n&auml;ra Selet. M&auml;nniskorna kom troligen fr&aring;n &ouml;ster, via Finland.</p>\n<h2>\n	Omr&aring;det koloniseras av kungen och kyrkan</h2>\n<div>\n	<p>\n		Lule&aring; - eller Lulu - har samiskt ursprung och kan uttydas &quot;&ouml;stligt vatten&quot;. Namnet f&ouml;rekommer f&ouml;r f&ouml;rsta g&aring;ngen i ett dokument 1327. D&auml;r ber&auml;ttas att en fyrmannagrupp 1327 med &auml;rkebiskopen Olof i Uppsala i spetsen tilldelats Lule &auml;lvdal. Efter stridigheter mellan Sverige/Finland och Novgorod/Ryssland om var gr&auml;nsen skulle g&aring; startade svenska kronan och kyrkan en &quot;kolonisation&quot; i norr. Avsikten var att omr&aring;det skulle bebyggas och uppodlas. Lule&aring; hade dock varit befolkat sedan f&ouml;rhistorisk tid och troligtvis f&ouml;rekom jordbruk redan d&aring;. Omr&aring;det ovanf&ouml;r Skellefte&aring; hade emellertid varit ett ingenmansland och i och med att svenska kronan och kyrkan visade sin n&auml;rvaro i kustlandet inf&ouml;rlivades omr&aring;det i det svenska riket. Den enast&aring;ende kyrkan i Gammelstad byggdes under 1400-talet.</p>\n	<h2>\n		Lule&aring; stad grundas och flyttas till sin nuvarande plats</h2>\n	<div>\n		<p>\n			I mitten av 1400-talet utgjorde Lule&aring; socken en omfattande yta p&aring; &ouml;ver 4 200 km2. Omr&aring;det str&auml;ckte sig ovanf&ouml;r lappmarksgr&auml;nsen med Jokkmokk och G&auml;llivare inkluderade. Med tiden minskade Lule&aring; n&auml;r omr&aring;den avs&ouml;ndrades. Lule&aring; stad grundlades kring medeltidskyrkan i Gammelstad 1621. Lule&aring; kom att bli en betydande handelsstad p&aring; sydligare hamnar, fr&auml;mst d&aring; Stockholm, med fiske som huvudn&auml;ring. P&aring; grund av den kraftiga landh&ouml;jnignen m&aring;ste stan redan 1649 flyttas en mil till sin nuvarande plats.</p>\n		<h2>\n			Krig och ryska h&auml;rjningar- hinder i Lule&aring;s utveckling</h2>\n		<div>\n			<p>\n				Utvecklingen gick l&aring;ngsamt i den nya staden och &auml;nnu i slutet av 1700-talet hade Lule&aring; endast bykarakt&auml;r. Lule&aring; drabbades h&aring;rt av stormakttidens krig, senare ocks&aring; av ryska h&auml;rjningar. Staden drabbades ocks&aring; av sv&aring;ra br&auml;nder. Carl von Linn&eacute; bes&ouml;kte kommunen p&aring; sin lappl&auml;ndska resa 1732 och drack brunn i Gammelstad. Han beskrev Lule&aring; som en by om &auml;n sk&ouml;n.</p>\n			<h2>\n				Industriell verksamhet kommer ig&aring;ng</h2>\n			<div>\n				<p>\n					N&auml;r Lule&aring; &aring;terh&auml;mtat sig fr&aring;n stormaktstidens krig b&ouml;rjade en snabb befolkningstillv&auml;xt. En stor del av befolkningen f&ouml;rs&ouml;rjde sig p&aring; jordbruket och missv&auml;xter slog h&aring;rt. Under 1830-talet led en stor del av Lule&aring;borna n&ouml;d och ett antal hj&auml;lpaktioner kom till st&aring;nd utifr&aring;n. Karl Fredrik Liljevalch satsade pengar i en varvsindustri och ville frig&ouml;ra den lokala skaparkraften. Efter honom kom fler, bl a Christian G&uuml;ltzau som &auml;ven han byggde upp ett varv och producerade h&ouml;gklassiga fartyg. Med nya kunskaper utvecklades och effektiviserades ocks&aring; jordbruket under denna tid och Lule&aring;bygden upplevde en kraftig ekonomisk tillv&auml;xt.</p>\n			</div>\n			<div>\n				<h2>\n					Lule&aring; utvecklas mot ett modernt samh&auml;lle</h2>\n				<p>\n					Under 1800-talets senare h&auml;lft intr&auml;ffade en rad betydelsefulla h&auml;ndelser i Lule&aring;s historia. L&auml;nsstyrelse och landsh&ouml;vding flyttades till Lule&aring; 1856 och staden fick sitt f&ouml;rsta lasarett n&aring;gra &aring;r senare. Ett nytt r&aring;dhus uppr&auml;ttades, den f&ouml;rsta banken &ouml;ppnades 1857 och den f&ouml;rsta telefonledningen installerades 1883. P&aring; Altappen byggdes en s&aring;g och ett j&auml;rnverk, den f&ouml;rsta verkliga storindustrin i l&auml;net, den brann dock senare ned. 1888 invidges malmbanan till G&auml;llivare och 1894 fick Lule&aring; anknytning till Norra stambanan och en regulj&auml;r &aring;ngb&aring;tsf&ouml;rbindelse med Stockholm uppr&auml;ttades. F&ouml;r&auml;ndringar inom n&auml;ringslivet bildade nya sociala klasser vilket resulterade i strejker, facklig organisering och en politisk medvetenhet.</p>\n				<h2>\n					Lule&aring; - St&aring;l och Hamnstaden</h2>\n				<div>\n					<p>\n						Under 1900-talet ersattes jordbruket alltmer med industriell verksamhet. Flera f&ouml;rs&ouml;k att f&ouml;r&auml;dla lapplandsmalmen gjordes och med malmbanan kunde Lule&aring; j&auml;rnverk i Karlsvik invigas 1906. Dess historia blev kort. P&aring; 1940-talet byggdes Norrbottens j&auml;rnverk upp, numera SSAB Lule&aring;, och fick en avg&ouml;rande betydelse f&ouml;r Lule&aring; och hela l&auml;net. Lule&aring; blev allm&auml;nt k&auml;nd som &quot;st&aring;l- och hamnstaden&quot;. Utvecklingen och expansionen under 1800- och 1900-talet har gjort Lule&aring; till Norrbottens ledande stad.</p>\n					<h2>\n						Dagens Lule&aring;</h2>\n					<div>\n						<p>\n							Dagens Lule&aring; &auml;r resultatet av en kommunsammanslagning 1969. D&aring; blev Lule&aring; stad, dagens Nederlule&aring; och R&aring;ne&aring; en storkommun p&aring; 1810 km2. Idag har Lule&aring; ca 72 000 inv&aring;nare och har utvecklats till ett teknologiskt centrum i norr. De viktigaste h&ouml;rnstenarna &auml;r metallurgi, utbildning och forskning samt goda kommunikationer. I Lule&aring; finns flera f&ouml;retag som h&ouml;r till de v&auml;rldsledande inom sin gren, bl a Plannja, SSAB och Scania. Lule&aring; har &auml;ven utvecklats till en stad som kan erbjuda ett rikt kulturliv, ett stort utbud p&aring; fritidsaktiviteter och mycket mera som g&ouml;r Lule&aring; till en trivsam stad att leva i.</p>\n						<p>\n							&nbsp;</p>\n						<p>\n							L&auml;s mer om Lule&aring; p&aring; <a href=\"http://www.lulea.se\">www.lulea.se.</a></p>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>',1,1321559068),(132,'omlarv.utbildningar','<h1>\n	Utbildningar</h1>\n<p>\n	LTU:s utbildningar finns beskrivna p&aring; <a href=\"http://www.ltu.se\">www.ltu.se</a>. D&auml;r kan du &auml;ven l&auml;sa mer om universitetet</p>',1,1321559219),(133,'student.larvcrew','<h1>\n	LARV-Crew</h1>\n<p>\n	Projektgruppen best&aring;r av ett tio-tal studenter som jobbar ideellt med LARV ut&ouml;ver sina studier. Varje person i projektgruppen har huvudansvar &ouml;ver ett omr&aring;de men g&ouml;r &auml;ven st&ouml;rre &ouml;vergripande saker inom projektet. Projektgruppen rekryteras av projektledaren.</p>\n<p>\n	Projektgruppen skall v&auml;rna om LARV:s vision och syfte samt att r&auml;tta sig efter policyn f&ouml;r grafisk form och kommunikation som finns f&ouml;r LARV. Projektgruppsmedlemmarna v&auml;ljer &auml;ven medhj&auml;lpare som kompletterar projektgruppsmedlemmen samt har n&aring;got att tillf&ouml;ra projektet. Antalet medhj&auml;lpare best&auml;ms i samr&aring;d med projektledaren.</p>\n<p>\n	Ut&ouml;ver detta finns sen ytterligare f&ouml;retagsv&auml;rdar, chauff&ouml;rer, serveringspersonal och m&aring;nga andra som hj&auml;lper till.</p>\n<h2>\n	Postbeskrivning f&ouml;r LARV2012-projektgrupp&nbsp;</h2>\n<div>\n	<p>\n		LARV best&aring;r av m&aring;nga delprojekt som tillsammans utg&ouml;r den arbetsmarknadsvecka som &aring;rligen ger oss en ov&auml;rderlig kontakt med framtida arbetsgivare. LARV blir vad vi g&ouml;r det till! LARV projektgrupp beh&ouml;ver dig som har tankar och id&eacute;er, &auml;r kreativ eller strategiskt lagd. Har god planeringsf&ouml;rm&aring;ga, &auml;r en probleml&ouml;sare eller riktig &rdquo;vinnarskalle&rdquo;. Skaffa dig erfarenhet och ett bredare n&auml;tverk... f&ouml;r att inte tala om den d&auml;r extra kryddan till ditt CV.</p>\n	<p>\n		<strong>PR-ansvarig;</strong> som marknadsf&ouml;ringsansvarig &auml;r du den som planerar inf&ouml;r- och leder dem som marknadsf&ouml;r LARV s&aring;v&auml;l inom som utanf&ouml;r universitetets v&auml;ggar. Du har n&auml;ra kontakt med grafisk form och andra samarbetspartners under hela projektets g&aring;ng.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Grafiskform;</strong> du som s&ouml;ker har ett &ouml;ga f&ouml;r f&auml;rg och form och sk&ouml;ter b&aring;de den grafiska profilen, utformning av exempelvis namnskyltar och annan rekvisita, roll-ups, tryck och profilprodukter. Du tr&auml;nar inte bara dina f&auml;rdigheter i formgivning utan &auml;ven samarbete och planering.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>IT-ansvarig;</strong>&nbsp;LARV beh&ouml;ver, inte bara h&auml;nga med i sv&auml;ngarna, utan visa framf&ouml;tterna! Larvhemsidan &auml;r v&aring;r f&ouml;rsta kontakt med f&ouml;retagen. Visa vad en LTU-student g&aring;r f&ouml;r - utveckla LARVhemsidan. Du har &auml;ven m&ouml;jlighet att leda andra i den grupp du sj&auml;lv uppr&auml;ttar f&ouml;r jobbet och har &auml;ven ansvar f&ouml;r wifi p&aring; m&auml;ssan.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Katalogansvarig;&nbsp;</strong>LARVkatalogen &auml;r, &auml;ven den, en stor puck i arbetet med LARV. Du ser till att s&aring;v&auml;l f&ouml;retagen som studenterna &auml;r n&ouml;jda med katalogens inneh&aring;ll vilken s&aring;v&auml;l informerar som f&ouml;rbereder studenten. &nbsp;Hur ser katalogen ut fram&ouml;ver? Tryckt, p&aring; webben eller i en app? H&auml;nger vi med i utvecklingen?</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>M&auml;ssbyggnadsansvarig;</strong>&nbsp;har du koll p&aring; inredning och gott flyt? M&auml;ssan beh&ouml;ver god planering av montrar, tillg&aring;ng till lokaler och n&auml;tverk, god ventilation och n&aring;gon som har t&auml;nkt p&aring; s&auml;kerheten!</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Logistikansvarig;&nbsp;</strong>en hel del gods fraktas under detta event fr&aring;n punkt A till B, &auml;r du den som kan logistik? Du har d&aring; &auml;ven hand om hyrt material och direkt kontakt med s&aring;v&auml;l f&ouml;retag som f&ouml;retagsv&auml;rdar och k&aring;rer p&aring; andra orter.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Transportansvarig;</strong>&nbsp;Dina ansvarsomr&aring;den t&auml;cker bokning, planering och ansvar &ouml;ver bokningssystemet f&ouml;r bussar, taxiverksamhet och de chauff&ouml;rer som slussar s&aring;v&auml;l f&ouml;retagsrepresentanter som off-campusstudenter till och fr&aring;n LARV.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Receptionsansvarig;</strong>&nbsp;med god planeringsf&ouml;rm&aring;ga och ditt ansvar &ouml;ver de personliga samtalen ser du till att studenter och f&ouml;retagen kommer varandra riktigt n&auml;ra. Dessutom ser du till att guida s&aring;v&auml;l f&ouml;retag som studenter r&auml;tt under m&auml;ssdagen och planerar f&ouml;r tillg&aring;ng av fika och lunch.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Bankettansvarig;</strong>&nbsp;efter m&auml;ssan tr&auml;ffas f&ouml;retagare och studenter under mer avslappnade former. Som bankettansvarig organiserar du underh&aring;llning, &rdquo;eftersl&auml;pp&rdquo;, mat och personal. Tar fram offerter och ordnar med dekorationer. Du har &auml;ven ansvar f&ouml;r &rdquo;kv&auml;llen f&ouml;re&rdquo;.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Eventansvarig;</strong>&nbsp;LARV best&aring;r av f&ouml;r- och efterevent med en del festliga inslag, f&ouml;rel&auml;sningar&nbsp;och andra evenemang. Du sk&ouml;ter kontakten med f&ouml;rel&auml;sarna, kommer upp med nya id&eacute;er och sk&ouml;ter bokning av s&aring;v&auml;l mat och lokal. &nbsp;&nbsp;</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Sponsoransvarig;&nbsp;</strong>som ansvarig f&ouml;r spons &auml;r det du som knyter kontakten och f&ouml;rhandlar med sponsorer s&aring; att LARV har tillg&aring;ng till bland annat bilar och rekvisita. Du kontrollerar &auml;ven att avtal efterf&ouml;ljs och sponsorer synligg&ouml;rs som avtalat.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>M&auml;ssv&auml;rd;</strong> m&auml;ssv&auml;rden rekryterar, informerar och matchar f&ouml;retagsv&auml;rdar med f&ouml;retag. Inf&ouml;r och under m&auml;ssan &auml;r det v&auml;rden som leder f&ouml;retagsv&auml;rdarna och ser till att v&auml;rdarna kan besvara f&ouml;retagens fr&aring;gor.</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>Internationell kontakt;</strong>&nbsp;m&aring;nga studenter &auml;r sugna p&aring; internationell karri&auml;r &ndash; s&aring; &auml;ven utbytesstudenter som nu vistas p&aring; LTU. M&aring;nga f&ouml;retag &auml;r globala. S&ouml;k hit om du &auml;r sugen p&aring; spela en viktig roll f&ouml;r s&aring;v&auml;l f&ouml;retag som studenter!</p>\n	<p>\n		&nbsp;</p>\n	<p>\n		<strong>LARV-CREW:</strong> Du som vill vara del av LARV-CREW och agera f&ouml;retagsv&auml;rd, chauff&ouml;r, servit&ouml;r, fuktion&auml;r eller kanske medhj&auml;lpare till ovanst&aring;ende poster; Skicka din intresseanm&auml;lan redan nu!</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321559350),(134,'student.larvcrew','<h1>\n	Projektgruppen</h1>\n<p>\n	Projektgruppen best&aring;r av ett tio-tal studenter som jobbar ideellt med LARV ut&ouml;ver sina studier. Varje person i projektgruppen har huvudansvar &ouml;ver ett omr&aring;de men g&ouml;r &auml;ven st&ouml;rre &ouml;vergripan