	Fullst&auml;ndig anm&auml;lan inneh&aring;ller exakta uppgifter och kan l&auml;mnas som senast en m&aring;nad innan m&auml;ssan.&nbsp;</p>\n	<p>\n		<strong>Den fullst&auml;ndiga anm&auml;lan &ouml;ppnar 2012.11.03</strong></p>\n	<p>\n		<strong>Sista anm&auml;lningsdatum &auml;r 2012.11.25</strong></p>\n</div>\n<p>\n	&nbsp;</p>',1,1321969924),(149,'foretag.signup','<h1>\n	Anm&auml;lan</h1>\n<h2>\n	Arbetsmarknadsdagar.se</h2>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat att f&ouml;renkla f&ouml;r f&ouml;retag att genomf&ouml;ra anm&auml;lningar till de olika m&auml;ssorna. P&aring; arbetsmarknadsdagar.se kan f&ouml;retag idag spara information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en FAQ som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<p>\n	<strong>Inledande anm&auml;lan har st&auml;ngt f&ouml;r i &aring;r. Ni som har f&aring;tt godk&auml;nnande har till den 25 November p&aring; er att fylla i fullst&auml;ndiga anm&auml;lan.</strong></p>\n<div>\n	<a href=\"http://www.arbetsmarknadsdagar.se/\">Till Arbetsmarknadsdagar.se</a></div>\n<h2>\n	Baspaketet</h2>\n<div>\n	<p>\n		<strong>Pris: 15 000SEK</strong></p>\n	<ul>\n		<li>\n			<p>\n				Skjuts till boende eller Campus vid ankomst till Lule&aring;</p>\n		</li>\n		<li>\n			<p>\n				Skjuts till och fr&aring;n boende vid deltagande p&aring; &quot;kv&auml;llen f&ouml;re&quot; och m&auml;ssdagen</p>\n		</li>\n		<li>\n			<p>\n				Monteryta: 3*2 m, h&ouml;jd; 3m</p>\n		</li>\n		<li>\n			<p>\n				F&ouml;retagsv&auml;rd som underst&ouml;djer arbetet f&ouml;r just Ert f&ouml;retag inf&ouml;r och under m&auml;ssdagen</p>\n		</li>\n		<li>\n			<p>\n				2 biljetter till lunch, fika och LARVbankett</p>\n		</li>\n		<li>\n			<p>\n				Uppslag i m&auml;sskatalog(webbaserad)</p>\n		</li>\n		<li>\n			<p>\n				Tr&aring;dl&ouml;s internetuppkoppling</p>\n		</li>\n		<li>\n			<p>\n				El</p>\n		</li>\n		<li>\n			<p>\n				M&ouml;jlighet till personliga samtal med utvalda studenter</p>\n		</li>\n		<li>\n			<p>\n				Tilltr&auml;de till &quot;kv&auml;llen f&ouml;re&quot;</p>\n		</li>\n	</ul>\n	<p>\n		M&ouml;jliga tillval &auml;r bland annat:</p>\n	<ul>\n		<li>\n			<p>\n				Ut&ouml;kad monteryta</p>\n		</li>\n		<li>\n			<p>\n				Fler biljetter; lunch, fika, bankett</p>\n		</li>\n		<li>\n			<p>\n				Rekvisita; stolar, bord, mattor, blommor</p>\n		</li>\n		<li>\n			<p>\n				Monterevenemang (1/12-2011) eller synlighet i samband med Alpinaresa innan LARV (Kontakt med projektledare per telefon; 0706862585</p>\n		</li>\n		<li>\n			<p>\n				Monterupps&auml;ttning&bull; Spridning av utv&auml;rdering; antingen v&aring;r eller en vi tillsammans uppr&auml;ttar s&auml;rskilt f&ouml;r LARV</p>\n		</li>\n		<li>\n			<p>\n				Delgivning av V&aring;r utv&auml;rdering i n&auml;ra anslutning till avslutat LARV&nbsp;</p>\n		</li>\n	</ul>\n	<p>\n		Naturligtvis finns det m&ouml;jligheter att f&aring; en st&ouml;rre monteryta, fler biljetter till bankett, v&auml;xter till montern eller andra tillval. Priser f&ouml;r detta finner ni nedan och detta anm&auml;les i kompletterande anm&auml;lan.&nbsp;</p>\n	<p>\n		*LARV f&ouml;rfakturerar grundpaketet. Eventuella till&auml;gg, inklusive de som &ouml;nskas i kompletterande anm&auml;lan, faktuerars i efterhand. Var v&auml;nlig ange eventuellt ordernummer f&ouml;r faktura.&nbsp;</p>\n	<h3>\n		Tillval</h3>\n	<p>\n		Tillval kan ni hitta i Fullst&auml;ndiga anm&auml;lan. De tidigare prisuppgifter som funnits h&auml;r var f&ouml;r f&ouml;rra &aring;rets m&auml;ssa och g&auml;ller ej. De priser som st&aring;r i fullst&auml;ndiga anm&auml;lan &auml;r de som g&auml;ller.</p>\n</div>\n<h2>\n	Fullst&auml;ndig anm&auml;lan</h2>\n<div>\n	<p>\n		Fullst&auml;ndig anm&auml;lan inneh&aring;ller exakta uppgifter och kan l&auml;mnas som senast en m&aring;nad innan m&auml;ssan.&nbsp;</p>\n	<p>\n		<strong>Den fullst&auml;ndiga anm&auml;lan &ouml;ppnar 2012.11.03</strong></p>\n	<p>\n		<strong>Sista anm&auml;lningsdatum &auml;r 2012.11.25</strong></p>\n</div>\n<p>\n	&nbsp;</p>',1,1321970152),(150,'kontakt.projektgruppen','<h1>\n	Projektgruppen</h1>\n<h2>\n	Marknadstrateg</h2>\n<p>\n	Alexander Leismo</p>\n<p>\n	<a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<h2>\n	GrafiskForm</h2>\n<p>\n	Amanda Nilsson</p>\n<p>\n	<a href=\"mailto:grafiskform@larv.org\">grafiskform@larv.org</a></p>\n<h2>\n	Bankett</h2>\n<p>\n	Emmy Berglund</p>\n<p>\n	<a href=\"mailto:grafiskform@larv.org\">grafiskform@larv.org</a></p>\n<h2>\n	Katalogansvarig</h2>\n<p>\n	Henrik Norberg</p>\n<p>\n	<a href=\"mailto:katalog@larv.org\">katalog@larv.org</a></p>\n<h2>\n	Event</h2>\n<p>\n	Jesper Liljemark Mattsson</p>\n<p>\n	<a href=\"mailto:event@larv.org\">event@larv.org</a></p>\n<h2>\n	Utlandskontakt</h2>\n<p>\n	Johan Rutfors Isaksson</p>\n<p>\n	<a href=\"mailto:international@larv.org\">international@larv.org</a></p>\n<h2>\n	IT</h2>\n<p>\n	Kristian Nordman</p>\n<p>\n	<a href=\"mailto:it@larv.org\">it@larv.org</a></p>\n<h2>\n	Reception &amp; Pers Samtal</h2>\n<p>\n	Kristin Kammensj&ouml;</p>\n<p>\n	<a href=\"mailto:reception@larv.org\">reception@larv.org</a></p>\n<h2>\n	M&auml;ssv&auml;rd</h2>\n<p>\n	Lisa Flemstr&ouml;m</p>\n<p>\n	<a href=\"mailto:massvard@larv.org\">massvard@larv.org</a></p>\n<h2>\n	M&auml;ssbyggnad</h2>\n<p>\n	Patrik Svensson</p>\n<p>\n	<a href=\"mailto:massbyggnad@larv.org\">massbyggnad@larv.org</a></p>\n<h2>\n	Transport</h2>\n<p>\n	Simon Berglund</p>\n<p>\n	<a href=\"mailto:transport@larv.org\">transport@larv.org</a></p>\n<h2>\n	Sponsoransvarig</h2>\n<p>\n	Staffan Bj&ouml;rklund</p>\n<p>\n	<a href=\"mailto:spons@larv.org\">spons@larv.org</a></p>\n<h2>\n	Logistik</h2>\n<p>\n	Adam &Ouml;str&ouml;m</p>\n<p>\n	<a href=\"mailto:logistik@larv.oro\">logistik@larv.org</a></p>',1,1321970652),(151,'kontakt','<h1>\n	Projektledare</h1>\n<div class=\"top2\">\n	<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Projektledaren &auml;r &auml;ven Arbetsmarknadsenhetens ordf&ouml;rande p&aring; Teknologk&aring;ren. Att vara projektledare f&ouml;r LARV ing&aring;r i dennes uppgifter. Denna post tills&auml;tts av K&aring;rfullm&auml;ktige och &auml;r en helarvoderad post, vilket inneb&auml;r att denne f&ouml;rtroendevalda person tar ett &aring;rs uppeh&aring;ll fr&aring;n studierna.</p>\n</div>\n<div class=\"top2\">\n	<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Eftersom Teknologk&aring;ren ing&aring;r i Reftec sitter projektledaren med i ARG, ARbetsmarknadsGruppen inom Reftec.<br />\n		Du finner mer information om ARG och Reftec&nbsp;<a href=\"http://larv.org/foretag/reftecarg/\" style=\"color: rgb(152, 27, 30); \">h&auml;r</a>.</p>\n</div>\n<div class=\"top2\">\n	<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n		Kontaktuppgifter</p>\n	<div>\n		<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n			<strong>Projektledare LARV</strong><br />\n			<font class=\"Apple-style-span\" color=\"#981b1e\"><img src=\"http://larv2012.scripter.se/images/crew/37-105_158-SofieBucht_color.jpg\" style=\"background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white; padding-top: 1px; padding-right: 1px; padding-bottom: 1px; padding-left: 1px; border-top-color: rgb(0, 0, 0); border-right-color: rgb(0, 0, 0); border-bottom-color: rgb(0, 0, 0); border-left-color: rgb(0, 0, 0); border-top-width: 1px; border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; margin-left: 5px; margin-right: 5px; margin-top: 5px; margin-bottom: 5px; \" /></font><br />\n			Sofie Bucht<br />\n			Email:&nbsp;<a href=\"mailto:ao@teknologkaren.se\" style=\"color: rgb(152, 27, 30); \">ao@teknologkaren.se</a><br />\n			Mobil: 070-686 25 85</p>\n		<p style=\"color: rgb(0, 0, 0); margin-top: 0px; margin-right: 0px; margin-bottom: 5px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; line-height: 15px; \">\n			&nbsp;</p>\n	</div>\n	<div>\n		<p>\n			<strong>Vice projektledare</strong><br />\n			<font class=\"Apple-style-span\" color=\"#981b1e\"><img src=\"http://larv2012.scripter.se/images/crew/linus_color.jpg\" style=\"background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: white; padding-top: 1px; padding-right: 1px; padding-bottom: 1px; padding-left: 1px; border-top-color: rgb(0, 0, 0); border-right-color: rgb(0, 0, 0); border-bottom-color: rgb(0, 0, 0); border-left-color: rgb(0, 0, 0); border-top-width: 1px; border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; margin-left: 5px; margin-right: 5px; margin-top: 5px; margin-bottom: 5px; width: 105px; height: 157px; \" /></font><br />\n			Linus Winther<br />\n			Email:&nbsp;<a href=\"mailto:avo@teknologkaren.se\" style=\"color: rgb(152, 27, 30); \">avo@teknologkaren.se</a><br />\n			Mobil: 070-825 66 43</p>\n		<p>\n			&nbsp;</p>\n	</div>\n</div>\n<p>\n	&nbsp;</p>',1,1321972380),(152,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<p>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</p>\n	<p>\n		Vid fr&aring;gor, kontakta transport@larv.org</p>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<p>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rd ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.<br />\n			Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning.</p>\n		<p>\n			<br />\n			Matchningen mellan v&auml;rd och f&ouml;retag kommer att g&ouml;ras efter 25:e november, du blir d&aring; kontaktad via mail f&ouml;r att &ouml;nska f&ouml;retag. Vid tilldelningen av f&ouml;retag kommer det att tas h&auml;nsyn till om du har varit engagerad inom LARV tidigare, hur l&aring;ngt du har kommit i din utbildning samt &ouml;vrigt engagemang som g&ouml;r dig till en bra ambassad&ouml;r. Datum n&auml;r du gjort din intresseanm&auml;lan f&ouml;r att vara f&ouml;retagsv&auml;rd kan &auml;ven vara avg&ouml;rande vid tilldelningen, s&aring; anm&auml;l dig s&aring; snart som m&ouml;jligt.</p>\n		<p>\n			<br />\n			Vid fr&aring;gor, kontakta <a href=\"mailto:massvard@larv.org\">massvard@larv.org</a></p>\n	</div>\n</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>\n<h2>\n	Gods</h2>\n<p>\n	Som godsarbetare arbetar du p&aring; Godsmotagningen med att hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</p>\n<p>\n	Har du fr&aring;gor skicka dem till logistik@larv.org</p>\n<h2>\n	Event</h2>\n<div>\n	<p>\n		Som Eventv&auml;rd f&ouml;r LARV kommer du att hj&auml;lpa till med att g&ouml;ra LARV till den arbetsmarknadsvecka som namnet syftar till. Tr&auml;ffa f&ouml;retagen p&aring; ett helt annat vis &auml;n du g&ouml;r under m&auml;ssan. Det du ska g&ouml;ra &auml;r att se till s&aring; att eventen g&aring;r smidigt genom att se till s&aring; att cateringen kommer p&aring; plats, att skriva ut utv&auml;rderingar &aring;t f&ouml;retagen mm. &nbsp;Du kommer att hinna bes&ouml;ka m&auml;ssan under dagen d&aring; det mesta av arbetet kommer att vara veckan innan LARV. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.</p>\n	<p>\n		Har du fr&aring;gor skicka dem till event@larv.org</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321972658),(153,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<p>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</p>\n	<p>\n		Vid fr&aring;gor, kontakta transport@larv.org</p>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<p>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rd ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.<br />\n			Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning.</p>\n		<p>\n			Matchningen mellan v&auml;rd och f&ouml;retag kommer att g&ouml;ras efter 25:e november, du blir d&aring; kontaktad via mail f&ouml;r att &ouml;nska f&ouml;retag. Vid tilldelningen av f&ouml;retag kommer det att tas h&auml;nsyn till om du har varit engagerad inom LARV tidigare, hur l&aring;ngt du har kommit i din utbildning samt &ouml;vrigt engagemang som g&ouml;r dig till en bra ambassad&ouml;r. Datum n&auml;r du gjort din intresseanm&auml;lan f&ouml;r att vara f&ouml;retagsv&auml;rd kan &auml;ven vara avg&ouml;rande vid tilldelningen, s&aring; anm&auml;l dig s&aring; snart som m&ouml;jligt.</p>\n		<p>\n			Vid fr&aring;gor, kontakta <a href=\"mailto:massvard@larv.org\">massvard@larv.org</a></p>\n	</div>\n</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta reception@larv.org</p>\n<h2>\n	Gods</h2>\n<p>\n	Som godsarbetare arbetar du p&aring; Godsmotagningen med att hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</p>\n<p>\n	Har du fr&aring;gor skicka dem till logistik@larv.org</p>\n<h2>\n	Event</h2>\n<div>\n	<p>\n		Som Eventv&auml;rd f&ouml;r LARV kommer du att hj&auml;lpa till med att g&ouml;ra LARV till den arbetsmarknadsvecka som namnet syftar till. Tr&auml;ffa f&ouml;retagen p&aring; ett helt annat vis &auml;n du g&ouml;r under m&auml;ssan. Det du ska g&ouml;ra &auml;r att se till s&aring; att eventen g&aring;r smidigt genom att se till s&aring; att cateringen kommer p&aring; plats, att skriva ut utv&auml;rderingar &aring;t f&ouml;retagen mm. &nbsp;Du kommer att hinna bes&ouml;ka m&auml;ssan under dagen d&aring; det mesta av arbetet kommer att vara veckan innan LARV. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.</p>\n	<p>\n		Har du fr&aring;gor skicka dem till event@larv.org</p>\n</div>\n<p>\n	&nbsp;</p>',1,1321972675),(154,'kontakt.faq','<h1>\n	Vanliga Fr&aring;gor och Svar</h1>\n<p>\n	Q: Var ska jag v&auml;nda mig om jag har fr&aring;gor om anm&auml;lan?</p>\n<p>\n	A: Det &auml;r Vice Ordf&ouml;rande tillika vice Projektledare f&ouml;r LARV som tar hand om dessa fr&aring;gor. Han f&aring;r du tag p&aring; via <a href=\"mailto:viceprojektledare@larv.org\">viceprojektledare@larv.org</a>.</p>',1,1322488838),(155,'kontakt.faq','<h1>\n	Vanliga Fr&aring;gor och Svar</h1>\n<p>\n	Q: Var ska jag v&auml;nda mig om jag har fr&aring;gor om anm&auml;lan?</p>\n<p>\n	A: Det &auml;r Vice Ordf&ouml;rande tillika vice Projektledare f&ouml;r LARV som tar hand om dessa fr&aring;gor. Han f&aring;r du tag p&aring; via <a href=\"mailto:viceprojektledare@larv.org\">viceprojektledare@larv.org</a>.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Q: Min fr&aring;ga finns inte h&auml;r!</p>\n<p>\n	A: Om du inte hittar r&auml;tt person att ta kontakt med finns b&aring;de&nbsp;<a href=\"mailto:viceprojektledare@larv.org\">Vice Projektledare</a>&nbsp;och <a href=\"mailto:info@larv.org\">Info</a>&nbsp;som kan ta emot din fr&aring;ga.</p>',1,1322489442),(156,'kontakt.projektgruppen','<h1>\n	Projektgruppen</h1>\n<h2>\n	Marknadstrateg</h2>\n<p>\n	PR har ansvar f&ouml;r norrbottensrummet och &auml;ven information g&auml;llande att f&aring; ut info till studenter och f&ouml;retag. PR ansvarar &auml;ven f&ouml;r att f&aring; ut information till Pite&aring;, Skellefte&aring; och Kiruna.</p>\n<p>\n	Alexander Leismo</p>\n<p>\n	<a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<h2>\n	GrafiskForm</h2>\n<p>\n	Amanda Nilsson</p>\n<p>\n	<a href=\"mailto:grafiskform@larv.org\">grafiskform@larv.org</a></p>\n<h2>\n	Bankett</h2>\n<p>\n	Emmy Berglund</p>\n<p>\n	<a href=\"mailto:bankett@larv.org\">bankett@larv.org</a></p>\n<h2>\n	Katalogansvarig</h2>\n<p>\n	Henrik Norberg</p>\n<p>\n	<a href=\"mailto:katalog@larv.org\">katalog@larv.org</a></p>\n<h2>\n	Event</h2>\n<p>\n	Jesper Liljemark Mattsson</p>\n<p>\n	<a href=\"mailto:event@larv.org\">event@larv.org</a></p>\n<h2>\n	Utlandskontakt</h2>\n<p>\n	Johan Rutfors Isaksson</p>\n<p>\n	<a href=\"mailto:international@larv.org\">international@larv.org</a></p>\n<h2>\n	IT</h2>\n<p>\n	Kristian Nordman</p>\