\n		<p>\n			Kontakta mig vid fr&aring;gor som ber&ouml;r:</p>\n		<p>\n			Reception<br />\n			Personliga samtal<br />\n			Lounge<br />\n			Funktion&auml;rer</p>\n		<p>\n			<a href=\"mailto:reception@larv.org\">reception@larv.org</a></p>\n	</div>\n</div>\n<div style=\"float: left; clear: both; margin-bottom: 20px\">\n	<img alt=\"Lisa Flemström\" src=\"/images/crew/lisa.jpg\" style=\"font-size: 12px; float: left; width: 154px; height: 200px; \" />\n	<div style=\"float: left; width: 390px; margin-left: 5px\">\n		<h2>\n			M&auml;ssv&auml;rd</h2>\n		<p>\n			<strong>Lisa Flemstr&ouml;m</strong></p>\n		<p>\n			M&auml;ssv&auml;rden rekryterar, informerar och matchar f&ouml;retagsv&auml;rdarna med f&ouml;retag. Kontakta m&auml;ssv&auml;rden om du har fr&aring;gor som &auml;r relaterade till f&ouml;retagsv&auml;rdarna.&nbsp;</p>\n		<p>\n			<a href=\"mailto:massvard@larv.org\">massvard@larv.org</a></p>\n	</div>\n</div>\n<div style=\"float: left; clear: both; margin-bottom: 20px\">\n	<img alt=\"Patrik Svensson\" src=\"/images/crew/patrick.jpg\" style=\"font-size: 12px; float: left; width: 154px; height: 200px; \" />\n	<div style=\"float: left; width: 390px; margin-left: 5px\">\n		<h2>\n			M&auml;ssbyggnad</h2>\n		<p>\n			<strong>Patrik Svensson</strong></p>\n		<p>\n			&nbsp;</p>\n		<p>\n			<a href=\"mailto:massbyggnad@larv.org\">massbyggnad@larv.org</a></p>\n	</div>\n</div>\n<div style=\"float: left; clear: both; margin-bottom: 20px\">\n	<img alt=\"Simon Berglund\" src=\"/images/crew/simon.jpg\" style=\"font-size: 12px; float: left; width: 154px; height: 200px; \" />\n	<div style=\"float: left; width: 390px; margin-left: 5px\">\n		<h2>\n			Transport</h2>\n		<p>\n			<strong>Simon Berglund</strong></p>\n		<p>\n			<a href=\"mailto:transport@larv.org\">transport@larv.org</a></p>\n	</div>\n</div>\n<div style=\"float: left; clear: both; margin-bottom: 20px\">\n	<img alt=\"Staffan Björklund\" src=\"/images/crew/staffan.jpg\" style=\"font-size: 12px; float: left; width: 154px; height: 200px; \" />\n	<div style=\"float: left; width: 390px; margin-left: 5px\">\n		<h2>\n			Sponsoransvarig</h2>\n		<p>\n			<strong>Staffan Bj&ouml;rklund</strong></p>\n		<p>\n			Kontakta mig ang&aring;ende fr&aring;gor som g&auml;ller Sponsring och Bes&ouml;k fr&aring;n andra Universitet.</p>\n		<p>\n			<a href=\"mailto:spons@larv.org\">spons@larv.org</a></p>\n	</div>\n</div>\n<div style=\"float: left; clear: both; margin-bottom: 20px\">\n	<img alt=\"Adam Öström\" src=\"/images/crew/adam.jpg\" style=\"font-size: 12px; float: left; width: 154px; height: 200px; \" />\n	<div style=\"float: left; width: 390px; margin-left: 5px\">\n		<h2>\n			Logistik</h2>\n		<p>\n			<strong>Adam &Ouml;str&ouml;m</strong></p>\n		<p>\n			<a href=\"mailto:logistik@larv.oro\">logistik@larv.org</a></p>\n	</div>\n</div>\n<p>\n	&nbsp;</p>',1,1322774025),(174,'foretag.norrbottensrummet','<p>\n	&nbsp;</p>\n<h1>\n	<font size=\"6\">LARV 2012</font></h1>\n<p>\n	V&auml;lkommen till Norrbottensrummet p&aring; LARV 2012. Lule&aring; Tekniska Universitets arbetsmarknadsvecka inbjuder ditt f&ouml;retag att f&aring; vara med i LARV. I &aring;r &aring;terkommer norrbottensrummet som &auml;r en s&auml;rskild avdelning under m&auml;ssdagen d&auml;r enbart f&ouml;retag fr&aring;n norrbotten kommer att st&aring; och med ett begr&auml;nsad antal anst&auml;llda p&aring; max 100. Detta vill vi kunna erbjuda mindre f&ouml;retag som &auml;ven ni &ouml;nskar f&aring; student relationer men inte &auml;r i samma storlek som dem allra st&ouml;rsta f&ouml;retagen. Ta chansen att f&aring; tr&auml;ffa studenter inom tekniska grenar men &auml;ven i &aring;r humanistiska.</p>\n<p>\n	<br />\n	Pris. 5000:-<br />\n	I priset ing&aring;r</p>\n<ul>\n	<li>\n		<p>\n			2 bankettbiljetter (3 R&auml;tters)</p>\n	</li>\n	<li>\n		<p>\n			En B2B mingeltr&auml;ff kv&auml;llen f&ouml;re 24/1</p>\n	</li>\n	<li>\n		<p>\n			Lunch fika under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			1 Bankett biljett.</p>\n	</li>\n	<li>\n		<p>\n			St&aring;bord; m&ouml;jlighet f&ouml;r eran rollup</p>\n	</li>\n</ul>\n<p>\n	Nytt f&ouml;r i &aring;r &auml;r att genomfl&ouml;det p&aring; studenter kommer att &ouml;ka d&aring; placeringen kommer att vara ny st&aring; vid (Receptionen i B-huset) samt att en fika avdelning kommer att vara i n&auml;rheten.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Anm&auml;lan g&ouml;rs p&aring;: <a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<p>\n	D&auml;refter f&aring;r ni ett mail om ytterligare praktiskt information om LARV.&nbsp;</p>',1,1322774278),(175,'foretag.norrbottensrummet','<h1>\n	LARV 2012</h1>\n<p>\n	V&auml;lkommen till Norrbottensrummet p&aring; LARV 2012. Lule&aring; Tekniska Universitets arbetsmarknadsvecka inbjuder ditt f&ouml;retag att f&aring; vara med i LARV. I &aring;r &aring;terkommer norrbottensrummet som &auml;r en s&auml;rskild avdelning under m&auml;ssdagen d&auml;r enbart f&ouml;retag fr&aring;n norrbotten kommer att st&aring; och med ett begr&auml;nsad antal anst&auml;llda p&aring; max 100. Detta vill vi kunna erbjuda mindre f&ouml;retag som &auml;ven ni &ouml;nskar f&aring; student relationer men inte &auml;r i samma storlek som dem allra st&ouml;rsta f&ouml;retagen. Ta chansen att f&aring; tr&auml;ffa studenter inom tekniska grenar men &auml;ven i &aring;r humanistiska.</p>\n<p>\n	<br />\n	Pris. 5000:-<br />\n	I priset ing&aring;r</p>\n<ul>\n	<li>\n		<p>\n			2 bankettbiljetter (3 R&auml;tters)</p>\n	</li>\n	<li>\n		<p>\n			En B2B mingeltr&auml;ff kv&auml;llen f&ouml;re 24/1</p>\n	</li>\n	<li>\n		<p>\n			Lunch fika under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			1 Bankett biljett.</p>\n	</li>\n	<li>\n		<p>\n			St&aring;bord; m&ouml;jlighet f&ouml;r eran rollup</p>\n	</li>\n</ul>\n<p>\n	Nytt f&ouml;r i &aring;r &auml;r att genomfl&ouml;det p&aring; studenter kommer att &ouml;ka d&aring; placeringen kommer att vara ny st&aring; vid (Receptionen i B-huset) samt att en fika avdelning kommer att vara i n&auml;rheten.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Anm&auml;lan g&ouml;rs p&aring;: <a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<p>\n	D&auml;refter f&aring;r ni ett mail om ytterligare praktiskt information om LARV.&nbsp;</p>',1,1322774284),(176,'foretag.norrbottensrummet','<h1>\n	LARV 2012</h1>\n<p>\n	V&auml;lkommen till Norrbottensrummet p&aring; LARV 2012. Lule&aring; Tekniska Universitets arbetsmarknadsvecka inbjuder ditt f&ouml;retag att f&aring; vara med i LARV. I &aring;r &aring;terkommer norrbottensrummet som &auml;r en s&auml;rskild avdelning under m&auml;ssdagen d&auml;r enbart f&ouml;retag fr&aring;n norrbotten kommer att st&aring; och med ett begr&auml;nsad antal anst&auml;llda p&aring; max 100. Detta vill vi kunna erbjuda mindre f&ouml;retag som &auml;ven ni &ouml;nskar f&aring; student relationer men inte &auml;r i samma storlek som dem allra st&ouml;rsta f&ouml;retagen. Ta chansen att f&aring; tr&auml;ffa studenter inom tekniska grenar men &auml;ven i &aring;r humanistiska.</p>\n<p>\n	<br />\n	Pris. 5000:-<br />\n	I priset ing&aring;r</p>\n<ul>\n	<li>\n		<p>\n			2 bankettbiljetter (3 R&auml;tters)</p>\n	</li>\n	<li>\n		<p>\n			En B2B mingeltr&auml;ff kv&auml;llen f&ouml;re 24/1</p>\n	</li>\n	<li>\n		<p>\n			Lunch fika under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			1 Bankett biljett.</p>\n	</li>\n	<li>\n		<p>\n			St&aring;bord; m&ouml;jlighet f&ouml;r eran rollup</p>\n	</li>\n</ul>\n<p>\n	Nytt f&ouml;r i &aring;r &auml;r att genomfl&ouml;det p&aring; studenter kommer att &ouml;ka d&aring; placeringen kommer att vara ny st&aring; vid (Receptionen i B-huset) samt att en fika avdelning kommer att vara i n&auml;rheten.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Sista Anm&auml;lningsdag: 25 December</p>\n<p>\n	Anm&auml;lan g&ouml;rs p&aring;: <a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<p>\n	D&auml;refter f&aring;r ni ett mail om ytterligare praktiskt information om LARV.&nbsp;</p>',1,1322775412),(177,'foretag.boende','<h1>\n	Hotell - utst&auml;llare p&aring; LARV</h1>\n<p>\n	<font size=\"2\">Enkelrum:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 720:-/natt inkl frukost, exkl. moms (ord pris 1059:-/natt)</font></p>\n<p>\n	<font size=\"2\">Dubbelrum&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 895:-/natt inkl frukost, exkl. moms (ord pris 1234:-/natt)</font><br />\n	<br />\n	<font size=\"2\">Det finns inga rum f&ouml;rbokade utan erbjudandet g&auml;ller efter tillg&aring;ng - s&aring; best&auml;ll i tid. Utst&auml;llarna h&auml;nvisar till LARV n&auml;r de ringer och bokar.</font><br />\n	<br />\n	<a href=\"http://www.nordkalotten.com/\" target=\"_blank\"><img align=\"bottom\" src=\"/images/upload/nordkalotten.jpg\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-top-style: solid; border-right-style: solid; border-bottom-style: solid; border-left-style: solid; width: 200px; height: 60px; \" /></a><br />\n	<br />\n	<b><font size=\"2\"><font color=\"#000000\">Nordkalotten hotell &amp; konferens</font></font></b><br />\n	<font size=\"1\"><font color=\"#000000\">Lulviksv&auml;gen 1</font></font><br />\n	<font size=\"1\"><font color=\"#000000\">SE-972 54 Lule&aring;</font></font><br />\n	<font size=\"1\"><font color=\"#000000\">V&auml;xel:&nbsp;+46 920 200 000</font></font><br />\n	<font size=\"1\"><a href=\"http://www.nordkalotten.com/\" target=\"_blank\">www.nordkalotten.com</a></font></p>',1,1322776460),(178,'foretag.evenemang','<h1>\n	Kv&auml;llen F&ouml;re</h1>\n<div>\n	<p>\n		&rdquo;Kv&auml;llen f&ouml;re&rdquo;, &auml;r ett tillf&auml;lle f&ouml;r f&ouml;retagsrepresentanter och studenter som hj&auml;lper till med m&auml;ssan att ta det lugnt, l&auml;ra k&auml;nna varann b&auml;ttre och &auml;ta gott.</p>\n	<p>\n		Kv&auml;llen b&ouml;rjar oftast 18:00 p&aring; STUK Bar &amp; Restaurang, d&auml;r det serveras en mat och dryck. Trubadurlaget underh&aring;ller med musik.</p>\n	<p>\n		Sista avg&aring;ngen f&ouml;r transport hem brukar vara klockan 23:00 och STUK st&auml;nger d&ouml;rrarna klockan 00:00.</p>\n	<p>\n		&quot;Kv&auml;llen f&ouml;re&quot; f&ouml;r LARV 2012 blir dessutom n&aring;got lite extra! Se till att inte missa denna afton!&nbsp;</p>\n</div>\n<h1>\n	Bankett</h1>\n<p>\n	Banketten h&aring;lles p&aring; kv&auml;llen efter m&auml;ssdagen och &auml;r ett tillf&auml;lle f&ouml;r f&ouml;retag och studenter att tala vidare kring m&ouml;tet tidigare under dagen och skaffa sig en b&auml;ttre bild av varandra.&nbsp;</p>\n<p>\n	Kv&auml;llen bjuder p&aring; underh&aring;llning och tal fr&aring;n samarbetspartners &nbsp;och givetvis god den goda maten!&nbsp;</p>\n<p>\n	Banketten h&aring;lles p&aring; STUK Bar &amp; Restaurang och transport tillbaka till boende st&aring;r vi &auml;ven h&auml;r f&ouml;r!&nbsp;</p>\n<h1>\n	Personliga Samtal</h1>\n<div>\n	<p style=\"margin-bottom: 0in; \">\n		Personligt samtal, kontaktsamtal, f&ouml;retagsdejt eller exklusivt h&auml;ng med f&ouml;retag &ndash; k&auml;rt barn har m&aring;nga namn! Detta &auml;r chansen att ta sig undan montrar och m&auml;ssans virrvarr till ett f&ouml;rbokat samtal i enskilt rum med en intressant student / ett intressant f&ouml;retag.</p>\n	<p style=\"margin-bottom: 0in; \">\n		F&ouml;r er som f&ouml;retag erbjuds personliga samtal f&ouml;r att g&ouml;ra m&ouml;tet med studenter s&aring; meningsfullt som m&ouml;jligt. Ta del av CV fr&aring;n studenter som visar intresse f&ouml;r just Er och boka samtal med dessa under m&auml;ssdagen. Ta anst&auml;llningsintervjun direkt p&aring; m&auml;ssan eller v&auml;ck ett intresse hos studenter genom att vara tillg&auml;ngliga &ndash; det finns ingenting att f&ouml;rlora.</p>\n	<p style=\"margin-bottom: 0in; \">\n		Samtalen &auml;r 20-30 min l&aring;nga och sker i grupprum p&aring; Campus under m&auml;ssdagen den 25 januari.</p>\n	<p style=\"margin-bottom: 0in; \">\n		Som f&ouml;retag kan ni anm&auml;la att ni vill erbjuda personliga samtal i Fullst&auml;ndiga Anm&auml;lan. Ni kommer f&aring; mer information via mail eller telefon d&aring; bokning &ouml;ppnar.</p>\n	<p style=\"margin-bottom: 0in; \">\n		&nbsp;</p>\n	<p style=\"margin-bottom: 0in; \">\n		Vid fr&aring;gor, tveka inte att kontakta</p>\n	<p style=\"margin-bottom: 0in; \">\n		<i>Kristin Kammensj&ouml;</i></p>\n	<p style=\"margin-bottom: 0in; \">\n		<a href=\"mailto:reception@larv.org\">reception@larv.org</a></p>\n	<p style=\"margin-bottom: 0in; \">\n		<i>0762-04 12 68</i></p>\n	<h1 style=\"margin-bottom: 0in; \">\n		Fler Evenemang</h1>\n</div>\n<p>\n	Det finns &auml;ven utrymme f&ouml;r fler evenemang och aktiviteter. M&aring;nga f&ouml;rberedande aktiviteter planeras f&ouml;r dagarna innan m&auml;ssdagen. Ofta g&aring;r dessa f&ouml;raktiviteter under temat &quot;rekryteringsprocessen&quot; men kan &auml;ven ha mer popul&auml;rvetenskaplig natur!</p>\n<p>\n	Vill just Ert f&ouml;retag vara med och arrangera en f&ouml;raktivitet!? Ta d&aring; kontakt med oss eller ta upp detta i samband med inbjudan/anm&auml;lan!&nbsp;</p>',1,1322776513),(179,'foretag.gods','<h1>\n	OM GODS TILL LARV 2012</h1>\n<h2>\n	Gods&nbsp;m&auml;rkes enligt:</h2>\n<p>\n	&quot;LARV 2012&quot;<br />\n	070- 332 02 92<br />\n	Lule&aring; tekniska universitet<br />\n	Laboratoriev&auml;gen<br />\n	Godsmottagningen<br />\n	971 87 Lule&aring;&nbsp;</p>\n<h2>\n	Datum och fraktkrav</h2>\n<p>\n	Godset ska skickas s&aring; att det &auml;r framme p&aring; universitetet m&aring;ndag 23/1 eller tisdag 24/1. Uppbyggnad av m&auml;ssa p&aring;b&ouml;rjas 16.00 tisdag den 24/1.&nbsp; &Ouml;nskar ni skicka&nbsp;gods&nbsp;innan dessa datum ska logistikansvarig kontaktas. Skickas&nbsp;gods&nbsp;med t&aring;g eller bussgods m&aring;ste frakt vidare till Universitetet ombes&ouml;rjas av f&ouml;retaget sj&auml;lv.&nbsp;<b><u>Godset f&aring;r inte vara h&ouml;gre &auml;n 1,7m.</u></b>&nbsp;Avviker ert&nbsp;gods&nbsp;fr&aring;n h&ouml;jdkravet s&aring; m&aring;ste ni h&ouml;ra av er till logistikansvarig.</p>\n<h2>\n	Retur eller vidares&auml;ndning av&nbsp;gods</h2>\n<p>\n	Om ni i er fullst&auml;ndiga anm&auml;lan valt&nbsp;att LARV sk&ouml;ter frakten av ert&nbsp;gods&nbsp;till annan m&auml;ssa beh&ouml;ver ni inte boka n&aring;gon returfrakt. Kom ih&aring;g att skriva/kontakta logistikansvarig ang&aring;ende vilken m&auml;ssa det g&auml;ller. Skall&nbsp;gods&nbsp;tillbaka till f&ouml;retaget efter m&auml;ssan bokas detta av f&ouml;retaget sj&auml;lvt.Viktigt &auml;r att ni har med<b><u>&nbsp;en FRAKTSEDEL f&ouml;r returen</u></b>. Detta &auml;r viktigt att komma ih&aring;g eftersom att vi p&aring; LTU endast har sedlar som &auml;r f&ouml;rtryckta med Universitetets kundnummer.&nbsp;</p>\n<h2>\n	<i>Kontroll och kontakt</i></h2>\n<p>\n	Innan m&auml;ssan kommer ni bli kontaktade av en f&ouml;retagsv&auml;rd som kommer att st&auml;lla fr&aring;gor om ert&nbsp;gods. Antal kollin, dimensioner, vikt, vilken spedit&ouml;r ni anv&auml;nder er av f&ouml;r frakten till LTU o.s.v. Efter m&auml;ssan ansvarar f&ouml;retagsv&auml;rdarna och f&ouml;retagsrepresentanterna f&ouml;r att packa ihop f&ouml;retagets monter och ta den till uppsamlingsplats. Mer information om hur utl&auml;mning och packning av montrar kommer att ske ges av f&ouml;retagsv&auml;rdarna vid kontakt innan m&auml;ssan.<br />\n	<br />\n	Fr&aring;gor och funderingar skickas till:<br />\n	<br />\n	Adam &Ouml;str&ouml;m<br />\n	<a href=\"mailto:logistik@larv.org\">logistik@larv.org</a><br />\n	070 - 332 02 92 (09-16 vardagar)&nbsp;</p>',1,1322776766),(180,'student.faq','<h1>\n	Vanliga fr&aring;gor om att arbeta p&aring; LARV</h1>\n<p>\n	<strong>Varf&ouml;r ska man jobba som v&auml;rd p&aring; LARV2012?</strong></p>\n<p>\n	Svar: Att jobba som v&auml;rd p&aring; LARV &auml;r roligt. Du f&aring;r inblick i hur arbetet med att arrangera en arbetsmarknadsm&auml;ssa fungerar. Du f&aring;r tr&auml;ffa mycket nytt folk, b&aring;de studenter fr&aring;n olika program och &aring;rskurser samt f&ouml;retagsrepresentanter. Dessutom f&aring;r du g&aring; p&aring; en hejdundrandes bankett.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vem kan s&ouml;ka till v&auml;rd?</strong></p>\n<p>\n	Svar: Alla som pluggar p&aring; LTU kan s&ouml;ka till v&auml;rd, oavsett &aring;rskurs, program och k&aring;rtillh&ouml;righet. Du m&aring;ste d&auml;remot vara medlem i n&aring;gon utav k&aring;rerna.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Hur s&ouml;ker man till v&auml;rd?</strong></p>\n<p>\n	Svar: Under fliken &quot;Anm&auml;lan arbeta med LARV&quot; kommer man framtill 20 december, kunna s&ouml;ka till v&auml;rd. Det &auml;r inte f&ouml;rst till kvarn som g&auml;ller utan alla som skickar in sin ans&ouml;kan kommer ha lika stor chans.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Ska jag skicka med betyg eller CV?</strong></p>\n<p>\n	Svar: Du beh&ouml;ver inte skicka in betyg eller CV, det r&auml;cker med att fylla i uppgifterna i anm&auml;lningsformul&auml;ret.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>N&auml;r &auml;r sista dagen man kan s&ouml;ka?</strong></p>\n<p>\n	Svar: Sista dagen &auml;r 20 december klockan 24.00</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vilka olika typer av arbeten kan man s&ouml;ka?</strong></p>\n<p>\n	Svar: De olika v&auml;rdarna &auml;r f&ouml;retagsv&auml;rd, chauff&ouml;r, m&auml;ssv&auml;rd, event, gods och inredning. Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa mer om vad respektive arbete inneb&auml;r</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vad f&aring;r man n&auml;r man jobbar som v&auml;rd?</strong></p>\n<p>\n	Svar: Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa vad respektive v&auml;rd f&aring;r f&ouml;r sitt arbete p&aring; LARV2012. Under m&auml;ssan f&aring;r man ocks&aring; fika och lunch b&aring;da dagarna.</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>N&auml;r ska man jobba?</strong></p>\n<p>\n	Svar: Under fliken &quot;V&auml;rdkategorier&quot; kan du l&auml;sa n&auml;r respektive v&auml;rd ska jobba.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong>Vad ska man ha p&aring; sig n&auml;r man jobbar?</strong></p>\n<p>\n	Svar: Alla som jobbar med LARV kommer att f&aring; en pik&eacute;tr&ouml;ja att jobba i.&nbsp;</p>\n<p>\n	&nbsp;</p>\n<p>\n	Har du ytterligare fr&aring;gor, maila <a href=\"mailto:info@larv.org\">info@larv.org</a></p>',1,1323173360),(181,'student.categories','<h1>\n	V&auml;rdkategorier</h1>\n<p>\n	Nedan presenteras de olika typerna av arbeten som du kan s&ouml;ka inf&ouml;r LARV2012. T&auml;nk &auml;ven p&aring; att om du tackar ja till att arbeta som v&auml;rd p&aring; LARV2012 &auml;r du skyldig att hitta en ers&auml;ttare om du skulle f&aring; f&ouml;rhinder.</p>\n<h2>\n	Chauff&ouml;rer</h2>\n<div>\n	<p>\n		Som chauff&ouml;r kommer du att ha n&auml;ra kontakt med f&ouml;retagsrepresentanterna. Du kommer, tillsammans med en annan chauff&ouml;r, att ansvara f&ouml;r ett fordon under m&auml;ssdagarna. Detta inneb&auml;r att h&auml;mta/l&auml;mna fordonet hos firman samt tankning. Din uppgift &auml;r att transportera f&ouml;retagsrepresentanter och gods i samband med m&auml;ssan. Du m&aring;ste haft B-k&ouml;rkort i minst 2 &aring;r.</p>\n	<p>\n		Vid fr&aring;gor, kontakta <a href=\"mailto:transport@larv.org\">transport@larv.org</a></p>\n	<h2>\n		F&ouml;retagsv&auml;rd</h2>\n	<div>\n		<p>\n			En f&ouml;retagsv&auml;rd tar personligen hand om de f&ouml;retag som kommer f&ouml;r att st&auml;lla ut p&aring; m&auml;ssan. Som f&ouml;retagsv&auml;rd ser du till att f&ouml;retaget trivs och att de f&aring;r ut s&aring; mycket som m&ouml;jligt av m&auml;ssan. Att vara f&ouml;retagsv&auml;rd &auml;r ett utm&auml;rkt s&auml;tt att f&aring; n&auml;rmare kontakt med ett visst f&ouml;retag.<br />\n			Din ans&ouml;kan ska inneh&aring;lla en motivering till varf&ouml;r du vill vara f&ouml;retagsv&auml;rd och varf&ouml;r du skulle passa f&ouml;r uppdraget. Vi vill &auml;ven veta vilken utbildning du l&auml;ser och hur l&aring;ngt du kommit i din utbildning.</p>\n		<p>\n			Matchningen mellan v&auml;rd och f&ouml;retag kommer att g&ouml;ras efter 25:e november, du blir d&aring; kontaktad via mail f&ouml;r att &ouml;nska f&ouml;retag. Vid tilldelningen av f&ouml;retag kommer det att tas h&auml;nsyn till om du har varit engagerad inom LARV tidigare, hur l&aring;ngt du har kommit i din utbildning samt &ouml;vrigt engagemang som g&ouml;r dig till en bra ambassad&ouml;r. Datum n&auml;r du gjort din intresseanm&auml;lan f&ouml;r att vara f&ouml;retagsv&auml;rd kan &auml;ven vara avg&ouml;rande vid tilldelningen, s&aring; anm&auml;l dig s&aring; snart som m&ouml;jligt.</p>\n		<p>\n			Vid fr&aring;gor, kontakta <a href=\"mailto:massvard@larv.org\">massvard@larv.org</a></p>\n	</div>\n</div>\n<h2>\n	Funktion&auml;r</h2>\n<p>\n	Tillsammans med ca 10 andra &auml;r du med under m&auml;ssdagen och hj&auml;lper till i Lounge-caf&eacute;t och i receptionen. Du kommer ocks&aring; f&aring; hj&auml;lpa till att rigga upp och ner under dagen.</p>\n<p>\n	Du kommer inte att beh&ouml;va jobba hela m&auml;sssan och arbetsb&ouml;rdan &auml;r inte tung. Sj&auml;lvklart f&aring;r du ta del av banketten ocks&aring;.</p>\n<p>\n	Vid fr&aring;gor, kontakta <a href=\"mailto:reception@larv.org\">reception@larv.org</a></p>\n<h2>\n	Gods</h2>\n<p>\n	Som godsarbetare arbetar du p&aring; Godsmotagningen med att hj&auml;lpa till och ta emot gods som f&ouml;retagen skickar f&ouml;r att anv&auml;nda till sina montrar. Du hj&auml;lper &auml;ven till med att flytta godset fr&aring;n mottagningen till F-huset d&auml;r f&ouml;retagen och f&ouml;retagsv&auml;rdarna sedan kommer och h&auml;mtar ut godset till sina monter byggen. Din hj&auml;lp kommer att beh&ouml;vas dagarna innan LARV och n&aring;gra timmar under sj&auml;lva m&auml;ssdagen. Du kommer att hinna med att bes&ouml;ka m&auml;ssan. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. Du f&aring;r &auml;ven ers&auml;ttning fr&aring;n LTU 100 kr/h, s&aring; det &auml;r ju ett bra s&auml;tt att f&aring; in n&aring;gon extra tusenlapp. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.&nbsp;</p>\n<p>\n	Har du fr&aring;gor skicka dem till <a href=\"mailto:logistik@larv.org\">logistik@larv.org</a></p>\n<h2>\n	Event</h2>\n<div>\n	<p>\n		Som Eventv&auml;rd f&ouml;r LARV kommer du att hj&auml;lpa till med att g&ouml;ra LARV till den arbetsmarknadsvecka som namnet syftar till. Tr&auml;ffa f&ouml;retagen p&aring; ett helt annat vis &auml;n du g&ouml;r under m&auml;ssan. Det du ska g&ouml;ra &auml;r att se till s&aring; att eventen g&aring;r smidigt genom att se till s&aring; att cateringen kommer p&aring; plats, att skriva ut utv&auml;rderingar &aring;t f&ouml;retagen mm. &nbsp;Du kommer att hinna bes&ouml;ka m&auml;ssan under dagen d&aring; det mesta av arbetet kommer att vara veckan innan LARV. F&ouml;r ditt engagemang kommer du bl.a. att f&aring; g&aring; p&aring; f&ouml;retagsmingel kv&auml;llen innan sj&auml;lva m&auml;ssan (bara f&ouml;r engagerade) och p&aring; Banketten. I din ans&ouml;kan f&aring;r du g&auml;rna ber&auml;tta lite kort om dig sj&auml;lv.</p>\n	<p>\n		Har du fr&aring;gor skicka dem till <a href=\"mailto:event@larv.org\">event@larv.org</a></p>\n</div>\n<p>\n	&nbsp;</p>',1,1323173436),(182,'foretag.annons','<h1>\n	Specifikationer katalogannons i f&auml;rg</h1>\n<p>\n	F&ouml;r LARV 2012 trycks inte katalog utan en webbaserad katalog anv&auml;nds. Nedan f&ouml;ljer specifikationer f&ouml;r materialet ni tills&auml;nder oss f&ouml;r webbkatalogen.</p>\n<ul>\n	<li>\n		<p>\n			Annonsen skall vara i f&auml;rg. Annonsens f&auml;rgformat m&aring;ste vara CMYK, (ej RGB).</p>\n	</li>\n	<li>\n		<p>\n			Annonsen skall vara 148x210mm (A5) med 5mm utfall, annonsens storlek inklusive utfall blir d&aring; 158mmx220mm</p>\n	</li>\n	<li>\n		<p>\n			Alla bilder skall vara h&ouml;guppl&ouml;sta, 300 DPI.</p>\n	</li>\n	<li>\n		<p>\n			Alla typsnitt skall vara konverterade till banor.</p>\n	</li>\n	<li>\n		<p>\n			Annonsen skall vara i filformatet PDF.</p>\n	</li>\n	<li>\n		<p>\n			Inga sk&auml;rm&auml;rken, passm&auml;rken, el. dyl. f&aring;r finnas med i annonsen, se exempel p&aring; m&auml;rken nedan, figur 1.</p>\n	</li>\n</ul>\n<p>\n	Vid fr&aring;gor g&auml;llande katalogen kontakta katalogansvarig p&aring;, <a href=\"mailto:katalog@larv.org\">katalog@larv.org</a></p>\n<h3>\n	Figur 1 Fel! Sk&auml;rm&auml;rken, passm&auml;rken eller dylikt ska inte finnas med</h3>\n<p>\n	<img alt=\"\" src=\"http://larv.org/images/upload/passmarken.png\" style=\"width: 571px; height: 130px; \" /></p>',1,1323173465),(183,'foretag.gods','<h1>\n	OM GODS TILL LARV 2012</h1>\n<p>\n	<font size=\"2\">F&ouml;retag som ska delta p&aring; LARV 2012 bokar sj&auml;lva frakten av sin monter till Universitetet. F&ouml;rtydligande f&ouml;ljer nedan.</font></p>\n<h2>\n	Gods m&auml;rkes enligt:</h2>\n<p>\n	&nbsp;&quot;LARV 2012&quot;<br />\n	070- 332 02 92<br />\n	Lule&aring; tekniska universitet<br />\n	Laboratoriev&auml;gen<br />\n	Godsmottagningen<br />\n	971 87 Lule&aring;&nbsp;</p>\n<h2>\n	Datum och fraktkrav</h2>\n<p>\n	Godset ska skickas s&aring; att det &auml;r framme p&aring; universitetet m&aring;ndag 23/1 eller tisdag 24/1. Uppbyggnad av m&auml;ssa p&aring;b&ouml;rjas 16.00 tisdag den 24/1.&nbsp; &Ouml;nskar ni skicka gods innan dessa datum ska logistikansvarig kontaktas. Skickas gods med t&aring;g eller bussgods m&aring;ste frakt vidare till Universitetet ombes&ouml;rjas av f&ouml;retaget sj&auml;lv.&nbsp;<b><u>Godset f&aring;r inte vara h&ouml;gre &auml;n 1,7m.</u></b>&nbsp;Avviker ert gods fr&aring;n h&ouml;jdkravet s&aring; m&aring;ste ni h&ouml;ra av er till logistikansvarig.</p>\n<h2>\n	Retur eller vidares&auml;ndning av gods</h2>\n<p>\n	Om ni i er fullst&auml;ndiga anm&auml;lan valt&nbsp;att LARV sk&ouml;ter frakten av ert gods till annan m&auml;ssa beh&ouml;ver ni inte boka n&aring;gon returfrakt. Kom ih&aring;g att skriva/kontakta logistikansvarig ang&aring;ende vilken m&auml;ssa det g&auml;ller. Skall gods tillbaka till f&ouml;retaget efter m&auml;ssan bokas detta av f&ouml;retaget sj&auml;lvt. Viktigt &auml;r att ni har med<b><u>&nbsp;en FRAKTSEDEL f&ouml;r returen</u></b>. Detta &auml;r viktigt att komma ih&aring;g eftersom att vi p&aring; LTU endast har sedlar som &auml;r f&ouml;rtryckta med Universitetets kundnummer.&nbsp;</p>\n<h2>\n	Kontroll och kontakt</h2>\n<p>\n	Innan m&auml;ssan kommer ni bli kontaktade av en f&ouml;retagsv&auml;rd som kommer att st&auml;lla fr&aring;gor om ert gods. Antal kollin, dimensioner, vikt, vilken spedit&ouml;r ni anv&auml;nder er av f&ouml;r frakten till LTU o.s.v. Efter m&auml;ssan ansvarar f&ouml;retagsv&auml;rdarna och f&ouml;retagsrepresentanterna f&ouml;r att packa ihop f&ouml;retagets monter och ta den till uppsamlingsplats. Mer information om hur utl&auml;mning och packning av montrar kommer att ske ges av f&ouml;retagsv&auml;rdarna vid kontakt innan m&auml;ssan.</p>\n<h3>\n	Fr&aring;gor och funderingar skickas till&nbsp;</h3>\n<p>\n	Adam &Ouml;str&ouml;m<br />\n	<a href=\"mailto:logistik@larv.org\">logistik@larv.org</a><br />\n	070 - 332 02 92 (09-16 vardagar)&nbsp;</p>',1,1323175739),(184,'kontakt.projektgruppen','<h1>\n	Projektgruppen</h1>\n<div style=\"float: left; clear: both; margin-bottom: 20px\">\n	<img alt=\"Sofie Bucht\" src=\"/images/crew/sofie.jpg\" style=\"font-size: 12px; float: left; width: 154px; height: 200px; \" />\n	<div style=\"float: left; width: 390px; margin-left: 5px\">\n		<h2>\n			Projektledare</h2>\n		<p>\n			<strong>Sofie Bucht</strong></p>\n		<p>\n			Alla projekt beh&ouml;ver en ledare. LARV&#39;s projektledare organiserar och delegerar arbetsuppgifter till gruppens medlemmar. Hon har hand om alla samarbeten och den &ouml;vergripande planen f&ouml;r LARV 2012.</p>\n		<p>\n			<a href=\"mailto:projektledare@larv.org\">projektledare@larv.org</a></p>\n	</div>\n</div>\n<div style=\"float: left; clear: both; margin-bottom: 20px\">\n	<img alt=\"Linus Winther\" src=\"/images/crew/linus.jpg\" style=\"font-size: 12px; float: left; width: 154px; height: 200px; \" />\n	<div style=\"float: left; width: 390px; margin-left