1>\n<p>\n	V&auml;lkommen till Norrbottensrummet p&aring; LARV 2012. Lule&aring; Tekniska Universitets arbetsmarknadsvecka inbjuder ditt f&ouml;retag att f&aring; vara med i LARV. I &aring;r &aring;terkommer norrbottensrummet som &auml;r en s&auml;rskild avdelning under m&auml;ssdagen d&auml;r enbart f&ouml;retag fr&aring;n norrbotten kommer att st&aring; och med ett begr&auml;nsad antal anst&auml;llda p&aring; max 100. Detta vill vi kunna erbjuda mindre f&ouml;retag som &auml;ven ni &ouml;nskar f&aring; student relationer men inte &auml;r i samma storlek som dem allra st&ouml;rsta f&ouml;retagen. Ta chansen att f&aring; tr&auml;ffa studenter inom tekniska grenar men &auml;ven i &aring;r humanistiska.</p>\n<p>\n	<br />\n	Pris. 5000:-<br />\n	I priset ing&aring;r</p>\n<ul>\n	<li>\n		<p>\n			2 bankettbiljetter (3-R&auml;tters). Kv&auml;llen efter m&auml;ssan (25 Jan)</p>\n	</li>\n	<li>\n		<p>\n			Kv&auml;llen F&ouml;re (2st). Mingel med f&ouml;retagsv&auml;rdar och f&ouml;retagsrepresentanter</p>\n	</li>\n	<li>\n		<p>\n			Lunch (2st) och fika (2st) under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			St&aring;bord; m&ouml;jlighet f&ouml;r er&nbsp;rollup (1-2 stycken)</p>\n	</li>\n</ul>\n<p>\n	<strong>Observera att &auml;ndringar &auml;r gjorda 7 Dec.</strong></p>\n<p>\n	Sista Anm&auml;lningsdag: 25 December</p>\n<p>\n	Anm&auml;lan g&ouml;rs p&aring;: <a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<p>\n	D&auml;refter f&aring;r ni ett mail om ytterligare praktiskt information om LARV.&nbsp;</p>',1,1323265875),(196,'foretag.norrbottensrummet','<h1>\n	LARV 2012</h1>\n<p>\n	V&auml;lkommen till Norrbottensrummet p&aring; LARV 2012. Lule&aring; Tekniska Universitets arbetsmarknadsvecka inbjuder ditt f&ouml;retag att f&aring; vara med i LARV. I &aring;r &aring;terkommer norrbottensrummet som &auml;r en s&auml;rskild avdelning under m&auml;ssdagen d&auml;r enbart f&ouml;retag fr&aring;n norrbotten kommer att st&aring; och med ett begr&auml;nsad antal anst&auml;llda p&aring; max 100. Detta vill vi kunna erbjuda mindre f&ouml;retag som &auml;ven ni &ouml;nskar f&aring; student relationer men inte &auml;r i samma storlek som dem allra st&ouml;rsta f&ouml;retagen. Ta chansen att f&aring; tr&auml;ffa studenter inom tekniska grenar men &auml;ven i &aring;r humanistiska.<br />\n	<br />\n	Norrbottensrummet &auml;r en avdelning p&aring; LARV som uppr&auml;ttats i samarbete med vissa av v&aring;ra samarbetsf&ouml;retag. Detta d&aring; vi &ouml;nskar m&ouml;jligg&ouml;ra f&ouml;r studenterna att m&ouml;ta &auml;ven de mindre akt&ouml;rerna i n&auml;ringslivet. Norrbottensrummet &auml;r till f&ouml;r dem, i f&ouml;rsta hand i Norrbotten bel&auml;gna, sm&aring;f&ouml;retagen som &auml;ven de &ouml;nskar skapa en relation med studerner vid LTU. Varesig man har utvecklings- eller rekryteringsbehov har vi en erfarenhet av att b&aring;da parter skapar stor nytta f&ouml;r varann i dessa relationer. Det ger &auml;ven en mer verklig bild av arbetsmarknaden med denna blandning av stora och mindre utst&auml;llare. Genom att st&auml;lla ut i Norrbottensrummet 2012 f&aring;r Ert f&ouml;retag inte bara vara med och fira ett jubileum utan &auml;ven m&ouml;jlighet till att m&ouml;ta s&aring;v&auml;l teknologer som humanister.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Pris. 5000:-<br />\n	I priset ing&aring;r</p>\n<ul>\n	<li>\n		<p>\n			2 bankettbiljetter (3-R&auml;tters). Kv&auml;llen efter m&auml;ssan (25 Jan)</p>\n	</li>\n	<li>\n		<p>\n			Kv&auml;llen F&ouml;re (2st). Mingel med f&ouml;retagsv&auml;rdar och f&ouml;retagsrepresentanter</p>\n	</li>\n	<li>\n		<p>\n			Lunch (2st) och fika (2st) under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			St&aring;bord; m&ouml;jlighet f&ouml;r er&nbsp;rollup (1-2 stycken)</p>\n	</li>\n</ul>\n<p>\n	<strong>Observera att &auml;ndringar &auml;r gjorda 7 Dec.</strong></p>\n<p>\n	Sista Anm&auml;lningsdag: 25 December</p>\n<p>\n	Anm&auml;lan g&ouml;rs p&aring;: <a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<p>\n	D&auml;refter f&aring;r ni ett mail om ytterligare praktiskt information om LARV.&nbsp;</p>',1,1323267363),(197,'foretag.norrbottensrummet','<h1>\n	LARV 2012</h1>\n<p>\n	V&auml;lkommen till Norrbottensrummet p&aring; LARV 2012. Teknologk&aring;rens arbetsmarknadsvecka inbjuder ditt f&ouml;retag att f&aring; vara med i LARV. I &aring;r &aring;terkommer norrbottensrummet som &auml;r en s&auml;rskild avdelning under m&auml;ssdagen d&auml;r enbart f&ouml;retag fr&aring;n norrbotten kommer att st&aring; och med ett begr&auml;nsad antal anst&auml;llda p&aring; max 100. Detta vill vi kunna erbjuda mindre f&ouml;retag som &auml;ven ni &ouml;nskar f&aring; student relationer men inte &auml;r i samma storlek som dem allra st&ouml;rsta f&ouml;retagen. Ta chansen att f&aring; tr&auml;ffa studenter inom tekniska grenar men &auml;ven i &aring;r humanistiska.<br />\n	<br />\n	Norrbottensrummet &auml;r en avdelning p&aring; LARV som uppr&auml;ttats i samarbete med vissa av v&aring;ra samarbetsf&ouml;retag. Detta d&aring; vi &ouml;nskar m&ouml;jligg&ouml;ra f&ouml;r studenterna att m&ouml;ta &auml;ven de mindre akt&ouml;rerna i n&auml;ringslivet. Norrbottensrummet &auml;r till f&ouml;r dem, i f&ouml;rsta hand i Norrbotten bel&auml;gna, sm&aring;f&ouml;retagen som &auml;ven de &ouml;nskar skapa en relation med studerner vid LTU. Varesig man har utvecklings- eller rekryteringsbehov har vi en erfarenhet av att b&aring;da parter skapar stor nytta f&ouml;r varann i dessa relationer. Det ger &auml;ven en mer verklig bild av arbetsmarknaden med denna blandning av stora och mindre utst&auml;llare. Genom att st&auml;lla ut i Norrbottensrummet 2012 f&aring;r Ert f&ouml;retag inte bara vara med och fira ett jubileum utan &auml;ven m&ouml;jlighet till att m&ouml;ta s&aring;v&auml;l teknologer som humanister.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Pris. 5000:-<br />\n	I priset ing&aring;r</p>\n<ul>\n	<li>\n		<p>\n			2 bankettbiljetter (3-R&auml;tters). Kv&auml;llen efter m&auml;ssan (25 Jan)</p>\n	</li>\n	<li>\n		<p>\n			Kv&auml;llen F&ouml;re (2st). Mingel med f&ouml;retagsv&auml;rdar och f&ouml;retagsrepresentanter</p>\n	</li>\n	<li>\n		<p>\n			Lunch (2st) och fika (2st) under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			St&aring;bord; m&ouml;jlighet f&ouml;r er&nbsp;rollup (1-2 stycken)</p>\n	</li>\n</ul>\n<p>\n	<strong>Observera att &auml;ndringar &auml;r gjorda 7 Dec.</strong></p>\n<p>\n	Sista Anm&auml;lningsdag: 25 December</p>\n<p>\n	Anm&auml;lan g&ouml;rs p&aring;: <a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<p>\n	D&auml;refter f&aring;r ni ett mail om ytterligare praktiskt information om LARV.&nbsp;</p>',1,1323269429),(198,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<h2>\n	Tider och Info</h2>\n<p>\n	Tider f&ouml;r m&auml;ssan: 09.00 - 15.30</p>\n<p>\n	Monterbygge p&aring;b&ouml;rjas 16.00 24 Jan</p>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV kan ni l&auml;sa om under <a href=\"/foretag/signup/\">Anm&auml;lan</a></p>',1,1323272409),(199,'foretag.boende','<h1>\n	Hotell - utst&auml;llare p&aring; LARV</h1>\n<p>\n	<font size=\"2\">Enkelrum:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 720:-/natt inkl frukost, exkl. moms (ord pris 1059:-/natt)</font></p>\n<p>\n	<font size=\"2\">Dubbelrum&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 895:-/natt inkl frukost, exkl. moms (ord pris 1234:-/natt)</font><br />\n	<br />\n	<font size=\"2\">Det finns inga rum f&ouml;rbokade utan erbjudandet g&auml;ller efter tillg&aring;ng - s&aring; best&auml;ll i tid. Utst&auml;llarna h&auml;nvisar till LARV n&auml;r de ringer och bokar.</font><br />\n	<br />\n	&nbsp;</p>',1,1323340391),(200,'foretag.boende','<h1>\n	Hotell - utst&auml;llare p&aring; LARV</h1>\n<p>\n	<font size=\"2\">Enkelrum:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 720:-/natt inkl frukost, exkl. moms (ord pris 1059:-/natt)</font></p>\n<p>\n	<font size=\"2\">Dubbelrum&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 895:-/natt inkl frukost, exkl. moms (ord pris 1234:-/natt)</font></p>\n<p>\n	&nbsp;</p>\n<p>\n	<b>BEST WESTERN Arctic Hotel</b><br />\n	Sandviksgatan 80<br />\n	972 34 Lule&aring;<br />\n	Tel: 0920-109 80<br />\n	Epost:&nbsp;<a href=\"mailto:rec@arctichotel.se\">rec@arctichotel.se</a> Hemsida:&nbsp;<a href=\"http://www.arctichotel.se/\">www.arctichotel.se</a></p>\n<p>\n	<br />\n	<font size=\"2\">Det finns inga rum f&ouml;rbokade utan erbjudandet g&auml;ller efter tillg&aring;ng - s&aring; best&auml;ll i tid. Utst&auml;llarna h&auml;nvisar till LARV n&auml;r de ringer och bokar.</font><br />\n	<br />\n	&nbsp;</p>',1,1323693726),(201,'foretag.signup','<h1>\n	Anm&auml;lan</h1>\n<h2>\n	Arbetsmarknadsdagar.se</h2>\n<p>\n	Arbetsmarknadsdagar.se &auml;r ett projekt sprunget ur samarbetet ARG som syftar till att undanr&ouml;ja praktiska problem man som f&ouml;retag st&ouml;tt p&aring; i str&auml;van att n&aring; ut till studenter och medlemmar p&aring; respektive k&aring;r.Sidans syfte &auml;r bland annat att f&ouml;renkla f&ouml;r f&ouml;retag att genomf&ouml;ra anm&auml;lningar till de olika m&auml;ssorna. P&aring; arbetsmarknadsdagar.se kan f&ouml;retag idag spara information f&ouml;r m&auml;ssanm&auml;lan och &aring;teranv&auml;nda mellan m&auml;ssor och &aring;r. Dessutom finns en FAQ som kan ge assistans vid eventuella problem eller fr&aring;gor om anm&auml;lan.</p>\n<p>\n	<strong>Inledande anm&auml;lan har st&auml;ngt f&ouml;r i &aring;r. Ni som har f&aring;tt godk&auml;nnande har till den 25 November p&aring; er att fylla i fullst&auml;ndiga anm&auml;lan.</strong></p>\n<div>\n	<a href=\"http://www.arbetsmarknadsdagar.se/\">Till Arbetsmarknadsdagar.se</a></div>\n<h2>\n	Baspaketet</h2>\n<div>\n	<ul>\n		<li>\n			<p>\n				Skjuts till boende eller Campus vid ankomst till Lule&aring;</p>\n		</li>\n		<li>\n			<p>\n				Skjuts till och fr&aring;n boende vid deltagande p&aring; &quot;kv&auml;llen f&ouml;re&quot; och m&auml;ssdagen</p>\n		</li>\n		<li>\n			<p>\n				Monteryta: 3*2 m, h&ouml;jd; 3m</p>\n		</li>\n		<li>\n			<p>\n				F&ouml;retagsv&auml;rd som underst&ouml;djer arbetet f&ouml;r just Ert f&ouml;retag inf&ouml;r och under m&auml;ssdagen</p>\n		</li>\n		<li>\n			<p>\n				2 biljetter till lunch, fika och LARVbankett</p>\n		</li>\n		<li>\n			<p>\n				Uppslag i m&auml;sskatalog(webbaserad)</p>\n		</li>\n		<li>\n			<p>\n				Tr&aring;dl&ouml;s internetuppkoppling</p>\n		</li>\n		<li>\n			<p>\n				El</p>\n		</li>\n		<li>\n			<p>\n				M&ouml;jlighet till personliga samtal med utvalda studenter</p>\n		</li>\n		<li>\n			<p>\n				Tilltr&auml;de till &quot;kv&auml;llen f&ouml;re&quot;</p>\n		</li>\n	</ul>\n	<p>\n		M&ouml;jliga tillval &auml;r bland annat:</p>\n	<ul>\n		<li>\n			<p>\n				Ut&ouml;kad monteryta</p>\n		</li>\n		<li>\n			<p>\n				Fler biljetter; lunch, fika, bankett</p>\n		</li>\n		<li>\n			<p>\n				Rekvisita; stolar, bord, mattor, blommor</p>\n		</li>\n		<li>\n			<p>\n				Monterevenemang (1/12-2011) eller synlighet i samband med Alpinaresa innan LARV (Kontakt med projektledare per telefon; 0706862585</p>\n		</li>\n		<li>\n			<p>\n				Monterupps&auml;ttning&bull; Spridning av utv&auml;rdering; antingen v&aring;r eller en vi tillsammans uppr&auml;ttar s&auml;rskilt f&ouml;r LARV</p>\n		</li>\n		<li>\n			<p>\n				Delgivning av V&aring;r utv&auml;rdering i n&auml;ra anslutning till avslutat LARV&nbsp;</p>\n		</li>\n	</ul>\n	<p>\n		Naturligtvis finns det m&ouml;jligheter att f&aring; en st&ouml;rre monteryta, fler biljetter till bankett, v&auml;xter till montern eller andra tillval. Priser f&ouml;r detta finner ni nedan och detta anm&auml;les i kompletterande anm&auml;lan.&nbsp;</p>\n	<p>\n		*LARV f&ouml;rfakturerar grundpaketet. Eventuella till&auml;gg, inklusive de som &ouml;nskas i kompletterande anm&auml;lan, faktuerars i efterhand. Var v&auml;nlig ange eventuellt ordernummer f&ouml;r faktura.&nbsp;</p>\n	<h3>\n		Tillval</h3>\n	<p>\n		Tillval kan ni hitta i Fullst&auml;ndiga anm&auml;lan. De tidigare prisuppgifter som funnits h&auml;r var f&ouml;r f&ouml;rra &aring;rets m&auml;ssa och g&auml;ller ej. De priser som st&aring;r i fullst&auml;ndiga anm&auml;lan &auml;r de som g&auml;ller.</p>\n</div>\n<h2>\n	Fullst&auml;ndig anm&auml;lan</h2>\n<div>\n	<p>\n		Fullst&auml;ndig anm&auml;lan inneh&aring;ller exakta uppgifter och kan l&auml;mnas som senast en m&aring;nad innan m&auml;ssan.&nbsp;</p>\n	<p>\n		<strong>Den fullst&auml;ndiga anm&auml;lan &ouml;ppnar 2012.11.03</strong></p>\n	<p>\n		<strong>Sista anm&auml;lningsdatum &auml;r 2012.11.25</strong></p>\n</div>\n<p>\n	&nbsp;</p>',1,1323812194),(202,'foretag.norrbottensrummet','<h1>\n	LARV 2012</h1>\n<p>\n	V&auml;lkommen till Norrbottensrummet p&aring; LARV 2012. Teknologk&aring;rens arbetsmarknadsvecka inbjuder ditt f&ouml;retag att f&aring; vara med i LARV. I &aring;r &aring;terkommer norrbottensrummet som &auml;r en s&auml;rskild avdelning under m&auml;ssdagen d&auml;r enbart f&ouml;retag fr&aring;n norrbotten kommer att st&aring; och med ett begr&auml;nsad antal anst&auml;llda p&aring; max 100. Detta vill vi kunna erbjuda mindre f&ouml;retag som &auml;ven ni &ouml;nskar f&aring; student relationer men inte &auml;r i samma storlek som dem allra st&ouml;rsta f&ouml;retagen. Ta chansen att f&aring; tr&auml;ffa studenter inom tekniska grenar men &auml;ven i &aring;r humanistiska.<br />\n	<br />\n	Norrbottensrummet &auml;r en avdelning p&aring; LARV som uppr&auml;ttats i samarbete med vissa av v&aring;ra samarbetsf&ouml;retag. Detta d&aring; vi &ouml;nskar m&ouml;jligg&ouml;ra f&ouml;r studenterna att m&ouml;ta &auml;ven de mindre akt&ouml;rerna i n&auml;ringslivet. Norrbottensrummet &auml;r till f&ouml;r dem, i f&ouml;rsta hand i Norrbotten bel&auml;gna, sm&aring;f&ouml;retagen som &auml;ven de &ouml;nskar skapa en relation med studerner vid LTU. Varesig man har utvecklings- eller rekryteringsbehov har vi en erfarenhet av att b&aring;da parter skapar stor nytta f&ouml;r varann i dessa relationer. Det ger &auml;ven en mer verklig bild av arbetsmarknaden med denna blandning av stora och mindre utst&auml;llare. Genom att st&auml;lla ut i Norrbottensrummet 2012 f&aring;r Ert f&ouml;retag inte bara vara med och fira ett jubileum utan &auml;ven m&ouml;jlighet till att m&ouml;ta s&aring;v&auml;l teknologer som humanister.</p>\n<p>\n	&nbsp;</p>\n<p>\n	I priset ing&aring;r</p>\n<ul>\n	<li>\n		<p>\n			2 bankettbiljetter (3-R&auml;tters). Kv&auml;llen efter m&auml;ssan (25 Jan)</p>\n	</li>\n	<li>\n		<p>\n			Kv&auml;llen F&ouml;re (2st). Mingel med f&ouml;retagsv&auml;rdar och f&ouml;retagsrepresentanter</p>\n	</li>\n	<li>\n		<p>\n			Lunch (2st) och fika (2st) under m&auml;ssdagen</p>\n	</li>\n	<li>\n		<p>\n			St&aring;bord; m&ouml;jlighet f&ouml;r er&nbsp;rollup (1-2 stycken)</p>\n	</li>\n</ul>\n<p>\n	<strong>Observera att &auml;ndringar &auml;r gjorda 7 Dec.</strong></p>\n<p>\n	Sista Anm&auml;lningsdag: 25 December</p>\n<p>\n	Anm&auml;lan g&ouml;rs p&aring;: <a href=\"mailto:pr@larv.org\">pr@larv.org</a></p>\n<p>\n	D&auml;refter f&aring;r ni ett mail om ytterligare praktiskt information om LARV.&nbsp;</p>',1,1323812214),(203,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<h2>\n	Tider och Info</h2>\n<p>\n	Tider f&ouml;r m&auml;ssan: 09.00 - 15.30</p>\n<p>\n	Monterbygge p&aring;b&ouml;rjas 15.30 24 Jan</p>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV kan ni l&auml;sa om under <a href=\"/foretag/signup/\">Anm&auml;lan</a></p>',247,1324032639),(204,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<h2>\n	Tider och Info</h2>\n<p>\n	Tider f&ouml;r m&auml;ssan: 09.00 - 15.30</p>\n<p>\n	Monterbygge p&aring;b&ouml;rjas 15.30 24 Jan</p>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV kan ni l&auml;sa om under <a href=\"/foretag/signup/\">Anm&auml;lan</a></p>',247,1324032651),(205,'foretag.fair','<h1>\n	M&auml;ssan</h1>\n<p>\n	M&auml;ssan h&aring;lles p&aring; LTU-campus i ett par av huvudbyggnaderna. Projektgruppen planerar f&ouml;r godsmottag men ordnar &auml;ven med mottagande och transport till och fr&aring;n m&auml;ssan f&ouml;r s&aring;v&auml;l f&ouml;retagsrepresentanter och off-campusstudenter.</p>\n<p>\n	De flesta kringaktiviteterna sker p&aring; LTU f&ouml;r att det ska bli smidigast m&ouml;jligt f&ouml;r samtliga parter.</p>\n<h2>\n	Tider och Info</h2>\n<p>\n	Tider f&ouml;r m&auml;ssan: 09.00 - 15.30</p>\n<p>\n	Monterbygge p&aring;b&ouml;rjas 15.30 24 Jan</p>\n<h2>\n	Baspaketet</h2>\n<p>\n	Vad som ing&aring;r i baspaketet f&ouml;r LARV kan ni l&auml;sa om under <a href=\"/foretag/signup/\">Anm&auml;lan</a></p>',247,1324032660),(206,'katalog.welcome','<h1>Välkommen till LARV-katalogen 2012!</h1>\n<p>Bla bla bla och lite blubb. Berätta lite om saker som är nytt eller så.</p>\n<br />\n<h2>En video från våra vänner</h2>\n<img src=\"/images/katalog/video-holder.gif\" alt=\"Videoplaceholder\" class=\"video\" />',1,1325468809),(207,'katalog.skolan','<div style=\"width: 800px;\">\n	<h1>\n		Om universitetet</h1>\n	<p>\n		Lule&aring; tekniska universitet &auml;r Skandinaviens nordligaste tekniska universitet med forskning och utbildning i v&auml;rldsklass. LTU:s samarbete, med f&ouml;retagen och med det omgivande samh&auml;llet, &auml;r v&aring;r styrka. Kontakterna med f&ouml;retag och samh&auml;lle hj&auml;lper oss att utveckla aktuell forskning och utbildning som motsvarar krav som omv&auml;rlden st&auml;ller p&aring; oss och p&aring; v&aring;ra studenter.&nbsp;</p>\n	<p>\n		Lule&aring; tekniska universitet bedriver forskning inom tekniskt vetenskapsomr&aring;de och humanistiskt-samh&auml;llsvetenskapligt vetenskapsomr&aring;de. Forskningen oms&auml;tter drygt 600 MSEK och omfattar 69 forsknings&auml;mnen samlade inom 6 prioriterade forskningsomr&aring;den och 6 utvecklingsomr&aring;den. &nbsp;</p>\n	<p>\n		Forskningen k&auml;nnetecknas av gr&auml;ns&ouml;verskridande samarbete mellan universitetets forskningsavdelningar och av n&auml;ra samverkan med n&auml;ringsliv och samh&auml;lle.&nbsp;</p>\n	<p>\n		S&aring;v&auml;l internationella och nationella storf&ouml;retag som l&auml;nets sm&aring;f&ouml;retag &auml;r involverade i LTU:s forsknings- och utvecklingsprojekt. F&ouml;retagen finns ocks&aring; med som en samverkanspart i universitetets centrumbildningar.&nbsp;</p>\n	<div>\n		&nbsp;</div>\n	<p>\n		&nbsp;</p>\n</div>',1,1325469332),(208,'katalog.skolan','<div style=\"width: 800px;\">\n	<h1>\n		LARV-Skolan</h1>\n	<p>\n		Lule&aring; tekniska universitet &auml;r Skandinaviens nordligaste tekniska universitet med forskning och utbildning i v&auml;rldsklass. LTU:s samarbete, med f&ouml;retagen och med det omgivande samh&auml;llet, &auml;r v&aring;r styrka. Kontakterna med f&ouml;retag och samh&auml;lle hj&auml;lper oss att utveckla aktuell forskning och utbildning som motsvarar krav som omv&auml;rlden st&auml;ller p&aring; oss och p&aring; v&aring;ra studenter.&nbsp;</p>\n	<p>\n		Lule&aring; tekniska universitet bedriver forskning inom tekniskt vetenskapsomr&aring;de och humanistiskt-samh&auml;llsvetenskapligt vetenskapsomr&aring;de. Forskningen oms&auml;tter drygt 600 MSEK och omfattar 69 forsknings&auml;mnen samlade inom 6 prioriterade forskningsomr&aring;den och 6 utvecklingsomr&aring;den. &nbsp;</p>\n	<p>\n		Forskningen k&auml;nnetecknas av gr&auml;ns&ouml;verskridande samarbete mellan universitetets forskningsavdelningar och av n&auml;ra samverkan med n&auml;ringsliv och samh&auml;lle.&nbsp;</p>\n	<p>\n		S&aring;v&auml;l internationella och nationella storf&ouml;retag som l&auml;nets sm&aring;f&ouml;retag &auml;r involverade i LTU:s forsknings- och utvecklingsprojekt. F&ouml;retagen finns ocks&aring; med som en samverkanspart i universitetets centrumbildningar.&nbsp;</p>\n	<div>\n		&nbsp;</div>\n	<p>\n		&nbsp;</p>\n</div>\n<p>\n	&nbsp;</p>',1,1325469379),(209,'katalog.welcome','<h1>\n	V&auml;lkommen till LARV-katalogen 2012!</h1>\n<p>\n	Och den &auml;r rykande f&auml;rsk! S&aring; f&auml;rsk att vi m&aring;ste m&ouml;ra den lite till innan vi visar upp det, men ni har redan 105st f&ouml;retag(och det kommer till fler inom kort) att f&ouml;rkovra er i under tiden som vi jobbar vidare med det sista. Bland annat s&aring; kommer en stilig s&ouml;kfunktion och en eminent export inom dom n&auml;rmaste timmarna!</p>\n<p>\n	Om ni har(eller skapar) en anv&auml;ndare h&auml;r p&aring; larv.org s&aring; kan ni &auml;ven redan nu &ouml;nska personliga samtal med f&ouml;retag, instruktioner om hur det fungerar kommer snart om ni &auml;r fundersamma.</p>\n<p>\n	Men hur som helst, det finns mycket att uppt&auml;cka och &auml;nnu mer kommer s&aring; k&ouml;r h&aring;rt!</p>\n<p>\n	MvH</p>\n<p>\n	Henrik Norberg</p>\n<p>\n	<span style=\"font-size:11px;\"><var>Katalogansvarig LARV 2012</var></span></p>\n<p>\n	<a href=\"mailto:katalog@larv.org\"><span style=\"font-size:11px;\"><var>katalog@larv.org</var></span></a></p>',NULL,1325472024),(210,'katalog.welcom